INSERT INTO "PUBLIC"."NAME_CARD" VALUES(5, STRINGDECODE('Upphaflega stutt form af germ\u00f6nskum n\u00f6fnum eins og ADELAIDE e\u00f0a ADELINA sem byrja \u00e1 frumefninu adal sem \u00fe\u00fd\u00f0ir \u201eg\u00f6fugt\u201c. \u00deetta nafn bar Augusta Ada King (1815-1852), greifynjan af Lovelace (\u00feekkt sem Ada Lovelace), d\u00f3ttir Byrons l\u00e1var\u00f0ar. H\u00fan var a\u00f0sto\u00f0arma\u00f0ur Charles Babbage, uppfinningamanns snemma v\u00e9lr\u00e6nnar t\u00f6lvu.'), TRUE, 'Ada');         
