INSERT INTO "PUBLIC"."NAME_CARD" VALUES(23, STRINGDECODE('Latinized mynd af gr\u00edska nafninu \u1f08\u03b3\u03b1\u03b8\u03ae (Agathe), dregi\u00f0 af gr\u00edsku \u1f00\u03b3\u03b1\u03b8\u03cc\u03c2 (agathos) sem \u00fe\u00fd\u00f0ir \u201cgott\u201c. Heilagur Agatha var p\u00edslarvottur fr\u00e1 3. \u00f6ld fr\u00e1 Sikiley sem var pynta\u00f0ur og drepinn eftir a\u00f0 hafa hvatt framfarir r\u00f3mverskrar emb\u00e6ttismanns. D\u00fdrlingurinn var v\u00ed\u00f0a virtur \u00e1 mi\u00f0\u00f6ldum og nafn hennar hefur veri\u00f0 nota\u00f0 um alla kristna Evr\u00f3pu (\u00e1 \u00fdmsum stafsetningum). R\u00e1\u00f0g\u00e1tuh\u00f6fundurinn Agatha Christie (1890-1976) var fr\u00e6gur n\u00fat\u00edmaberi me\u00f0 \u00feessu nafni.'), TRUE, 'Agatha');     
