INSERT INTO "PUBLIC"."NAME_CARD" VALUES(43, STRINGDECODE('Fornleifar s\u00e6nskar l\u00edtilsh\u00e1ttar af ALHET og hollensku afbrig\u00f0i ALEIDA auk ungverskrar \u00e6ttlei\u00f0ingar \u00e1 hollenska nafninu. \u00cd Hollandi var \u00feetta nafn bori\u00f0 af fyrsta kvenkyns l\u00e6kni landsins, Aletta Jacobs (1854-1929).'), TRUE, 'Aletta');    
