INSERT INTO "PUBLIC"."NAME_CARD" VALUES(47, STRINGDECODE('Kvenlegt form ALEXANDER. Alexander mikli stofna\u00f0i nokkrar borgir me\u00f0 \u00feessu nafni (e\u00f0a endurnefndi \u00fe\u00e6r) \u00feegar hann framlengdi heimsveldi sitt til austurs. Athyglisver\u00f0ust \u00feeirra er Alexandr\u00eda \u00ed Egyptalandi, stofnu\u00f0 af Alexander \u00e1ri\u00f0 331 f.Kr.'), TRUE, STRINGDECODE('Alexandr\u00eda'));  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(48, STRINGDECODE('Fr\u00e1 gr\u00edska nafninu \u1f0c\u03bb\u03b5\u03be\u03b9\u03c2 (Alexis) sem \u00fe\u00fd\u00f0ir \u201ehj\u00e1lpar\u201c e\u00f0a \u201evarnarma\u00f0ur\u201c, dregi\u00f0 af gr\u00edsku \u1f00\u03bb\u03ad\u03be\u03c9 (alexo) sem \u00fe\u00fd\u00f0ir \u201ea\u00f0 verja, til a\u00f0 hj\u00e1lpa\u201c. \u00deetta var nafn 3. aldar f.Kr. gr\u00edskt teiknimyndask\u00e1ld og einnig nokkurra d\u00fdrlinga. \u00dea\u00f0 er nota\u00f0 nokku\u00f0 til skiptis vi\u00f0 skylda nafni\u00f0 \u1f08\u03bb\u03ad\u03be\u03b9\u03bf\u03c2 e\u00f0a Alexius, bori\u00f0 af fimm byzant\u00edskum keisurum. \u00cd enskum\u00e6landi heimi er \u00fea\u00f0 oftar nota\u00f0 sem kvenkynsnafn.'), TRUE, 'Alexis');         
