INSERT INTO "PUBLIC"."NAME_CARD" VALUES(53, STRINGDECODE('Fr\u00e1 gamla franska nafninu Aalis, stutt form Adelais, sj\u00e1lft stutt form af germanska nafninu Adalheidis (sj\u00e1 ADELAIDE). \u00deetta nafn var\u00f0 vins\u00e6lt \u00ed Frakklandi og Englandi \u00e1 12. \u00f6ld. \u00dea\u00f0 var me\u00f0al algengustu nafna Englands \u00fear til \u00e1 16. \u00f6ld \u00feegar \u00fea\u00f0 f\u00f3r a\u00f0 hnigna. \u00dea\u00f0 var endurvaki\u00f0 \u00e1 19. \u00f6ldinni. \u00deetta nafn bar kvenhetja sk\u00e1ldsagna Lewis Carroll, Alice`s Adventures in Wonderland (1865) og Through the Looking Glass (1871).'), TRUE, 'Alice');   
