INSERT INTO "PUBLIC"."NAME_CARD" VALUES(76, STRINGDECODE('Enskt form af fornfranska nafninu Am\u00e9e sem \u00fe\u00fd\u00f0ir \u201e\u00e1stk\u00e6rt\u201c (n\u00fat\u00edmafranska aim\u00e9e), \u00fej\u00f3\u00f0tunguform latnesku Amata. Sem enskt nafn var \u00fea\u00f0 \u00ed notkun \u00e1 mi\u00f0\u00f6ldum (\u00fe\u00f3 ekki algengt) og var endurvaki\u00f0 \u00e1 19. \u00f6ld.'), TRUE, 'Amy');             
