INSERT INTO "PUBLIC"."NAME_CARD" VALUES(79, STRINGDECODE('Kvenkyns ANASTASIUS. \u00deetta var nafn 4. aldar d\u00fdrlinga fr\u00e1 Dalmat\u00edu sem var p\u00edslarv\u00e6ttur me\u00f0an ofs\u00f3knir D\u00ed\u00f3klet\u00edanusar keisara voru. Vegna hennar hefur nafni\u00f0 veri\u00f0 algengt \u00ed austurr\u00e9tttr\u00fana\u00f0arkristni (\u00ed \u00fdmsum stafsetningum). Sem enskt nafn hefur \u00fea\u00f0 veri\u00f0 \u00ed notkun s\u00ed\u00f0an \u00e1 mi\u00f0\u00f6ldum. Fr\u00e6gur flutningsma\u00f0ur var yngsta d\u00f3ttir s\u00ed\u00f0asta r\u00fassneska keisarans Nikul\u00e1sar II, sem s\u00f6g\u00f0ust hafa sloppi\u00f0 vi\u00f0 aft\u00f6ku fj\u00f6lskyldu sinnar \u00e1ri\u00f0 1918.'), TRUE, STRINGDECODE('Anastas\u00eda'));      
