INSERT INTO "PUBLIC"."NAME_CARD" VALUES(120, STRINGDECODE('Merkir \u201elj\u00f3n Gu\u00f0s\u201c \u00e1 hebresku, fr\u00e1 \u05d0\u05b2\u05e8\u05b4\u05d9 (`ari) sem \u00fe\u00fd\u00f0ir \u201elj\u00f3n\u201c og \u05d0\u05b5\u05dc (\u2018el) sem \u00fe\u00fd\u00f0ir\u201e Gu\u00f0 \u201c. \u00cd Gamla testamentinu er \u00fea\u00f0 nota\u00f0 sem anna\u00f0 nafn yfir borgina Jer\u00fasalem. Shakespeare nota\u00f0i \u00fea\u00f0 sem nafn anda \u00ed leikritinu \u00d3ve\u00f0ri\u00f0 (1611) og eitt tungl \u00daranusar ber \u00feetta nafn honum til hei\u00f0urs. Sem enskt nafn var\u00f0 \u00fea\u00f0 algengara fyrir konur \u00e1 n\u00edunda \u00e1ratugnum, s\u00e9rstaklega eftir a\u00f0 \u00fea\u00f0 var nota\u00f0 fyrir titilpers\u00f3nuna \u00ed Walt Disney kvikmyndinni Litlu hafmeyjan (1989).'), TRUE, STRINGDECODE('Ar\u00edel'));      
