INSERT INTO "PUBLIC"."NAME_CARD" VALUES(159, STRINGDECODE('Merking \u00f3\u00feekkt. A\u00feena var gr\u00edska gy\u00f0ja visku og herna\u00f0ar og verndargy\u00f0ja borgarinnar A\u00feenu \u00ed Grikklandi. L\u00edklegt er a\u00f0 nafn hennar s\u00e9 dregi\u00f0 af nafni borgarinnar en ekki \u00f6fugt. Fyrsta umtal hennar vir\u00f0ist vera 15. aldar f.Kr. m\u00fdken\u00edsk gr\u00edsk \u00e1letrun fr\u00e1 Knossos \u00e1 Kr\u00edt. D\u00f3ttir Seifs, h\u00fan var s\u00f6g\u00f0 hafa sprotti\u00f0 \u00far h\u00f6f\u00f0i hans fullvaxin eftir a\u00f0 hann haf\u00f0i gegnt og gleypt m\u00f3\u00f0ur s\u00edna Metis. A\u00feena tengist \u00f3l\u00edvutr\u00e9nu og uglunni.'), TRUE, 'Athena');    
