INSERT INTO "PUBLIC"."NAME_CARD" VALUES(245, STRINGDECODE('\u00far gr\u00edsku, barbaros s\u00e1 sem ekki er h\u00e6gt a\u00f0 skilja, \u00fe. e. a. s. \u00fatlendingur. 4/12. heil\u00f6g Barbara, p\u00edslarvottur fr\u00e1 Nik\u00f3med\u00edu d. 306.'), TRUE, 'Barbara');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(246, STRINGDECODE('Afleidd \u00far gr\u00edsku \u03b2\u03ac\u03c1\u03b2\u03b1\u03c1\u03bf\u03c2 (barbaros) sem \u00fe\u00fd\u00f0ir \u201eframandi\u201c. Samkv\u00e6mt go\u00f0s\u00f6gninni var heilagur Barbara ung kona drepin af f\u00f6\u00f0ur s\u00ednum Dioscorus, sem \u00fe\u00e1 var drepin af eldingu. H\u00fan er verndari arkitekta, jar\u00f0fr\u00e6\u00f0inga, steinh\u00f6ggvara og st\u00f3rskotali\u00f0smanna. Vegna fr\u00e6g\u00f0ar hennar kom nafni\u00f0 almennt \u00ed notkun \u00ed hinum kristna heimi \u00e1 mi\u00f0\u00f6ldum. \u00c1 Englandi var\u00f0 \u00fea\u00f0 sjaldg\u00e6ft eftir si\u00f0askipti m\u00f3tm\u00e6lenda, en \u00fea\u00f0 var endurvaki\u00f0 \u00e1 19. \u00f6ld.'), TRUE, STRINGDECODE('Barb\u00e1ra'));  
