INSERT INTO "PUBLIC"."NAME_CARD" VALUES(252, STRINGDECODE('Merking \u00feessa nafns er ekki \u00feekkt me\u00f0 vissu. Fyrsti \u00fe\u00e1tturinn g\u00e6ti tengst \u00edtalskri bella \u201efallegri\u201c. Seinni \u00fe\u00e1tturinn g\u00e6ti veri\u00f0 germanskur lind sem \u00fe\u00fd\u00f0ir \u201csveigjanlegur, mj\u00fakur, bl\u00ed\u00f0ur\u201c (og \u00ed framhaldi af \u00fev\u00ed \u201csn\u00e1kur, h\u00f6ggormur\u201c). \u00deetta nafn kom fyrst upp \u00e1 17. \u00f6ld og var s\u00ed\u00f0an nota\u00f0 af Alexander Pope \u00ed lj\u00f3\u00f0i s\u00ednu The Nape of the Lock (1712).'), TRUE, 'Belinda');       
