INSERT INTO "PUBLIC"."NAME_CARD" VALUES(286, STRINGDECODE('Upphaflega stutt form af germ\u00f6nskum n\u00f6fnum sem byrja \u00e1 frumefninu beraht sem \u00fe\u00fd\u00f0ir \u201ebjart, fr\u00e6gt\u201c. \u00dea\u00f0 bar m\u00f3\u00f0ur Karls mikla \u00e1 8. \u00f6ld og \u00fea\u00f0 var vins\u00e6lt \u00ed Englandi af Norm\u00f6nnum. \u00dea\u00f0 d\u00f3 \u00fat sem enskt nafn eftir mi\u00f0alda en var endurvaki\u00f0 \u00e1 19. \u00f6ld. Nafni\u00f0 kemur einnig fyrir \u00ed su\u00f0ur-germ\u00f6nskum \u00fej\u00f3\u00f0s\u00f6gum (oft stafsett Perchta e\u00f0a Berchta) sem tilheyra gy\u00f0ju d\u00fdra og vefna\u00f0ar.'), TRUE, 'Bertha');   
