INSERT INTO "PUBLIC"."NAME_CARD" VALUES(386, STRINGDECODE('Afbrig\u00f0i af KATINKA.'), TRUE, 'Cathinca');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(387, STRINGDECODE('Lat\u00edn kvenlegt form af r\u00f3mverska \u00e6ttarnafninu Caecilius, sem var dregi\u00f0 af latnesku caecus sem \u00fe\u00fd\u00f0ir \u201eblindur\u201c. Saint Cecilia var h\u00e1lfgo\u00f0sagnakenndur p\u00edslarvottur \u00e1 2. e\u00f0a 3. \u00f6ld sem var d\u00e6mdur til a\u00f0 deyja vegna \u00feess a\u00f0 h\u00fan neita\u00f0i a\u00f0 tilbi\u00f0ja r\u00f3mversku gu\u00f0ina. Eftir a\u00f0 tilraunir til a\u00f0 k\u00e6fa hana mist\u00f3kust var h\u00fan h\u00e1lsh\u00f6ggvinn. S\u00ed\u00f0ar var liti\u00f0 \u00e1 hana sem verndard\u00fdrling t\u00f3nlistar og t\u00f3nlistarmanna. Vegna vins\u00e6lda d\u00fdrlingsins var\u00f0 nafni\u00f0 algengt \u00ed hinum kristna heimi \u00e1 mi\u00f0\u00f6ldum. Normannar komu me\u00f0 \u00fea\u00f0 til Englands, \u00fear sem \u00fea\u00f0 var almennt stafsett Cecily - lat\u00ednaformi\u00f0 Cecilia kom \u00ed notkun \u00e1 18. \u00f6ld.'), TRUE, 'Cecilia');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(388, STRINGDECODE('Lat\u00edn kvenlegt form af r\u00f3mverska \u00e6ttarnafninu Caecilius, sem var dregi\u00f0 af latnesku caecus sem \u00fe\u00fd\u00f0ir \u201eblindur\u201c. Saint Cecilia var h\u00e1lfgo\u00f0sagnakenndur p\u00edslarvottur \u00e1 2. e\u00f0a 3. \u00f6ld sem var d\u00e6mdur til a\u00f0 deyja vegna \u00feess a\u00f0 h\u00fan neita\u00f0i a\u00f0 tilbi\u00f0ja r\u00f3mversku gu\u00f0ina. Eftir a\u00f0 tilraunir til a\u00f0 k\u00e6fa hana mist\u00f3kust var h\u00fan h\u00e1lsh\u00f6ggvinn. S\u00ed\u00f0ar var liti\u00f0 \u00e1 hana sem verndard\u00fdrling t\u00f3nlistar og t\u00f3nlistarmanna. Vegna vins\u00e6lda d\u00fdrlingsins var\u00f0 nafni\u00f0 algengt \u00ed hinum kristna heimi \u00e1 mi\u00f0\u00f6ldum. Normannar komu me\u00f0 \u00fea\u00f0 til Englands, \u00fear sem \u00fea\u00f0 var almennt stafsett Cecily - lat\u00ednaformi\u00f0 Cecilia kom \u00ed notkun \u00e1 18. \u00f6ld.'), TRUE, STRINGDECODE('Cecil\u00eda'));           
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(389, STRINGDECODE('S\u00e6nskt afbrig\u00f0i af CHARLOTTE.'), TRUE, 'Charlotta');     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(390, STRINGDECODE('Fr\u00f6nsk kvenkyns minnkun \u00e1 CHARLES. \u00dea\u00f0 var kynnt fyrir Bretlandi \u00e1 17. \u00f6ld. \u00deetta var nafn \u00fe\u00fdskf\u00e6dds 18. aldar drottningarm\u00f3ts St\u00f3ra-Bretlands og \u00cdrlands. Annar athyglisver\u00f0ur flutningsma\u00f0ur var Charlotte Bront\u00eb (1816-1855), elst \u00feriggja Bront\u00eb systra og h\u00f6fundur Jane Eyre og Villette. \u00deetta nafn var nokku\u00f0 algengt \u00ed Frakklandi, Englandi og Bandar\u00edkjunum snemma \u00e1 20. \u00f6ld. \u00dea\u00f0 var\u00f0 nokku\u00f0 vins\u00e6lt \u00ed Frakklandi og Englandi \u00ed lok 20. aldar, einmitt \u00feegar \u00fea\u00f0 var \u00e1 l\u00e1gmarki \u00ed Bandar\u00edkjunum. \u00dea\u00f0 klifra\u00f0i flj\u00f3tt \u00e1 bandar\u00edsku vins\u00e6ldalistana og komst inn \u00e1 topp t\u00edu \u00e1ri\u00f0 2014.'), TRUE, 'Charlotte');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(391, 'Stutt mynd af CHRISTINA.', TRUE, 'Christa');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(392, STRINGDECODE('Diminutive af CHRISTINE e\u00f0a CHRISTINA.'), TRUE, 'Christel');  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(393, STRINGDECODE('Fr\u00e1 Christiana, latnesku kvenkyns formi KRISTINS. \u00deetta var nafn snemma, hugsanlega go\u00f0sagnakennds, d\u00fdrlings sem kvalinn var af hei\u00f0num f\u00f6\u00f0ur s\u00ednum. \u00dea\u00f0 var einnig bori\u00f0 af 17. aldar s\u00e6nskri drottningu og verndar listum sem g\u00e1fu k\u00f3r\u00f3nu s\u00edna til a\u00f0 ver\u00f0a r\u00f3mversk-ka\u00fe\u00f3lskur.'), TRUE, 'Christina');  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(394, STRINGDECODE('Fr\u00f6nsku formi CHRISTINA, sem og afbrig\u00f0i \u00e1 \u00f6\u00f0rum tungum\u00e1lum.'), TRUE, 'Christine');  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(395, STRINGDECODE('Kvenkynsform af seint latneska nafninu Clarus, sem \u00fe\u00fdddi \u201esk\u00fdrt, bjart, fr\u00e6gt\u201c. Nafni\u00f0 Clarus var bori\u00f0 af nokkrum fyrstu d\u00fdrlingum. Kvenkynsformi\u00f0 var vins\u00e6lt af Saint Clare fr\u00e1 Assisi \u00e1 13. \u00f6ld (k\u00f6llu\u00f0 Chiara \u00e1 \u00edt\u00f6lsku), vinur og fylgisma\u00f0ur heilags Francis, sem yfirgaf au\u00f0uga fj\u00f6lskyldu s\u00edna til a\u00f0 stofna r\u00f6\u00f0 nunnna sem voru \u00feekkt sem Poor Clares. Sem enskt nafn hefur \u00fea\u00f0 veri\u00f0 \u00ed notkun fr\u00e1 mi\u00f0\u00f6ldum, upphaflega \u00ed formi Clare, \u00fe\u00f3 a\u00f0 lat\u00edna stafsetningin Clara hafi or\u00f0i\u00f0 vins\u00e6lli \u00e1 19. \u00f6ld.'), TRUE, 'Clara');    
