INSERT INTO "PUBLIC"."NAME_CARD" VALUES(446, STRINGDECODE('Fr\u00e1 gr\u00edska nafninu \u0394\u03c9\u03c1\u03af\u03c2 (Doris), sem \u00fe\u00fdddi \u201cDorian kona\u201c. D\u00f3r\u00edumenn voru gr\u00edsk \u00e6ttb\u00e1lkur sem hern\u00e1mu Pel\u00f3psskaga fr\u00e1 og me\u00f0 12. \u00f6ld f.Kr. \u00cd gr\u00edskri go\u00f0afr\u00e6\u00f0i var Doris sj\u00f3n\u00edmfi, eitt af m\u00f6rgum b\u00f6rnum Oceanus og Tethys. \u00dea\u00f0 byrja\u00f0i a\u00f0 nota \u00fea\u00f0 sem enskt nafn \u00e1 19. \u00f6ld. Fr\u00e6gur handhafi er bandar\u00edska leikkonan Doris Day (1924-2019).'), TRUE, 'Doris');            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(447, STRINGDECODE('Kvenkynsform s\u00ed\u00f0gr\u00edska nafnsins \u0394\u03c9\u03c1\u03cc\u03b8\u03b5\u03bf\u03c2 (Dorotheos), sem \u00fe\u00fdddi \u201egj\u00f6f Gu\u00f0s\u201c \u00far gr\u00edsku \u03b4\u1ff6\u03c1\u03bf\u03bd (doron) sem \u00fe\u00fd\u00f0ir \u201egj\u00f6f\u201c og \u03b8\u03b5\u03cc\u03c2 (theos) sem \u00fe\u00fd\u00f0ir \u201egu\u00f0\u201c. Nafni\u00f0 Theodore er samsett \u00far s\u00f6mu \u00fe\u00e1ttum \u00ed \u00f6fugri r\u00f6\u00f0. D\u00f3r\u00f3thea var nafn tveggja fyrstu d\u00fdrlinga, einkum p\u00edslarvottinn Dorothea fr\u00e1 Sesareu \u00e1 4. \u00f6ld. \u00dea\u00f0 var einnig bori\u00f0 af heil\u00f6gu Dorothea fr\u00e1 Montau \u00e1 14. \u00f6ld, sem var verndard\u00fdrlingur Pr\u00fasslands.'), TRUE, 'Dorothea');        
