INSERT INTO "PUBLIC"."NAME_CARD" VALUES(453, STRINGDECODE('Kvenkynsform s\u00ed\u00f0gr\u00edska nafnsins \u0394\u03c9\u03c1\u03cc\u03b8\u03b5\u03bf\u03c2 (Dorotheos), sem \u00fe\u00fdddi \u201egj\u00f6f Gu\u00f0s\u201c \u00far gr\u00edsku \u03b4\u1ff6\u03c1\u03bf\u03bd (doron) sem \u00fe\u00fd\u00f0ir \u201egj\u00f6f\u201c og \u03b8\u03b5\u03cc\u03c2 (theos) sem \u00fe\u00fd\u00f0ir \u201egu\u00f0\u201c. Nafni\u00f0 Theodore er samsett \u00far s\u00f6mu \u00fe\u00e1ttum \u00ed \u00f6fugri r\u00f6\u00f0. Dorothea var nafn tveggja fyrstu d\u00fdrlinga, einkum p\u00edslarvottinn 4. aldar Dorothea af Cesarea. \u00dea\u00f0 var einnig bori\u00f0 af heil\u00f6gu Dorothea fr\u00e1 Montau \u00e1 14. \u00f6ld, sem var verndard\u00fdrlingur Pr\u00fasslands.'), TRUE, STRINGDECODE('D\u00f3rothea'));               
