INSERT INTO "PUBLIC"."NAME_CARD" VALUES(585, STRINGDECODE('Enskt kvenlegt form Aemilius (sj\u00e1 EMIL). \u00cd enskum\u00e6landi heimi var \u00fea\u00f0 ekki algengt fyrr en eftir a\u00f0 \u00fe\u00fdska h\u00fasi\u00f0 \u00ed Hannover kom til breska h\u00e1s\u00e6tisins \u00e1 18. \u00f6ld; prinsessan Amelia Sophia (1711-1786) var almennt \u00feekkt sem Emily \u00e1 ensku, jafnvel \u00fe\u00f3 Amelia s\u00e9 \u00f3tengt nafn. \u00deetta nafn var \u00ed me\u00f0allagi vins\u00e6lt mest alla 20. \u00f6ldina og var\u00f0 mj\u00f6g vins\u00e6lt um aldam\u00f3tin 21. \u00f6ld. \u00dea\u00f0 var stigah\u00e6sta nafn st\u00falkna \u00ed Bandar\u00edkjunum fr\u00e1 1996 til 2007 og n\u00e1\u00f0i svipu\u00f0um stigum \u00ed \u00f6\u00f0rum enskum\u00e6landi l\u00f6ndum um svipa\u00f0 leyti. Heights, og bandar\u00edska sk\u00e1ldi\u00f0 Emily Dickinson (1830-1886).'), TRUE, STRINGDECODE('Emil\u00fd'));  
