INSERT INTO "PUBLIC"."NAME_CARD" VALUES(615, STRINGDECODE('\u00de\u00fd\u00f0ir hugsanlega \u201estjarna\u201c \u00e1 persnesku. A\u00f0 \u00f6\u00f0rum kosti g\u00e6ti \u00fea\u00f0 veri\u00f0 aflei\u00f0a af nafni Austur-Austur-gy\u00f0junnar ISHTAR. Esterarb\u00f3k \u00ed Gamla testamentinu segir fr\u00e1 Ester drottningu, konu gy\u00f0inga Persakonungs. R\u00e1\u00f0gjafi konungs, Haman, f\u00e9kk konunginn til a\u00f0 \u00fatr\u00fdma \u00f6llum Gy\u00f0ingum \u00ed r\u00edkinu. Esther vara\u00f0i vi\u00f0 \u00feessu sams\u00e6ri Mordekai fr\u00e6nda s\u00edns og opinbera\u00f0i \u00e6ttir Gy\u00f0inga og sannf\u00e6r\u00f0i konunginn um a\u00f0 taka Haman af l\u00edfi \u00ed sta\u00f0inn. Upprunalega hebreska nafni\u00f0 hennar var Hadassah. \u00deetta nafn hefur veri\u00f0 nota\u00f0 \u00ed enskum\u00e6landi heimi fr\u00e1 si\u00f0askiptum m\u00f3tm\u00e6lenda. \u00cd Amer\u00edku hlaut \u00fea\u00f0 auki\u00f0 vins\u00e6ldir eftir f\u00e6\u00f0ingu Esther Cleveland (1893-1980), d\u00f3ttur Grovers Cleveland forseta [1].'), TRUE, 'Esther');       
