INSERT INTO "PUBLIC"."NAME_CARD" VALUES(758, STRINGDECODE('\u00de\u00fd\u00f0ir \u201ed\u00fdr\u00f0\u201c, fr\u00e1 port\u00fag\u00f6lsku og sp\u00e6nsku titlinum Mar\u00edu mey Mar\u00edu da Gl\u00f3ria og Mar\u00eda de Gloria. Maria da Gl\u00f3ria (1819-1853) var d\u00f3ttir brasil\u00edska keisarans Pedro I og var\u00f0 a\u00f0 lokum drottning Port\u00fagals sem Maria II. Nafni\u00f0 var kynnt enskum\u00e6landi heimi af sk\u00e1lds\u00f6gu EDEN Southworth Gloria (1891) og leikriti George Bernard Shaw \u00de\u00fa getur aldrei sagt (1898), sem b\u00e6\u00f0i eru me\u00f0 pers\u00f3num me\u00f0 port\u00fag\u00f6lskan bakgrunn [1]. \u00dea\u00f0 var vins\u00e6lt snemma \u00e1 20. \u00f6ld af bandar\u00edsku leikkonunni Gloria Swanson (1899-1983). Annar fr\u00e6gur handhafi er fem\u00ednistinn Gloria Steinem (1934-).'), TRUE, STRINGDECODE('Glor\u00eda'));           
