INSERT INTO "PUBLIC"."NAME_CARD" VALUES(894, STRINGDECODE('Ensk mynd af gr\u00edska \u1f19\u03bb\u03ad\u03bd\u03b7 (Helene), l\u00edklega \u00far gr\u00edsku \u1f11\u03bb\u03ad\u03bd\u03b7 (helene) sem \u00fe\u00fd\u00f0ir \u201ekyndill\u201c e\u00f0a \u201ecorposant\u201c, e\u00f0a hugsanlega tengd \u03c3\u03b5\u03bb\u03ae\u03bd\u03b7 (selene) sem \u00fe\u00fd\u00f0ir \u201etungl\u201c. \u00cd gr\u00edskri go\u00f0afr\u00e6\u00f0i var Helen d\u00f3ttir Seifs og Leda, en r\u00e1n \u00feeirra af Par\u00eds var ors\u00f6k Tr\u00f3justr\u00ed\u00f0sins. Nafni\u00f0 var einnig bori\u00f0 af heil\u00f6gu Helenu \u00e1 4. \u00f6ld, m\u00f3\u00f0ur r\u00f3mverska keisarans Konstant\u00edns, sem \u00e1tti a\u00f0 finna hinn sanna kross \u00ed fer\u00f0 til Jer\u00fasalem. Upphaflega var nafni\u00f0 nota\u00f0 me\u00f0al frumkristinna til hei\u00f0urs d\u00fdrlingnum, \u00f6fugt vi\u00f0 klass\u00edskur karakter. \u00c1 Englandi var \u00fea\u00f0 almennt stafsett Ellen \u00e1 mi\u00f0\u00f6ldum og stafsetningin Helen var ekki reglulega notu\u00f0 fyrr en eftir endurreisnart\u00edmann. Fr\u00e6gur flutningsma\u00f0ur var Helen Keller (1880-1968), bandar\u00edskur rith\u00f6fundur og fyrirlesari sem var b\u00e6\u00f0i blind og heyrnarlaus.'), TRUE, 'Helen');           
