INSERT INTO "PUBLIC"."NAME_CARD" VALUES(997, STRINGDECODE('Afleitt fr\u00e1 germanska frumefninu id sem \u00fe\u00fd\u00f0ir \u201cvinna, vinnuafl\u201c. Normannar fluttu \u00feetta nafn til Englands, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 d\u00f3 a\u00f0 lokum \u00fearna \u00e1 mi\u00f0\u00f6ldum. \u00dea\u00f0 var endurvaki\u00f0 \u00e1 19. \u00f6ld, a\u00f0 hluta til vegna kvenhetjunnar \u00ed lj\u00f3\u00f0i Alfred Lord Tennyson, prinsessan (1847), sem s\u00ed\u00f0ar var a\u00f0l\u00f6gu\u00f0 a\u00f0 leikritinu Ida (1884) eftir Gilbert og Sullivan. \u00de\u00f3tt m\u00e1lfr\u00e6\u00f0in s\u00e9 ekki skyld, \u00fe\u00e1 er \u00feetta er nafn fjalls \u00e1 eyjunni Kr\u00edt \u00fear sem samkv\u00e6mt gr\u00edskri go\u00f0s\u00f6gn f\u00e6ddist gu\u00f0inn Seifur.'), TRUE, 'Ida');       
