INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1040, STRINGDECODE('Form af IRENE \u00e1 nokkrum tungum\u00e1lum.'), TRUE, 'Irena');  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1041, STRINGDECODE('\u00dar gr\u00edsku \u0395\u1f30\u03c1\u03ae\u03bd\u03b7 (Eirene), dregi\u00f0 af or\u00f0i sem \u00fe\u00fd\u00f0ir \u201efri\u00f0ur\u201c. \u00deetta var nafn gr\u00edska gy\u00f0junnar sem pers\u00f3nuger\u00f0i fri\u00f0inn, einn af \u1f6d\u03c1\u03b1\u03b9 (Horai). \u00dea\u00f0 var einnig bori\u00f0 af nokkrum frumkristnum d\u00fdrlingum. Nafni\u00f0 var algengt \u00ed Byzantine Empire, einkum bori\u00f0 af 8. aldar keisaraynju, sem var fyrsta konan til a\u00f0 lei\u00f0a heimsveldi\u00f0. H\u00fan starfa\u00f0i upphaflega sem regent fyrir son sinn, en l\u00e9t drepa hann s\u00ed\u00f0ar og stj\u00f3rna einum. \u00deetta nafn hefur jafnan veri\u00f0 vins\u00e6lli me\u00f0al kristinna manna \u00ed Austurr\u00edki. \u00cd enskum\u00e6landi heimi var \u00fea\u00f0 ekki nota\u00f0 reglulega fyrr en \u00e1 19. \u00f6ld.'), TRUE, 'Irene');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1042, 'Hugsanlega finnskur minnkandi af IRINA.', TRUE, 'Irja');       
