INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1047, STRINGDECODE('Mi\u00f0alda oks\u00edtan\u00edsk mynd af ELIZABETH. \u00dea\u00f0 dreif\u00f0ist um Sp\u00e1n, Port\u00fagal og Frakkland og var\u00f0 algengt me\u00f0al k\u00f3ngaf\u00f3lks \u00e1 12. \u00f6ld. \u00dea\u00f0 n\u00e1\u00f0i vins\u00e6ldum \u00e1 Englandi \u00e1 13. \u00f6ld eftir a\u00f0 Isabella af Angoul\u00eame giftist enska konunginum J\u00f3hannesi og \u00fea\u00f0 var s\u00ed\u00f0an styrkt \u00feegar Isabella fr\u00e1 Frakklandi giftist Edward II \u00e1 n\u00e6stu \u00f6ld. annars sta\u00f0ar er \u00fea\u00f0 tali\u00f0 samhli\u00f0a nafn, svo sem \u00ed Frakklandi \u00fear sem \u00fea\u00f0 er nota\u00f0 samhli\u00f0a \u00c9lisabeth. Nafni\u00f0 bar tv\u00e6r sp\u00e6nskar drottningar, \u00fear \u00e1 me\u00f0al Isabel fr\u00e1 Kastil\u00edu, sem styrkti ranns\u00f3knir Christopher Columbus.'), TRUE, 'Isabel');  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1048, STRINGDECODE('Lat\u00edna form ISABEL. \u00deetta nafn var bori\u00f0 af m\u00f6rgum konunglegum mi\u00f0\u00f6ldum, \u00fear \u00e1 me\u00f0al drottningarsamf\u00e9l\u00f6gum Englands, Frakklands, Port\u00fagals, Heilaga r\u00f3mverska heimsveldisins og Ungverjalands, svo og \u00f6flugu valdadrottningu Isabellu af Kastil\u00edu (r\u00e9tt kalla\u00f0 Isabel). \u00cd Bandar\u00edkjunum var \u00feetta form miki\u00f0 sjaldg\u00e6fari en Isabel \u00fear til snemma \u00e1 t\u00edunda \u00e1ratugnum, \u00feegar \u00fea\u00f0 byrja\u00f0i a\u00f0 aukast hratt \u00ed vins\u00e6ldum. \u00dea\u00f0 n\u00e1\u00f0i h\u00e1marki \u00e1 \u00e1runum 2009 og 2010, \u00feegar \u00fea\u00f0 var vins\u00e6lasta nafn st\u00falkna \u00ed Amer\u00edku, \u00f3tr\u00faleg h\u00e6kkun \u00e1 a\u00f0eins 20 \u00e1rum. Fr\u00e6gur handhafi er \u00edtalska leikkonan Isabella Rossellini (1952-).'), TRUE, 'Isabella');         
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1049, STRINGDECODE('Afbrig\u00f0i ISIDORA. Fr\u00e6gur flutningsma\u00f0ur var bandar\u00edski dansarinn Isadora Duncan (1877-1927).'), TRUE, 'Isadora');             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1050, STRINGDECODE('Afleitt fr\u00e1 germanska frumefninu id sem \u00fe\u00fd\u00f0ir \u201cvinna, vinnuafl\u201c. Normannar fluttu \u00feetta nafn til Englands, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 d\u00f3 a\u00f0 lokum \u00fearna \u00e1 mi\u00f0\u00f6ldum. \u00dea\u00f0 var endurvaki\u00f0 \u00e1 19. \u00f6ld, a\u00f0 hluta til vegna kvenhetjunnar \u00ed lj\u00f3\u00f0i Alfred Lord Tennyson, prinsessan (1847), sem s\u00ed\u00f0ar var a\u00f0l\u00f6gu\u00f0 a\u00f0 leikritinu Ida (1884) eftir Gilbert og Sullivan. \u00de\u00f3tt m\u00e1lfr\u00e6\u00f0in s\u00e9 ekki skyld, \u00fe\u00e1 er \u00feetta er nafn fjalls \u00e1 eyjunni Kr\u00edt \u00fear sem samkv\u00e6mt gr\u00edskri go\u00f0s\u00f6gn f\u00e6ddist gu\u00f0inn Seifur.'), TRUE, STRINGDECODE('\u00cdda'));   
