INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1075, STRINGDECODE('Gr\u00edsk mynd af Egyptian Ist (endurbygg\u00f0 sem Iset e\u00f0a Ueset), sem \u00fe\u00fdddi hugsanlega \u201eh\u00e1s\u00e6ti\u00f0\u201c. \u00cd egypskri go\u00f0afr\u00e6\u00f0i var Isis gy\u00f0ja himins og n\u00e1tt\u00faru, kona Osiris og m\u00f3\u00f0ir Horus. H\u00fan var upphaflega l\u00fdst me\u00f0 h\u00e1s\u00e6tisl\u00edkingu \u00ed h\u00e1s\u00e6ti en \u00e1 seinni t\u00edmum var henni bl\u00e1si\u00f0 saman vi\u00f0 gy\u00f0juna Hathor og l\u00fdst me\u00f0 horn af k\u00fa \u00e1 h\u00f6f\u00f0i s\u00e9r. H\u00fan var l\u00edka d\u00fdrku\u00f0 af f\u00f3lki utan Egyptalands, svo sem Grikkjum og R\u00f3mverjum.'), TRUE, STRINGDECODE('\u00cdsis'));  
