INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1081, STRINGDECODE('Uppruni \u00feessa nafns er \u00f3viss, \u00fe\u00f3 a\u00f0 nokkrar keltneskar r\u00e6tur hafi veri\u00f0 lag\u00f0ar til. \u00dea\u00f0 er m\u00f6gulegt a\u00f0 nafni\u00f0 s\u00e9 a\u00f0 lokum germanskt, kannski fr\u00e1 tilg\u00e1tuheiti eins og Ishild, sem samanstendur af frumefnunum er \u201c\u00eds, j\u00e1rn\u201c og hild \u201cbardaga\u201c. \u00cd s\u00f6gu\u00f6ld Arthur Arthur go\u00f0s\u00f6gnin Isolde var \u00edrsk prinsessa unnust Mark\u00fasi af Cornwall konungi. Eftir a\u00f0 hafa drukki\u00f0 \u00e1stardrykk fyrir slysni var\u00f0 h\u00fan elskhugi riddarans Tristan sem leiddi til h\u00f6rmulegs dau\u00f0a \u00feeirra. Sagan var vins\u00e6l \u00e1 mi\u00f0\u00f6ldum og nafni\u00f0 var\u00f0 tilt\u00f6lulega algengt \u00e1 Englandi \u00e1 \u00feeim t\u00edma. \u00dea\u00f0 var sjaldg\u00e6ft \u00e1 19. \u00f6ld, \u00fe\u00f3 nokkur \u00e1hugi hafi skapast af \u00f3peru Richard Wagners Tristan und Isolde (1865).'), TRUE, STRINGDECODE('\u00cdsold'));              
