INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1090, STRINGDECODE('Ensk mynd mi\u00f0alda af Jehanne, fornfr\u00f6nsk kvenkyns mynd af Iohannes (sj\u00e1 JOHN). \u00deetta var\u00f0 algengasta kvenkynsform J\u00f3hannesar \u00e1 17. \u00f6ld, umfram Joan. \u00c1 fyrri hluta 20. aldar n\u00e1\u00f0i Joan enn einu sinni Jane \u00ed nokkra \u00e1ratugi b\u00e6\u00f0i \u00ed Bandar\u00edkjunum og Bretlandi. Me\u00f0al fr\u00e6gra handhafanna eru \u00f3kr\u00fdnd enska drottningin Lady Jane Gray (1536-1554), sem stj\u00f3rna\u00f0i a\u00f0eins \u00ed 9 daga, Breski sk\u00e1ldsagnah\u00f6fundurinn Jane Austen (1775-1817), sem skrifa\u00f0i Sense and Sensibility and Pride and Ford\u00f3ma, breski frumskur\u00f0l\u00e6knirinn Jane Goodall (1934-) og bandar\u00edska leikkonan Jane Fonda (1937-). \u00deetta er l\u00edka nafn a\u00f0alpers\u00f3nunnar \u00ed sk\u00e1lds\u00f6gu Charlotte Bront\u00eb, Jane Eyre (1847), \u00fear sem segir fr\u00e1 dapurlegri bernsku Jane og sambandi hennar vi\u00f0 Edward Rochester.'), TRUE, 'Jane');         
