INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1100, STRINGDECODE('N\u00fat\u00edma fr\u00f6nsk mynd Jehanne, fornfr\u00f6nsk kvenleg mynd af Iohannes (sj\u00e1 JOHN). \u00deetta hefur veri\u00f0 \u00e1rei\u00f0anlega vins\u00e6lasta franska nafni\u00f0 \u00e1 stelpum s\u00ed\u00f0an \u00e1 13. \u00f6ld. J\u00f3hanna af \u00d6rk er \u00feekkt sem Jeanne d`Arc \u00ed Frakklandi.'), TRUE, 'Jeanne');     
