INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1111, STRINGDECODE('Enska og p\u00f3lska mynd af latnesku Iohanna, sem var dregin af gr\u00edsku \u1f38\u03c9\u03ac\u03bd\u03bd\u03b1 (Ioanna), kvenkyns formi Ioannes (sj\u00e1 JOHN). \u00deetta er stafsetningin sem notu\u00f0 er \u00ed Enska N\u00fdja testamentinu, \u00fear sem h\u00fan tilheyrir fylgismanni Jes\u00fa sem er talinn d\u00fdrlingur. \u00c1 mi\u00f0\u00f6ldum \u00e1 Englandi var \u00fea\u00f0 nota\u00f0 sem lat\u00edn\u00edskt form Joan (venjulegt kvenform J\u00f3hannesar) og \u00fea\u00f0 var\u00f0 algengt sem eiginnafn \u00e1 19. \u00f6ld.'), TRUE, STRINGDECODE('J\u00f3anna'));             
