INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1141, STRINGDECODE('Fr\u00e1 hebreska nafninu \u05d9\u05b0\u05d4\u05d5\u05bc\u05d3\u05b4\u05d9\u05ea (Yehudit) sem \u00fe\u00fd\u00f0ir \u201ckona gy\u00f0inga\u201c, kvenkyns af \u05d9\u05b0\u05d4\u05d5\u05bc\u05d3\u05b4\u05d9 (yehudi), og v\u00edsar a\u00f0 lokum til manns \u00far \u00e6ttkv\u00edsl J\u00fada. \u00cd Gamla testamentinu er Judith ein af hettiskonum Esa\u00fa. \u00deetta er l\u00edka nafn a\u00f0alpers\u00f3nunnar \u00ed ap\u00f3kr\u00fdfu J\u00fad\u00edtab\u00f3kinni. H\u00fan drap Holofernes, innr\u00e1sarforingja Ass\u00fdr\u00edu, me\u00f0 \u00fev\u00ed a\u00f0 afh\u00f6f\u00f0a hann \u00ed svefni. Sem enskt nafn var\u00f0 \u00fea\u00f0 ekki algengt fyrr en eftir si\u00f0askipti m\u00f3tm\u00e6lenda, \u00fer\u00e1tt fyrir \u00f6rf\u00e1 snemma d\u00e6mi \u00e1 mi\u00f0\u00f6ldum. \u00dea\u00f0 var \u00fe\u00f3 nota\u00f0 fyrr \u00e1 meginlandi Evr\u00f3pu og var bori\u00f0 af nokkrum evr\u00f3pskum k\u00f3ngaf\u00f3lki, svo sem 9. \u00f6ld Judith af B\u00e6jaralandi.'), TRUE, 'Judith');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1142, STRINGDECODE('Kvenkynsform af r\u00f3mverska \u00e6ttarnafninu JULIUS. Me\u00f0al athyglisver\u00f0ra kvenna \u00far \u00feessari fj\u00f6lskyldu voru Julia Augusta (einnig \u00feekkt sem Livia Drusilla), eiginkona \u00c1g\u00fastusar keisara, og J\u00fal\u00eda eldri, d\u00f3ttir \u00c1g\u00fastusar og kona T\u00edber\u00edusar. Einstaklingur me\u00f0 \u00feessu nafni minnist stuttlega \u00e1 N\u00fdja testamenti\u00f0. \u00dea\u00f0 var einnig bori\u00f0 af nokkrum fyrstu d\u00fdrlingum og p\u00edslarvottum, \u00fear \u00e1 me\u00f0al verndard\u00fdrlingi Kors\u00edku. A\u00f0 auki nota\u00f0i Shakespeare \u00fea\u00f0 \u00ed gamanmynd sinni The Two Gentlemen of Verona (1594). \u00dea\u00f0 hefur veri\u00f0 algengt sem eiginnafn \u00ed enskum\u00e6landi heimi a\u00f0eins s\u00ed\u00f0an \u00e1 18. \u00f6ld. Fr\u00e6gur n\u00fat\u00edmaberi er bandar\u00edska leikkonan Julia Roberts (1967-).'), TRUE, 'Julia');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1143, STRINGDECODE('Afleitt fr\u00e1 YEHUDAH. \u00deetta er bibl\u00edulegt \u00f6rnefni sem og n\u00fat\u00edmanafn fjallsv\u00e6\u00f0isins \u00ed su\u00f0urhluta \u00cdsraelslands.'), TRUE, STRINGDECODE('J\u00fadea'));         
