INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1147, STRINGDECODE('Kvenleg mynd af Iulianus (sj\u00e1 JULIAN). \u00deetta var nafn 4. aldar d\u00fdrlingur og p\u00edslarvottur fr\u00e1 Nicomedia og einnig blessu\u00f0 Juliana fr\u00e1 Norwich, einnig k\u00f6llu\u00f0 Julian, 14. aldar dulspekingur og rith\u00f6fundur. Nafni\u00f0 var einnig bori\u00f0 af 20. aldar drottningu Hollands. \u00cd Englandi hefur \u00feetta form veri\u00f0 \u00ed notkun s\u00ed\u00f0an \u00e1 18. \u00f6ld, \u00e1samt eldra forminu Gillian.'), TRUE, STRINGDECODE('J\u00fal\u00edana'));               
