INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1220, STRINGDECODE('Fr\u00e1 r\u00f3mversku \u00e6ttarnafni sem hugsanlega var dregi\u00f0 af latnesku claudus sem \u00fe\u00fd\u00f0ir \u201ehaltur, lama\u00f0ur\u201c. \u00deetta var nafn f\u00f6\u00f0urlandsfj\u00f6lskyldu \u00e1berandi \u00ed r\u00f3mverskum stj\u00f3rnm\u00e1lum. Forfa\u00f0ir fj\u00f6lskyldunnar var sag\u00f0ur hafa veri\u00f0 Sabine lei\u00f0togi \u00e1 6. \u00f6ld f.Kr. a\u00f0 nafni Attius Clausus og t\u00f3k upp nafni\u00f0 Appius Claudius \u00feegar hann var\u00f0 r\u00f3mverskur r\u00edkisborgari. Fj\u00f6lskyldan framleiddi nokkra r\u00f3mverska keisara fr\u00e1 1. \u00f6ld, \u00fear \u00e1 me\u00f0al keisarann \u200b\u200beinfaldlega \u00feekktan sem Claudius. Honum var eitra\u00f0 af konu sinni Agrippinu til a\u00f0 koma Nero syni s\u00ednum (stj\u00fapsoni Claudiusar) til valda. Nafni\u00f0 var bori\u00f0 af nokkrum fyrstu d\u00fdrlingum, \u00fear \u00e1 me\u00f0al 7. aldar biskup \u00ed Besan\u00e7on.'), TRUE, STRINGDECODE('Kl\u00e1d\u00eda'));      
