INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1282, STRINGDECODE('\u00dar r\u00f3mversku cognomen Laurentius, sem \u00fe\u00fdddi \u201efr\u00e1 Laurentum\u201c. Laurentum var borg \u00e1 \u00cdtal\u00edu til forna, nafn hennar er sennilega dregi\u00f0 af latneska laurus \u201elaurel\u201c. Saint Laurence var 3. aldar dj\u00e1kni og p\u00edslarvottur fr\u00e1 R\u00f3m. Samkv\u00e6mt hef\u00f0inni var hann brenndur lifandi \u00e1 neti vegna \u00feess a\u00f0 \u00feegar hann var skipa\u00f0ur a\u00f0 afhenda fj\u00e1rsj\u00f3\u00f0i kirkjunnar kynnti hann sj\u00faka og f\u00e1t\u00e6ka. Vegna vins\u00e6lda d\u00fdrlingsins kom nafni\u00f0 \u00ed almenna notkun \u00ed hinum kristna heimi (\u00ed \u00fdmsum stafsetningum). \u00c1 mi\u00f0\u00f6ldum var \u00feetta nafn algengt \u00e1 Englandi, a\u00f0 hluta til vegna annars d\u00fdrlings me\u00f0 \u00feessu nafni, 7. aldar erkibiskup af Kantaraborg. . S\u00f6mulei\u00f0is hefur \u00fea\u00f0 veri\u00f0 algengt \u00e1 \u00cdrlandi vegna Saint Laurence O`Toole \u00e1 12. \u00f6ld (sem h\u00e9t r\u00e9ttu nafni Lorc\u00e1n). Fr\u00e1 19. \u00f6ld hefur stafsetningin Lawrence veri\u00f0 algengari, s\u00e9rstaklega \u00ed Amer\u00edku. Fr\u00e6gur handhafi var breski leikarinn Laurence Olivier (1907-1989).'), TRUE, STRINGDECODE('L\u00e1rens\u00edna'));   
