INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1288, STRINGDECODE('N\u00fat\u00edmalegt form mi\u00f0aldaheitis LEYN \u00ed gegnum n\u00fat\u00edmalegra (en samt fornaldar) form LEIJN. \u00deetta nafn hefur veri\u00f0 nota\u00f0 \u00e1 hverju \u00e1ri a\u00f0 minnsta kosti s\u00ed\u00f0ustu 130 \u00e1rin, en var aldrei of algengt: nafni\u00f0 var hva\u00f0 vins\u00e6last \u00e1ri\u00f0 1900 \u00feegar 17 n\u00fdf\u00e6ddir str\u00e1kar fengu \u00feetta nafn. Einnig voru \u00e1ri\u00f0 2010 n\u00e6rri 250 flutningsmenn alls \u00ed Hollandi.'), TRUE, 'Lein');  
