INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1352, STRINGDECODE('Kvenlegt form af LUCIUS. Saint Lucia var p\u00edslarvottur fr\u00e1 4. \u00f6ld fr\u00e1 Syracuse. Sagt var a\u00f0 h\u00fan hef\u00f0i fengi\u00f0 augun \u00fat \u00far s\u00e9r og \u00fear me\u00f0 er h\u00fan verndard\u00fdrlingur blindra. H\u00fan var v\u00ed\u00f0a virt \u00e1 mi\u00f0\u00f6ldum og nafn hennar hefur veri\u00f0 nota\u00f0 um alla kristna Evr\u00f3pu (\u00ed \u00fdmsum stafsetningum). \u00dea\u00f0 hefur veri\u00f0 nota\u00f0 \u00e1 Englandi s\u00ed\u00f0an \u00e1 12. \u00f6ld, venjulega \u00ed stafsetningunum Lucy e\u00f0a Luce.'), TRUE, 'Lucia');    
