INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1400, STRINGDECODE('Stutt mynd af \u00fdmsum n\u00f6fnum, \u00fear \u00e1 me\u00f0al AMALIA, MARIA, MAGDALENA og MATILDA. \u00c1berandi handhafi var s\u00e6nski rith\u00f6fundurinn og stofukonan Magdalena \u201eMalla\u201c Silfverstolpe (1782-1861). Malla er einnig nafn tveggja fjalla og fri\u00f0lands \u00ed Nor\u00f0ur-Finnlandi.'), TRUE, 'Malla');      
