INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1414, STRINGDECODE('Komi\u00f0 fr\u00e1 lat\u00ednu Margarita, sem var \u00far gr\u00edsku \u03bc\u03b1\u03c1\u03b3\u03b1\u03c1\u03af\u03c4\u03b7\u03c2 (margar\u00edtar) sem \u00fe\u00fd\u00f0ir \u201eperla\u201c, or\u00f0 sem var l\u00edklega a\u00f0 lokum l\u00e1ntaka fr\u00e1 ind\u00f3-\u00edr\u00f6nsku m\u00e1li. Heil\u00f6g Margr\u00e9t, verndari ver\u00f0andi m\u00e6\u00f0ra, var p\u00edslarv\u00e6ttur \u00ed Ant\u00edokk\u00edu \u00e1 4. \u00f6ld. Seinna s\u00f6gur s\u00f6g\u00f0u fr\u00e1 fl\u00f3tta s\u00ednum fr\u00e1 drekanum, sem h\u00fan var oft l\u00fdst me\u00f0 \u00ed mi\u00f0alda list. D\u00fdrlingurinn var vins\u00e6ll \u00e1 mi\u00f0\u00f6ldum og nafn hennar hefur veri\u00f0 miki\u00f0 nota\u00f0 \u00ed hinum kristna heimi. Sem ensku heiti hefur \u00fea\u00f0 veri\u00f0 mj\u00f6g vins\u00e6lt fr\u00e1 mi\u00f0\u00f6ldum. \u00dea\u00f0 var efsta nafn st\u00falkna \u00ed Englandi og Wales \u00ed 1920, 30 og 40, en \u00fea\u00f0 hafna\u00f0i \u00e1 seinni hluta 20. aldar. A\u00f0rir d\u00fdrlingar me\u00f0 \u00feessu nafni eru drottning Skotlands og prinsessa af Ungverjalandi. \u00dea\u00f0 var einnig bori\u00f0 af Margr\u00e9ti I Danadrottningu sem sameina\u00f0i Danm\u00f6rku, Sv\u00ed\u00fej\u00f3\u00f0 og Noreg \u00e1 14. \u00f6ld. Me\u00f0al fr\u00e6gra b\u00f3kmenntabera eru bandar\u00edski rith\u00f6fundurinn Margaret Mitchell (1900-1949), h\u00f6fundur Gone with the Wind og kanad\u00edski rith\u00f6fundurinn Margaret Atwood (1939-). A\u00f0rir eru bandar\u00edski mannfr\u00e6\u00f0ingurinn Margaret Mead (1901-1978) og breski fors\u00e6tisr\u00e1\u00f0herrann Margaret Thatcher (1925-2013).'), TRUE, 'Margret');          
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1415, STRINGDECODE('\u00far gr\u00edsku: perla. 20/7. heil\u00f6g Margr\u00e9t fr\u00e1 Ant\u00edok\u00edu (d. 300), \u00e1 hana var heiti\u00f0 \u00ed barnsnau\u00f0.'), TRUE, STRINGDECODE('Margr\u00e9t'));       
