INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1418, 'birta hafsins.', TRUE, STRINGDECODE('Marhei\u00f0ur'));        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1419, STRINGDECODE('Latin mynd af gr\u00edsku \u039c\u03b1\u03c1\u03af\u03b1, \u00far hebresku \u05de\u05b4\u05e8\u05b0\u05d9\u05b8\u05dd (sj\u00e1 MARY). Mar\u00eda er venjulegt form nafnsins \u00ed m\u00f6rgum evr\u00f3pskum tungum\u00e1lum, auk aukaatri\u00f0a \u00e1 \u00f6\u00f0rum tungum\u00e1lum svo sem ensku (\u00fear sem algeng stafsetning er Mar\u00eda). \u00cd sumum l\u00f6ndum, til d\u00e6mis \u00de\u00fdskalandi, P\u00f3llandi og \u00cdtal\u00edu, er Maria stundum nota\u00f0 sem karlkyns millinafn. \u00deetta var nafn tveggja valdadrottninga \u00ed Port\u00fagal. \u00dea\u00f0 var einnig bori\u00f0 af Habsborgardrottningu Maria Theresu (1717-1780), en arfleif\u00f0 l\u00e9na f\u00f6\u00f0ur hennar, helga r\u00f3mverska keisarans Karls VI, h\u00f3f upphafsstr\u00ed\u00f0 Austurr\u00edkis.'), TRUE, 'Maria');         
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1420, STRINGDECODE('Fr\u00f6nsk og t\u00e9kknesk mynd af MARIA. \u00dea\u00f0 hefur veri\u00f0 mj\u00f6g algengt \u00ed Frakklandi s\u00ed\u00f0an \u00e1 13. \u00f6ld. Vi\u00f0 upphaf 20. aldar var \u00fea\u00f0 gefi\u00f0 um \u00fea\u00f0 bil 20 pr\u00f3sent franskra st\u00falkna. \u00deetta hlutfall hefur l\u00e6kka\u00f0 jafnt og \u00fe\u00e9tt \u00e1 \u00f6ldinni og \u00fea\u00f0 l\u00e6kka\u00f0i \u00far efsta s\u00e6ti \u00e1ri\u00f0 1958. Athyglisver\u00f0ur handhafi \u00feessa nafns var Marie Antoinette, drottning Frakklands sem var tekin af l\u00edfi af guillotine me\u00f0an \u00e1 fr\u00f6nsku byltingunni st\u00f3\u00f0. \u00d6nnur var Marie Curie (1867-1934), e\u00f0lisfr\u00e6\u00f0ingur og efnafr\u00e6\u00f0ingur sem rannsaka\u00f0i geislavirkni me\u00f0 eiginmanni s\u00ednum Pierre. \u00cd Frakklandi er \u00fea\u00f0 stundum nota\u00f0 sem karlkynsnafn \u00ed p\u00f6run eins og Jean-Marie.'), TRUE, 'Marie');               
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1421, STRINGDECODE('Fr\u00e1 jap\u00f6nsku \u771f (ma) sem \u00fe\u00fd\u00f0ir \u201craunverulegt, \u00f3sviki\u00f0\u201c, \u91cc (ri) sem \u00fe\u00fd\u00f0ir \u201c\u00feorp\u201c og \u5b50 (ko) sem \u00fe\u00fd\u00f0ir \u201cbarn\u201c. Margar mismunandi samsetningar kanji-pers\u00f3na geta mynda\u00f0 \u00feetta nafn.'), TRUE, STRINGDECODE('Marik\u00f3'));          
