INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1455, STRINGDECODE('Fr\u00e1 arame\u00edsku \u05de\u05b7\u05e8\u05b0\u05ea\u05b8\u05bc\u05d0 (marta `) sem \u00fe\u00fd\u00f0ir \u201ckonan, \u00e1stkonan\u201c, kvenkyns mynd af \u05de\u05e8 (mar) sem \u00fe\u00fd\u00f0ir \u201ch\u00fasb\u00f3ndi\u201c. \u00cd N\u00fdja testamentinu er \u00feetta nafn systur Lazarusar og Mar\u00edu fr\u00e1 Betan\u00edu (sem stundum er kennd vi\u00f0 Mar\u00edu Magdalenu). H\u00fan var vitni a\u00f0 \u00fev\u00ed a\u00f0 Jes\u00fas endurreisti l\u00e1tinn br\u00f3\u00f0ur sinn til l\u00edfsins. Nafni\u00f0 var ekki nota\u00f0 \u00e1 Englandi fyrr en eftir si\u00f0askipti m\u00f3tm\u00e6lenda. Athyglisver\u00f0ur flutningsma\u00f0ur var Martha Washington (1731-1802), eiginkona fyrsta Bandar\u00edkjaforseta, George Washington. \u00dea\u00f0 ber einnig fj\u00f6lmi\u00f0lamanneskjan Martha Stewart (1941-).'), TRUE, 'Martha');  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1456, STRINGDECODE('Kvenleg mynd af Martinus (sj\u00e1 MARTIN). Saint Martina var p\u00edslarvottur \u00e1 3. \u00f6ld sem er einn verndard\u00fdrlinga \u00ed R\u00f3m.'), TRUE, STRINGDECODE('Mart\u00edna'));      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1457, STRINGDECODE('Venjuleg ensk mynd af Mar\u00edu, latneska myndin af N\u00fdja testamentinu gr\u00edsku n\u00f6fnunum \u039c\u03b1\u03c1\u03b9\u03ac\u03bc (Mariam) og \u039c\u03b1\u03c1\u03af\u03b1 (Maria) - stafsetningarnar eru v\u00edxlanlegar - sem voru \u00far hebresku \u05de\u05b4\u05e8\u05b0\u05d9\u05b8\u05dd (Miryam), nafn sem systir M\u00f3se flutti \u00ed gamla Testamenti. Merkingin er ekki \u00feekkt me\u00f0 vissu, en \u00fea\u00f0 eru nokkrar kenningar, \u00fear \u00e1 me\u00f0al \u201ebitur\u00f0arsj\u00f3r\u201c, \u201euppreisnargj\u00f6f\u201c og \u201e\u00f3ska\u00f0 fyrir barn\u201c. En l\u00edklega var \u00fea\u00f0 upphaflega egypskt nafn, ef til vill a\u00f0 hluta til fr\u00e1 \u201eelsku\u00f0u\u201c e\u00f0a \u201e\u00e1stinni\u201c. \u00deetta er nafn nokkurra pers\u00f3na \u00ed N\u00fdja testamentinu, s\u00ed\u00f0ast en ekki s\u00edst Mar\u00eda m\u00f3\u00f0ir Jes\u00fa. Samkv\u00e6mt gu\u00f0spj\u00f6llunum var Jes\u00fas getinn \u00ed henni af heil\u00f6gum anda me\u00f0an h\u00fan var mey. \u00deetta nafn bar einnig Mar\u00eda Magdalena, kona sem Jes\u00fas l\u00e6kna\u00f0i fyrir anda. H\u00fan var\u00f0 einn af fylgjendum hans og var\u00f0 s\u00ed\u00f0ar vitni a\u00f0 krossfestingu hans og upprisu. Vegna Mar\u00edu meyjar hefur \u00feetta nafn veri\u00f0 mj\u00f6g vins\u00e6lt \u00ed hinum kristna heimi, \u00fe\u00f3 a\u00f0 \u00e1 sumum t\u00edmum hafi \u00fea\u00f0 veri\u00f0 tali\u00f0 of heilagt til daglegrar notkunar. \u00c1 Englandi hefur \u00fea\u00f0 veri\u00f0 nota\u00f0 s\u00ed\u00f0an \u00e1 12. \u00f6ld og \u00fea\u00f0 hefur veri\u00f0 me\u00f0al algengustu kvenheita s\u00ed\u00f0an \u00e1 16. \u00f6ld. \u00cd Bandar\u00edkjunum \u00e1ri\u00f0 1880 var \u00fea\u00f0 gefi\u00f0 meira en tv\u00f6falt oftar en n\u00e6st vins\u00e6lasta nafn st\u00falkna (Anna). \u00dea\u00f0 var \u00ed efsta s\u00e6ti \u00ed Amer\u00edku \u00fear til 1946 \u00feegar \u00fea\u00f0 var lent \u00ed \u00f6\u00f0ru s\u00e6ti (af Linda). \u00der\u00e1tt fyrir a\u00f0 \u00fea\u00f0 endurheimti efsta s\u00e6ti\u00f0 \u00ed nokkur \u00e1r \u00ed vi\u00f0b\u00f3t \u00e1 fimmta \u00e1ratugnum var \u00fea\u00f0 \u00feegar falli\u00f0 \u00ed notkun og hefur s\u00ed\u00f0an falli\u00f0 \u00far topp 100 n\u00f6fnum. \u00deetta nafn hefur veri\u00f0 bori\u00f0 af tveimur drottningum Englands, svo og drottningu Skotlands. , Mary Skotadrottning. Annar athyglisver\u00f0ur flutningsma\u00f0ur var Mary Shelley (1797-1851), h\u00f6fundur Frankenstein. Fr\u00e6g sk\u00e1ldu\u00f0 pers\u00f3na me\u00f0 \u00feessu nafni er Mary Poppins \u00far barnab\u00f3kum P. L. Travers, fyrst gefin \u00fat \u00e1ri\u00f0 1934. Latinized form \u00feessa nafns, Maria, er einnig nota\u00f0 \u00e1 ensku sem og \u00e1 nokkrum \u00f6\u00f0rum tungum\u00e1lum.'), TRUE, 'Mary');         
