u00f6\u00f0ru s\u00e6ti (af Linda). \u00der\u00e1tt fyrir a\u00f0 \u00fea\u00f0 endurheimti efsta s\u00e6ti\u00f0 \u00ed nokkur \u00e1r \u00ed vi\u00f0b\u00f3t \u00e1 fimmta \u00e1ratugnum var \u00fea\u00f0 \u00feegar falli\u00f0 \u00ed notkun og hefur s\u00ed\u00f0an falli\u00f0 \u00far topp 100 n\u00f6fnum. \u00deetta nafn hefur veri\u00f0 bori\u00f0 af tveimur drottningum Englands, svo og drottningu Skotlands. , Mary Skotadrottning. Annar athyglisver\u00f0ur flutningsma\u00f0ur var Mary Shelley (1797-1851), h\u00f6fundur Frankenstein. Fr\u00e6g sk\u00e1ldu\u00f0 pers\u00f3na me\u00f0 \u00feessu nafni er Mary Poppins \u00far barnab\u00f3kum P. L. Travers, fyrst gefin \u00fat \u00e1ri\u00f0 1934. Latinized form \u00feessa nafns, Maria, er einnig nota\u00f0 \u00e1 ensku sem og \u00e1 nokkrum \u00f6\u00f0rum tungum\u00e1lum.'), TRUE, STRINGDECODE('Mar\u00fd'));      
