INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1481, STRINGDECODE('merking \u00f3\u00feekkt. Sagt er a\u00f0 kona af Austurlandi, sem hertekin var \u00ed Tyrkjar\u00e1ninu hafi eftir heimkomuna sk\u00edrt d\u00f3ttur s\u00edna Mekk\u00edn eftir h\u00fasm\u00f3\u00f0ur sinni \u00ed Barbar\u00edinu. Etv. er nafni\u00f0 dregi\u00f0 af nafni borgarinnar Mekka.'), TRUE, STRINGDECODE('Mekk\u00edn'));        
