INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1483, STRINGDECODE('\u00de\u00fd\u00f0ir \u201eb\u00ed\u201c \u00e1 gr\u00edsku. \u00cd gr\u00edskri go\u00f0afr\u00e6\u00f0i var \u00feetta nafn d\u00f3ttur Proklesar, auk sams\u00f6ngs \u00fdmissa gr\u00edskra nymfa og prestkvenna. Samkv\u00e6mt frumkristna rith\u00f6fundinum Lactantius [2] var \u00feetta nafn systur Amm\u00feea nymfunnar, sem h\u00fan s\u00e1 um hinn unga Seif. S\u00ed\u00f0ar birtist \u00fea\u00f0 \u00ed lj\u00f3\u00f0i Ludovico Ariosto fr\u00e1 1516 Orlando Furioso [3] sem tilheyrir \u00e1lfunni sem hj\u00e1lpar Ruggiero a\u00f0 fl\u00fdja \u00far norninni Alcina. Sem ensku eiginnafn hefur Melissa veri\u00f0 nota\u00f0 s\u00ed\u00f0an \u00e1 18. \u00f6ld.'), TRUE, 'Melissa');    
