INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1497, STRINGDECODE('Hugsanlega dregi\u00f0 af latneskum karlm\u00f6nnum sem \u00fe\u00fd\u00f0a \u201cvitsmuni\u201c, en l\u00edklegri af etrusk\u00edskum uppruna. Minerva var r\u00f3mverska gy\u00f0ja visku og str\u00ed\u00f0s, jafngildir gr\u00edsku gy\u00f0junni A\u00feenu. \u00dea\u00f0 hefur veri\u00f0 nota\u00f0 sem eiginnafn \u00ed enskum\u00e6landi heimi s\u00ed\u00f0an eftir endurreisnart\u00edmann.'), TRUE, 'Minerva');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1498, STRINGDECODE('Merkir \u201e\u00e1st\u201c \u00e1 forn\u00fe\u00fdsku, s\u00e9rstaklega mi\u00f0aldakirkju\u00e1st. \u00dea\u00f0 er einnig nota\u00f0 sem stutt form af WILHELMINA. \u00deetta er nafn titilpers\u00f3nunnar \u00ed leikritinu Minna von Barnhelm (1767) eftir Gotthold Ephraim Lessing.'), TRUE, 'Minna');     
