INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1501, STRINGDECODE('Hebreska mynd MARY. \u00dea\u00f0 er nota\u00f0 \u00ed Gamla testamentinu, \u00fear sem \u00fea\u00f0 tilheyrir eldri systur M\u00f3se og Arons. H\u00fan fylgdist me\u00f0 ungbarninu M\u00f3se \u00feegar d\u00f3ttir fara\u00f3s dr\u00f3 hann fr\u00e1 N\u00edl. Nafni\u00f0 hefur lengi veri\u00f0 vins\u00e6lt me\u00f0al gy\u00f0inga og \u00fea\u00f0 hefur veri\u00f0 nota\u00f0 sem enskt kristilegt nafn (vi\u00f0 hli\u00f0 Mar\u00edu) fr\u00e1 si\u00f0askiptum m\u00f3tm\u00e6lenda.'), TRUE, 'Miriam');           
