INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1508, STRINGDECODE('Fr\u00e1 Mimosa, \u00e6ttkv\u00edsl plantna sem eru vi\u00f0kv\u00e6m fyrir snertingu. \u00deekktasta plantan \u00far \u00feeirri \u00e6tt er Mimosa pudica, betur \u00feekkt \u00e1 ensku sem snerta mig. Pl\u00f6ntu\u00e6ttin dregur nafn sitt af sp\u00e6nskri m\u00edm\u00f3su, sem er kvenlegt form sp\u00e6nsku l\u00fdsingaror\u00f0sins m\u00edm\u00f3s\u00f3 sem \u00fe\u00fd\u00f0ir \u201ekelinn\u201c.'), TRUE, STRINGDECODE('M\u00edm\u00f3sa'));   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1509, STRINGDECODE('Hugsanlega dregi\u00f0 af latneskum karlm\u00f6nnum sem \u00fe\u00fd\u00f0a \u201cvitsmuni\u201c, en l\u00edklegri af etrusk\u00edskum uppruna. Minerva var r\u00f3mverska gy\u00f0ja visku og str\u00ed\u00f0s, jafngildir gr\u00edsku gy\u00f0junni A\u00feenu. \u00dea\u00f0 hefur veri\u00f0 nota\u00f0 sem eiginnafn \u00ed enskum\u00e6landi heimi s\u00ed\u00f0an eftir endurreisnart\u00edmann.'), TRUE, STRINGDECODE('M\u00ednerva'));   
