INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1511, STRINGDECODE('Komi\u00f0 fr\u00e1 lat\u00ednu mirandus sem \u00fe\u00fd\u00f0ir \u201ea\u00f0d\u00e1unarvert, yndislegt\u201c. Nafni\u00f0 var b\u00fai\u00f0 til af Shakespeare fyrir kvenhetjuna \u00ed leikriti s\u00ednu The Tempest (1611), um f\u00f6\u00f0ur og d\u00f3ttur sem stranda\u00f0i \u00e1 eyju. \u00dea\u00f0 var\u00f0 ekki algengt enskt eiginnafn fyrr en \u00e1 20. \u00f6ld. \u00deetta er l\u00edka nafn einnar tungls \u00daranusar, kenndur vi\u00f0 Shakespeare-pers\u00f3nuna.'), TRUE, STRINGDECODE('M\u00edranda'));             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1512, STRINGDECODE('Ekki \u00ed bo\u00f0i.'), TRUE, STRINGDECODE('M\u00edrey'));      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1513, STRINGDECODE('M\u00edriel er nafn tveggja pers\u00f3na \u00ed verkum Tolkiens. \u00dea\u00f0 \u00fe\u00fd\u00f0ir \u201cj\u00f3mfr\u00faarskreytt mey\u201c. M\u00edriel Serind\u00eb, Noldorin \u00e1lfur, var kona Finw\u00eb og fa\u00f0ir F\u00ebanor. F\u00e6\u00f0ing voldugs sonar hennar t\u00f3k svo miki\u00f0 af anda hennar a\u00f0 h\u00fan f\u00e9ll fr\u00e1. Tar-M\u00edriel var r\u00e9ttur erfingi h\u00e1setisins \u00ed N\u00famenor en var tekinn af Pharaz\u00f4n fr\u00e6nda s\u00ednum. Ar-Pharaz\u00f4n leiddi flota gegn Valinor sem var\u00f0 til \u00feess a\u00f0 N\u00famenor ey\u00f0ilag\u00f0ist. Sagan sag\u00f0i a\u00f0 Tar-M\u00edriel hafi leitast vi\u00f0 a\u00f0 n\u00e1 h\u00e1marki Meneltarma \u00e1\u00f0ur en yfir lauk, en vatni\u00f0 t\u00f3k hana \u00feegar h\u00fan klifra\u00f0i upp hl\u00ed\u00f0ar Holy Mountain.'), TRUE, STRINGDECODE('M\u00edr\u00edel'));           
