INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1553, STRINGDECODE('Fr\u00e1 seint latneska nafninu Natalia, sem \u00fe\u00fdddi \u201ca\u00f0fangadagur\u201c \u00far lat\u00ednu natale domini. \u00deetta var nafn konu 4. aldar p\u00edslarvottar heilags Adrianus fr\u00e1 Nicomedia. H\u00fan er d\u00fdrku\u00f0 sem d\u00fdrlingur \u00ed r\u00e9tttr\u00fana\u00f0arkirkjunni og nafni\u00f0 hefur jafnan veri\u00f0 algengara me\u00f0al kristinna manna \u00ed Austurr\u00edki en Vesturlanda. \u00dea\u00f0 var vins\u00e6lt \u00ed Amer\u00edku af leikkonunni Natalie Wood (1938-1981), sem f\u00e6ddist af r\u00fassneskum innflytjendum.'), TRUE, 'Natalie');         
