INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1573, STRINGDECODE('Fr\u00e1 gel\u00edska nafninu Niall, sem er af umdeildum uppruna, sem \u00fe\u00fd\u00f0ir hugsanlega \u201emeistari\u201c e\u00f0a \u201esk\u00fd\u201c. \u00deetta var nafn h\u00e1lfgo\u00f0sagnakenndra \u00edrskra konunga \u00e1 4. \u00f6ld, Niall af n\u00edu g\u00edslunum. Snemma \u00e1 mi\u00f0\u00f6ldum var nafni\u00f0 teki\u00f0 upp af v\u00edkinga\u00e1r\u00e1sarm\u00f6nnum og landnemum \u00e1 \u00cdrlandi \u00ed formi Njal. V\u00edkingarnir sendu \u00fea\u00f0 til Englands og Skotlands auk \u00feess a\u00f0 koma \u00fev\u00ed aftur til Skandinav\u00edu. \u00dea\u00f0 var einnig \u00ed notkun me\u00f0al Normana, sem voru af skandinav\u00edskum uppruna. Fr\u00e6gur handhafi \u00feessa nafns var bandar\u00edski geimfarinn Neil Armstrong (1930-2012), fyrsta manneskjan sem gekk \u00e1 tunglinu.'), TRUE, STRINGDECODE('Nj\u00e1la'));    
