INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1596, STRINGDECODE('\u00deetta nafn var nota\u00f0 \u00ed \u00feessari stafsetningu af William Shakespeare fyrir pers\u00f3nu \u00ed gamanmynd hans T\u00f3lfta n\u00f3tt (1602). \u00deetta var sjaldg\u00e6ft nafn \u00e1 t\u00edma Shakespeares [1] sem kann a\u00f0 hafa veri\u00f0 byggt \u00e1 OLIVA e\u00f0a OLIVER, e\u00f0a beint \u00far latneska or\u00f0inu oliva sem \u00fe\u00fd\u00f0ir \u201e\u00f3l\u00edfuol\u00eda\u201c. \u00cd leikritinu er Olivia g\u00f6fug kona sem beitt er eftir Orsino hertoga en ver\u00f0ur \u00e1stfanginn af sendibo\u00f0anum Cesario.Olivia hefur veri\u00f0 nota\u00f0 \u00ed enskum\u00e6landi heimi s\u00ed\u00f0an \u00e1 18. \u00f6ld, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 hafi ekki or\u00f0i\u00f0 of vins\u00e6lt fyrr en \u00e1 s\u00ed\u00f0asta hluta 20. aldar. \u00dea\u00f0 n\u00e1\u00f0i efsta s\u00e6ti \u00ed Englandi og Wales fyrir \u00e1ri\u00f0 2008 og var \u00ed \u00f6\u00f0ru s\u00e6ti \u00ed Bandar\u00edkjunum fyrir \u00e1ri\u00f0 2014. H\u00e6kkun \u00feess \u00ed vins\u00e6ldum leiddi a\u00f0 lokum af pers\u00f3na \u00ed sj\u00f3nvarps\u00fe\u00e1ttunum The Waltons \u00e1 \u00e1ttunda \u00e1ratugnum, s\u00ed\u00f0ar styrkt af pers\u00f3num \u00ed \u00f6\u00f0rum sj\u00f3nvarps\u00fe\u00e1ttum [2 ].'), TRUE, 'Olivia');             
