INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1617, 'MISSING', TRUE, STRINGDECODE('\u00d3tta'));    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1618, STRINGDECODE('\u00deetta nafn var fundi\u00f0 upp seint \u00e1 16. \u00f6ld af sk\u00e1ldinu Sir Philip Sidney til notkunar \u00ed lj\u00f3\u00f0i s\u00ednu Arcadia. Hann \u00e6tla\u00f0i hugsanlega a\u00f0 \u00fea\u00f0 \u00fe\u00fdddi \u201e\u00f6ll s\u00e6tleiki\u201c \u00far gr\u00edsku \u03c0\u1fb6\u03bd (pan) sem \u00fe\u00fd\u00f0ir \u201eallt\u201c og \u03bc\u03ad\u03bb\u03b9 (meli) sem \u00fe\u00fd\u00f0ir \u201eelskan\u201c. \u00dea\u00f0 var s\u00ed\u00f0ar nota\u00f0 af h\u00f6fundinum Samuel Richardson fyrir kvenhetjuna \u00ed sk\u00e1lds\u00f6gu sinni Pamela, e\u00f0a Virtue Rewarded (1740), en eftir \u00feann t\u00edma var\u00f0 h\u00fan notu\u00f0 sem eiginnafn. \u00dea\u00f0 var\u00f0 ekki vins\u00e6lt fyrr en \u00e1 20. \u00f6ld.'), TRUE, 'Pamela');       
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1619, STRINGDECODE('Par\u00eds, h\u00f6fu\u00f0borg Frakklands, sem f\u00e9kk nafn sitt fr\u00e1 fornum Keltneskum \u00fej\u00f3\u00f0flokki er kalla\u00f0ur var Parisii.'), TRUE, STRINGDECODE('Par\u00eds'));      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1620, STRINGDECODE('Kvenleg form Patricius (sj\u00e1 PATRICK). \u00cd Englandi \u00e1 mi\u00f0\u00f6ldum birtist \u00feessi stafsetning \u00ed skj\u00f6lum \u00e1 lat\u00ednu, en l\u00edklega var \u00feetta form ekki nota\u00f0 sem raunverulegt nafn fyrr en \u00e1 18. \u00f6ld, \u00ed Skotlandi [1].'), TRUE, 'Patricia');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1621, STRINGDECODE('Fr\u00e1 latneska heitinu Patricius, sem \u00fe\u00fdddi \u201ea\u00f0alsma\u00f0ur\u201c. \u00deetta nafn var teki\u00f0 upp \u00e1 5. \u00f6ld af Saint Patrick, en f\u00e6\u00f0ingarnafn hans var Sucat. Hann var r\u00f3mverskur Breti sem var tekinn og \u00fer\u00e6ldur \u00ed \u00e6sku af \u00edrskum \u00e1r\u00e1sarm\u00f6nnum. Eftir sex \u00e1ra \u00fer\u00e6ld\u00f3m slapp hann heim en hann var\u00f0 a\u00f0 lokum biskup og f\u00f3r aftur til \u00cdrlands sem tr\u00fabo\u00f0i. Hann er jafnan \u00e1litinn kristna eyjuna og er \u00e1litinn verndard\u00fdrlingur \u00cdrlands. \u00cd Englandi og annars sta\u00f0ar \u00ed Evr\u00f3pu \u00e1 mi\u00f0\u00f6ldum var \u00feetta nafn nota\u00f0 til hei\u00f0urs d\u00fdrlingnum. Hins vegar var \u00fea\u00f0 almennt ekki gefi\u00f0 \u00e1 \u00cdrlandi fyrir 17. \u00f6ld vegna \u00feess a\u00f0 \u00fea\u00f0 var tali\u00f0 of heilagt til daglegrar notkunar. \u00dea\u00f0 hefur s\u00ed\u00f0an or\u00f0i\u00f0 mj\u00f6g algengt \u00fear.'), TRUE, STRINGDECODE('Patris\u00eda'));        
