INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1661, STRINGDECODE('\u00cd s\u00f6gu Ragnars Lothbr\u00f3ks breytir seinni kona hans \u00c1slaug nafni s\u00ednu \u00ed Randal\u00edn \u00feegar h\u00fan fer a\u00f0 hefna fyrir l\u00edf stj\u00fapsona sinna en h\u00fan er af \u00f3vissum uppruna og merkingu. Ein kenning reynir a\u00f0 tengja nafn hennar vi\u00f0 fornnorr\u00e6na \u201eskj\u00f6ld\u201c og hl\u00edn sem er b\u00e6\u00f0i fornnorr\u00e6na or\u00f0i\u00f0 \u201evernd\u201c og lj\u00f3\u00f0r\u00e6nt hugtak fyrir \u201ekonu\u201c.'), TRUE, STRINGDECODE('Randal\u00edn'));          
