INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1681, STRINGDECODE('\u00dar jap\u00f6nsku \u68a8 (ri) sem \u00fe\u00fd\u00f0ir \u201cperu\u201c, \u5f8b (ri) sem \u00fe\u00fd\u00f0ir \u201chrynjandi, l\u00f6g, regluger\u00f0, m\u00e1l, stj\u00f3rn\u201c, \u7acb (ri) sem \u00fe\u00fd\u00f0ir \u201cstanda upp, r\u00edsa, setja upp, reisa\u201c e\u00f0a \u516d (ri) sem \u00fe\u00fd\u00f0ir \u201esex\u201c \u00e1samt \u9999 (ka) sem \u00fe\u00fd\u00f0ir \u201eilmur\u201c, \u590f (ka) sem \u00fe\u00fd\u00f0ir \u201esumar\u201c e\u00f0a \u82b1 (ka) e\u00f0a \u83ef (ka) sem b\u00e6\u00f0i \u00fe\u00fd\u00f0a \u201ebl\u00f3m\u201c. A\u00f0rar kanji samsetningar eru m\u00f6gulegar. Rikka (\u7acb \u82b1, \u7acb\u590f, \u516d \u82b1) sem or\u00f0 \u00e1 jap\u00f6nsku (\u7acb \u82b1), st\u00edll af ikebana, jap\u00f6nsk bl\u00f3maskreytilist, (\u7acb\u590f) sem \u00fe\u00fd\u00f0ir \u201esumardagurinn fyrsti, byrjun sumars\u201c og (\u516d \u82b1) sem \u00fe\u00fd\u00f0ir \u201esnj\u00f3r \u201c.'), TRUE, 'Rikka');             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1682, STRINGDECODE('Fr\u00e1 eftirnafni sem var dregi\u00f0 af nafni \u00fdmissa enskra b\u00e6ja, \u00far forn-ensku ripel \u201cstrip of land\u201c og leah \u201cclearing\u201c. Fr\u00e6gur sk\u00e1ldskaparberi var pers\u00f3nan Ellen Ripley (venjulega bara k\u00f6llu\u00f0 eftirnafni hennar) \u00far Alien kvikmyndaser\u00edunni, sem h\u00f3fst 1979.'), TRUE, 'Ripley');
