INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1689, STRINGDECODE('Upphaflega var normann\u00edskt form me\u00f0 germanska nafninu Hrodohaidis sem \u00fe\u00fd\u00f0ir \u201cfr\u00e6g ger\u00f0\u201c, samsett \u00far frumefnunum hrod \u201cfr\u00e6g\u00f0\u201c og heid \u201cg\u00f3\u00f0ur, tegund, ger\u00f0\u201c. Normannar kynntu \u00fea\u00f0 fyrir Englandi \u00ed formi Roese og Rohese. \u00dea\u00f0 snemma var tengt or\u00f0inu fyrir ilmandi bl\u00f3mar\u00f3s (dregi\u00f0 af lat\u00ednu rosa). \u00deegar nafni\u00f0 var endurvaki\u00f0 \u00e1 19. \u00f6ld var \u00fea\u00f0 l\u00edklega me\u00f0 bl\u00f3mi\u00f0 \u00ed huga.'), TRUE, 'Rose');      
