INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1731, STRINGDECODE('Kvenlegt form af Sabinus, r\u00f3mverskt vitnisbur\u00f0ur sem \u00fe\u00fd\u00f0ir \u201ea Sabine\u201c \u00e1 lat\u00ednu. Sabines voru fornt f\u00f3lk sem bj\u00f3 \u00e1 Mi\u00f0-\u00cdtal\u00edu, l\u00f6nd \u00feeirra voru a\u00f0 lokum tekin af R\u00f3mverjum eftir nokkur styrj\u00f6ld. Samkv\u00e6mt go\u00f0s\u00f6gninni r\u00e6ndu R\u00f3mverjar nokkrum Sabine-konum \u00ed \u00e1hlaupi og \u00feegar karlarnir komu til a\u00f0 bjarga \u00feeim t\u00f3kst konunum a\u00f0 koma \u00e1 fri\u00f0i milli \u00feessara tveggja h\u00f3pa. \u00deetta nafn var bori\u00f0 af nokkrum fyrstu d\u00fdrlingum.'), TRUE, STRINGDECODE('Sab\u00edna'));            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1732, STRINGDECODE('Latinized form af Habren, upprunalega velska nafni\u00f0 vi\u00f0 \u00e1na Severn. Samkv\u00e6mt Geoffrey fr\u00e1 Monmouth var Sabrina nafn prinsessu sem drukkna\u00f0 var \u00ed Severn. Tali\u00f0 er a\u00f0 \u00e1in hafi veri\u00f0 nefnd eftir henni, en l\u00edklegra er a\u00f0 nafn hennar hafi \u00ed raun veri\u00f0 dregi\u00f0 af \u00e1nni, sem er \u00f3\u00feekkt. H\u00fan birtist sem vatnsn\u00edmfi \u00ed Masque John Milton Comus (1634). \u00dea\u00f0 var vins\u00e6lt sem eiginnafn af leikriti Samuel A. Taylor Sabrina Fair (1953) og kvikmyndaa\u00f0l\u00f6guninni sem fylgdi \u00fev\u00ed n\u00e6sta \u00e1r.'), TRUE, STRINGDECODE('Sabr\u00edna'));            
