INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1734, STRINGDECODE('Fr\u00e1 jap\u00f6nsku \u685c (sakura) sem \u00fe\u00fd\u00f0ir \u201ekirsuberjabl\u00f3m\u201c, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 s\u00e9 oft skrifa\u00f0 me\u00f0 hiragana ritkerfinu. \u00dea\u00f0 getur einnig komi\u00f0 fr\u00e1 \u54b2 (saku) sem \u00fe\u00fd\u00f0ir \u201ebl\u00f3ma\u201c og \u826f (ra) sem \u00fe\u00fd\u00f0ir \u201egott, dygg\u00f0ugt, vir\u00f0ulegt\u201c sem og a\u00f0rar kanji samsetningar.'), TRUE, 'Sakura');         
