INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1743, STRINGDECODE('Fr\u00e1 arame\u00edskum n\u00f6fnum sem var skyld hebreska or\u00f0inu \u05e9\u05b8\u05c1\u05dc\u05d5\u05b9\u05dd (shalom) sem \u00fe\u00fd\u00f0ir \u201efri\u00f0ur\u201c. Samkv\u00e6mt sagnfr\u00e6\u00f0ingnum Josephus var \u00feetta nafn d\u00f3ttur Her\u00f3d\u00edasar (f\u00e9lagi Her\u00f3desar Ant\u00edpasar, fj\u00f3rvaxinn \u00ed Gal\u00edleu). \u00cd N\u00fdja testamentinu, \u00fe\u00f3 a\u00f0 s\u00e9rstakt nafn s\u00e9 ekki gefi\u00f0 upp, var \u00fea\u00f0 d\u00f3ttir Her\u00f3d\u00edasar sem dansa\u00f0i fyrir Her\u00f3des og hlaut umbun me\u00f0 h\u00f6f\u00f0i J\u00f3hannesar sk\u00edrara og \u00fev\u00ed hefur Salome og dansarinn jafnan veri\u00f0 jafna\u00f0. , Salome hefur veri\u00f0 \u00ed st\u00f6ku notkun fr\u00e1 si\u00f0askiptum m\u00f3tm\u00e6lenda. \u00deetta var vegna annarrar pers\u00f3nu me\u00f0 \u00feessu nafni \u00ed N\u00fdja testamentinu: ein kvennanna sem ur\u00f0u vitni a\u00f0 krossfestingunni og uppg\u00f6tvu\u00f0u s\u00ed\u00f0ar a\u00f0 gr\u00f6f Jes\u00fa var t\u00f3m. \u00dea\u00f0 er nota\u00f0 \u00ed Georg\u00edu vegna Salome of Ujarma fr\u00e1 4. \u00f6ld, sem er talinn d\u00fdrlingur \u00ed Georg\u00edukirkjunni.'), TRUE, 'Salome');    
