INSERT INTO "PUBLIC"."NAME_CARD" VALUES(1876, STRINGDECODE('\u00de\u00fd\u00f0ir \u201eviska\u201c \u00e1 gr\u00edsku. \u00deetta var nafn snemma, l\u00edklega go\u00f0sagnakennds, d\u00fdrlings sem l\u00e9st \u00far sorg eftir a\u00f0 \u00ferj\u00e1r d\u00e6tur hennar voru p\u00edslarvotta\u00f0ar \u00e1 valdat\u00edma Hadr\u00edanis keisara. Sagnir um hana spruttu l\u00edklega upp vegna misskilnings mi\u00f0alda \u00e1 or\u00f0asambandinu Hagia Sophia \u201eHeil\u00f6g speki\u201c, sem er nafn st\u00f3rrar basil\u00edku \u00ed Konstant\u00edn\u00f3pel. \u00deetta nafn var algengt me\u00f0al konungsr\u00edkja meginlands Evr\u00f3pu \u00e1 mi\u00f0\u00f6ldum og var vins\u00e6lt \u00ed Bretlandi af \u00fe\u00fdska h\u00fasinu \u00ed Hannover \u00feegar \u00feeir erf\u00f0u breska h\u00e1s\u00e6ti\u00f0 \u00e1 18. \u00f6ld. \u00dea\u00f0 var nafn pers\u00f3na \u00ed sk\u00e1lds\u00f6gunum Tom Jones (1749) eftir Henry Fielding og The Vicar of Wakefield (1766) eftir Oliver Goldsmith. \u00cd Bandar\u00edkjunum var \u00feetta nafn a\u00f0eins \u00ed me\u00f0allagi algengt \u00fear til \u00e1 t\u00edunda \u00e1ratugnum \u00feegar \u00fea\u00f0 f\u00f3r a\u00f0 aukast \u00ed vins\u00e6ldum, a\u00f0 lokum ver\u00f0a vins\u00e6lust hj\u00e1 stelpum fr\u00e1 2011 til 2013. Fr\u00e6gur handhafi er \u00edtalska leikkonan Sophia Loren (1934-).'), TRUE, 'Sophia');   
