INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2002, STRINGDECODE('\u00de\u00fd\u00f0ir \u201ed\u00f6\u00f0lup\u00e1lmi\u201c \u00e1 hebresku. Samkv\u00e6mt Gamla testamentinu var Tamar tengdad\u00f3ttir J\u00fada og s\u00ed\u00f0ar kona hans. \u00deetta var l\u00edka nafn d\u00f3ttur Dav\u00ed\u00f0s konungs. Honum var nau\u00f0ga\u00f0 af Amnon, h\u00e1lfbr\u00f3\u00f0ur s\u00ednum, sem leiddi til mor\u00f0s hans af Absalon br\u00f3\u00f0ur s\u00ednum. Nafni\u00f0 var bori\u00f0 af drottningu fr\u00e1 Georg\u00edu fr\u00e1 12. \u00f6ld sem stj\u00f3rna\u00f0i konungsr\u00edkinu \u00feegar mest m\u00e1ttur \u00feess var.'), TRUE, 'Tamar');             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2003, STRINGDECODE('R\u00fassneskt form af TAMAR. R\u00fassneskir flytjendur eins og Tamara Karsavina (1885-1978), Tamara Drasin (1905-1943), Tamara Geva (1907-1997) og Tamara Toumanova (1919-1996) kynntu \u00fea\u00f0 fyrir hinum enskum\u00e6landi heimi. \u00dea\u00f0 var einnig bori\u00f0 af p\u00f3lska k\u00fabist\u00edska m\u00e1laranum Tamara de Lempicka (1898-1980).'), TRUE, 'Tamara');            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2004, STRINGDECODE('Afbrig\u00f0i TANYA.'), TRUE, STRINGDECODE('Tan\u00eda'));        
