INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2006, STRINGDECODE('R\u00fassnesk sm\u00e1or\u00f0 TATIANA. \u00dea\u00f0 byrja\u00f0i a\u00f0 nota \u00fea\u00f0 \u00ed enskum\u00e6landi heimi \u00e1 \u00feri\u00f0ja \u00e1ratug s\u00ed\u00f0ustu aldar.'), TRUE, 'Tanya');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2007, STRINGDECODE('R\u00fassnesk sm\u00e1or\u00f0 TATIANA. \u00dea\u00f0 byrja\u00f0i a\u00f0 nota \u00fea\u00f0 \u00ed enskum\u00e6landi heimi \u00e1 \u00feri\u00f0ja \u00e1ratug s\u00ed\u00f0ustu aldar.'), TRUE, 'Tanya');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2008, STRINGDECODE('dregi\u00f0 af Tara-h\u00e6\u00f0 (teamhair) n\u00e1l\u00e6gt Dublin \u00e1 \u00cdrlandi. M\u00f6guleg \u00fe\u00fd\u00f0ing er h\u00e6kka\u00f0ur sta\u00f0ur. Tara \u00fe\u00fd\u00f0ir einnig stjarna \u00e1 Sankrit.'), TRUE, 'Tara');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2009, STRINGDECODE('B\u00fai\u00f0 til af georg\u00edska sk\u00e1ldinu Shota Rustaveli fyrir ep\u00edskt lj\u00f3\u00f0 hans fr\u00e1 12. \u00f6ld Riddarinn \u00ed skinni Panther. Fyrsti \u00fe\u00e1ttur \u00feessa nafns er svol\u00edti\u00f0 \u00f3viss, en l\u00edklega er hann fenginn \u00far anna\u00f0 hvort persneska \u062a\u0627\u062c\u0648\u0631 (tajvar) sem \u00fe\u00fd\u00f0ir \u201ekonungur\u201c e\u00f0a persneska \u062f\u0627\u0631 (dar) sem \u00fe\u00fd\u00f0ir \u201eeignara\u00f0ili\u201c (sj\u00e1 SARDAR), jafnvel \u00fe\u00f3 a\u00f0 s\u00e1 s\u00ed\u00f0arnefndi s\u00e9 venjulega a\u00f0eins nota\u00f0ur sem vi\u00f0skeyti. Ber\u00f0u einnig fyrsta \u00fe\u00e1tt DARIUS saman, sem er tengdur etymologically. Annar m\u00f6guleiki g\u00e6ti veri\u00f0 persneska \u062a\u0627\u0631 (tar) sem \u00fe\u00fd\u00f0ir \u201ed\u00f6kk, \u00f3lj\u00f3s\u201c, \u00fear sem nafni\u00f0 Tariel er skrifa\u00f0 sem \u062a\u0627\u0631\u06cc\u0644 (Taryal) \u00ed persnesku \u00fe\u00fd\u00f0ingunni \u00e1 lj\u00f3\u00f0inu. A\u00f0 lokum er annar \u00fe\u00e1ttur \u00feessa nafns dreginn af persneska nafnor\u00f0inu \u06cc\u0644 (yal) sem \u00fe\u00fd\u00f0ir \u201chetja\u201c. \u00cd ep\u00edsku lj\u00f3\u00f0i Rustaveli er Tariel nafn indverska prinsins, sem er titill riddari lj\u00f3\u00f0sins. handhafar \u00feessa nafns eru me\u00f0al annars 19. aldar Mingrelian prins Tariel \u201eTaia\u201c Dadiani og gr\u00edski j\u00fad\u00f3konan Tariel Zintiridis (f. 1987).'), TRUE, STRINGDECODE('Tar\u00edel'));  
