INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2014, STRINGDECODE('Afbrig\u00f0i af TARA (1).'), TRUE, 'Tera');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2015, STRINGDECODE('THERESA form nota\u00f0 \u00e1 nokkrum tungum\u00e1lum. Heil\u00f6g Teresa af \u00c1vila var sp\u00e6nsk nunna \u00e1 16. \u00f6ld sem ger\u00f0i umb\u00e6tur \u00ed klausturunum \u00ed Karmel og skrifa\u00f0i nokkrar andlegar b\u00e6kur. \u00dea\u00f0 var einnig bori\u00f0 af albanska tr\u00fabo\u00f0anum Saint Teresa fr\u00e1 Kalk\u00fatta (1910-1997), betur \u00feekkt sem M\u00f3\u00f0ir Teresa, sem vann me\u00f0 f\u00e1t\u00e6kum \u00e1 Indlandi. H\u00fan t\u00f3k upp nafni\u00f0 til hei\u00f0urs franska d\u00fdrlingnum Th\u00e9r\u00e8se fr\u00e1 Lisieux, sem er verndari tr\u00fabo\u00f0a.'), TRUE, 'Teresa');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2016, STRINGDECODE('S\u00e6nsk afbrig\u00f0i af THERESA.'), TRUE, STRINGDECODE('Teres\u00eda'));      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2017, STRINGDECODE('stytting \u00e1 The\u00f3d\u00f3ra e\u00f0a D\u00f3r\u00f3thea: gj\u00f6f Gu\u00f0s.'), TRUE, 'Thea');            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2018, STRINGDECODE('Merking \u00f3\u00feekkt. \u00dea\u00f0 var sjaldg\u00e6ft nafn \u00feegar breski rith\u00f6fundurinn Marie Corelli nota\u00f0i \u00fea\u00f0 fyrir norsku kvenhetju sk\u00e1lds\u00f6gunnar Thelmu (1887). Nafni\u00f0 var\u00f0 vins\u00e6lt \u00ed lok 19. aldar eftir a\u00f0 sk\u00e1ldsagan kom \u00fat. Stundum er fullyrt a\u00f0 \u00fea\u00f0 s\u00e9 dregi\u00f0 af gr\u00edsku \u03b8\u03ad\u03bb\u03b7\u03bc\u03b1 (thelema) sem \u00fe\u00fd\u00f0ir \u201evilji\u201c, \u00fe\u00f3 a\u00f0 \u00feetta vir\u00f0ist \u00f3l\u00edklegt.'), TRUE, 'Thelma');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2019, STRINGDECODE('Kvenleg mynd THEODORE. \u00deetta nafn var algengt \u00ed Byzantine Empire, bori\u00f0 af nokkrum keisaraynjum, \u00fear \u00e1 me\u00f0al \u00e1hrifamikilli eiginkonu Justinian \u00e1 6. \u00f6ld.'), TRUE, STRINGDECODE('Theod\u00f3ra'));    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2020, STRINGDECODE('\u00far gr\u00edsku: gj\u00f6f Gu\u00f0s.28/4. The\u00f3d\u00f3ra p\u00edslarvottur, d.304.'), TRUE, STRINGDECODE('The\u00f3d\u00f3ra'));         
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2021, STRINGDECODE('Fr\u00e1 sp\u00e6nska og port\u00fagalska nafninu Teresa. \u00dea\u00f0 var fyrst skr\u00e1\u00f0 sem Therasia, bori\u00f0 af sp\u00e6nsku eiginkonu heilags Paulinusar fr\u00e1 Nola \u00e1 4. \u00f6ld. Merkingin er \u00f3viss, en h\u00fan g\u00e6ti veri\u00f0 dregin af gr\u00edsku \u03b8\u03ad\u03c1\u03bf\u03c2 (theros) sem \u00fe\u00fd\u00f0ir \u201esumar\u201c, \u00far gr\u00edsku \u03b8\u03b5\u03c1\u03af\u03b6\u03c9 (therizo) sem \u00fe\u00fd\u00f0ir \u201ea\u00f0 uppskera\u201c, e\u00f0a fr\u00e1 nafni gr\u00edsku eyjunnar Therasia (vestureyjan Santorini) .Nafni\u00f0 var a\u00f0allega bundi\u00f0 vi\u00f0 Sp\u00e1n og Port\u00fagal \u00e1 mi\u00f0\u00f6ldum. Eftir 16. \u00f6ld dreif\u00f0ist \u00fea\u00f0 til annarra hluta kristna heimsins vegna fr\u00e6g\u00f0ar sp\u00e6nsku nunnunnar og si\u00f0b\u00f3tarmannsins Teresu fr\u00e1 \u00c1vila. Annar fr\u00e6gur flutningsma\u00f0ur var austurr\u00edska Habsborgardrottningin Maria Theresa (1717-1780), sem erf\u00f0i l\u00e9n f\u00f6\u00f0ur s\u00edns, helga r\u00f3mverska keisarans Karls VI, og h\u00f3f upphafsstr\u00ed\u00f0 Austurr\u00edkis.'), TRUE, 'Theresa');     
