INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2037, STRINGDECODE('\u00deetta nafn sameinar \u6843 (tou, momo) sem \u00fe\u00fd\u00f0ir \u201cferskjutr\u00e9\u201c, \u51ac (tou, fuyu) sem \u00fe\u00fd\u00f0ir \u201cvetur\u201c, \u6771 (tou, higashi) sem \u00fe\u00fd\u00f0ir \u201caustur\u201c, \u6850 (tou, dou, kiri) sem \u00fe\u00fd\u00f0ir \u201cpaulownia\u201c,\u77b3 (tou, dou, hitomi) sem \u00fe\u00fd\u00f0ir \u201epupil\u201c, \u85e4 (tou, dou, fuji) sem \u00fe\u00fd\u00f0ir \u201ewisteria\u201c e\u00f0a \u900f (tou, su.kasu, su.ku, su.keru, tou.su, tou.ru, tooru) sem \u00fe\u00fd\u00f0ir \u201cs\u00eda, komast \u00ed gegnum, gegndr\u00e6pt, gegns\u00e6tt\u201c me\u00f0 \u82b1 (ka, ke, hana) sem \u00fe\u00fd\u00f0ir \u201cbl\u00f3m\u201c, \u9999 (kyou, kou, ka, kao.ri, kao.ru) sem \u00fe\u00fd\u00f0ir \u201creykelsi, ilmvatn, lykt\u201c e\u00f0a \u83ef (ka, ke, hana) sem \u00fe\u00fd\u00f0ir \u201ebl\u00f3m, samkynhneig\u00f0ur, gl\u00e6silegur, lj\u00f3mi, \u00e1berandi, petal, sk\u00edna, \u00e1berandi, gl\u00e6sileiki.\u201c Sk\u00e1ldskaparberar me\u00f0 \u00feessu nafni eru T\u014dka Kamiazuma (\u5b88 \u6771 \u6843 \u9999) \u00far fullor\u00f0ins manga og anime T\u014dka Gettan og T\u014dka Kureha (\u5449 \u7fbd \u51ac \u83ef) \u00far PS2 leikjabundnu anime Shining Tears X Wind.'), TRUE, STRINGDECODE('T\u00f3ka'));   
