INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2047, STRINGDECODE('Nafn sem er a\u00f0 finna \u201e\u00e1 forn-s\u00e6nsku og forn-vestnorr\u00e6nu sem Una, Unna\u201c (og \u00e1 forn-d\u00f6nsku sem Una), a\u00f0 lokum fr\u00e1 annarri af fornnorr\u00e6nu sagnor\u00f0unum unnr \u201etil a\u00f0 veifa, r\u00falla, velta\u201c (\u00far frum-germ\u00f6nsku * un\u00fei-) e\u00f0a unna \u201ea\u00f0 elska\u201c (fornenska enska, fornh\u00e1\u00fe\u00fdska (gi) unnan) (samanber UNNR, I\u00d0UNN). Samkv\u00e6mt Viking Answer Lady, \u201c\u00e6tti a\u00f0 t\u00falka r\u00fanad\u00e6min (sem fela \u00ed s\u00e9r nafnh\u00e1ttarform una og \u00e1s\u00f6kunarform unu) sem Una, \u00far forn-vestnorr\u00e6nu s\u00f6gninni una\u201c a\u00f0 nj\u00f3ta, vera \u00e1n\u00e6g\u00f0ur me\u00f0, vera s\u00e1ttur \u201c.\u201c'), TRUE, 'Unna'); 
