INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2112, STRINGDECODE('\u00de\u00fd\u00f0ir \u201esigur\u201c \u00e1 lat\u00ednu, borinn af r\u00f3mversku sigurgy\u00f0junni. \u00dea\u00f0 er l\u00edka kvenlegt form af VICTORIUS. \u00deetta nafn var bori\u00f0 af d\u00fdrlingi og p\u00edslarvotti fr\u00e1 4. \u00f6ld fr\u00e1 Nor\u00f0ur-Afr\u00edku. \u00de\u00f3tt \u00fea\u00f0 v\u00e6ri nota\u00f0 annars sta\u00f0ar \u00ed Evr\u00f3pu var nafni\u00f0 mj\u00f6g sjaldg\u00e6ft \u00ed enskum\u00e6landi heimi fram \u00e1 19. \u00f6ld \u00feegar Viktor\u00eda drottning h\u00f3f langa stj\u00f3rn s\u00edna \u00ed Bretlandi. H\u00fan var kennd vi\u00f0 m\u00f3\u00f0ur s\u00edna, sem var \u00fe\u00fdsk k\u00f3ngaf\u00f3lk. M\u00f6rg landsv\u00e6\u00f0i eru kennd vi\u00f0 drottninguna, \u00fear \u00e1 me\u00f0al \u00e1stralskt r\u00edki og kanad\u00edsk borg.'), TRUE, 'Victoria');   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2113, STRINGDECODE('\u00de\u00fd\u00f0ir \u201esigur\u201c \u00e1 lat\u00ednu, borinn af r\u00f3mversku sigurgy\u00f0junni. \u00dea\u00f0 er l\u00edka kvenlegt form af VICTORIUS. \u00deetta nafn var bori\u00f0 af d\u00fdrlingi og p\u00edslarvotti fr\u00e1 4. \u00f6ld fr\u00e1 Nor\u00f0ur-Afr\u00edku. \u00de\u00f3tt \u00fea\u00f0 v\u00e6ri nota\u00f0 annars sta\u00f0ar \u00ed Evr\u00f3pu var nafni\u00f0 mj\u00f6g sjaldg\u00e6ft \u00ed enskum\u00e6landi heimi fram \u00e1 19. \u00f6ld \u00feegar Viktor\u00eda drottning h\u00f3f langa stj\u00f3rn s\u00edna \u00ed Bretlandi. H\u00fan var kennd vi\u00f0 m\u00f3\u00f0ur s\u00edna, sem var \u00fe\u00fdsk k\u00f3ngaf\u00f3lk. M\u00f6rg landsv\u00e6\u00f0i eru kennd vi\u00f0 drottninguna, \u00fear \u00e1 me\u00f0al \u00e1stralskt r\u00edki og kanad\u00edsk borg.'), TRUE, STRINGDECODE('Victor\u00eda'));
