INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2132, STRINGDECODE('Kvenkynsform af r\u00f3mverska \u00e6ttarnafninu Verginius e\u00f0a Virginius, sem er af \u00f3\u00feekktri merkingu, en lengi tengt latnesku meyjunni \u201eamb\u00e1tt, mey\u201c. Samkv\u00e6mt go\u00f0s\u00f6gn var \u00fea\u00f0 nafn r\u00f3mverskrar konu sem drepinn var af f\u00f6\u00f0ur s\u00ednum til a\u00f0 bjarga henni \u00far kl\u00f3m kr\u00f3ka\u00f0s emb\u00e6ttismanns. \u00deetta var fyrsta enska barni\u00f0 sem f\u00e6ddist \u00ed n\u00fdja heiminum: Virginia Dare \u00e1ri\u00f0 1587 Roanoke Island. Kannski vegna \u00feessa hefur nafni\u00f0 yfirleitt veri\u00f0 vins\u00e6lla \u00ed Amer\u00edku en annars sta\u00f0ar \u00ed enskum\u00e6landi heimi, \u00fe\u00f3 a\u00f0 b\u00e6\u00f0i \u00ed Bretlandi og Amer\u00edku hafi \u00fea\u00f0 ekki veri\u00f0 nota\u00f0 fyrr en \u00e1 19. \u00f6ld. Barni\u00f0 var kennt vi\u00f0 n\u00fdlenduna \u00ed Virgin\u00edu, sem sj\u00e1lf var kennd vi\u00f0 El\u00edsabetu I, meyjardrottninguna. N\u00fdlegri handhafi var enski sk\u00e1ldsagnah\u00f6fundurinn Virginia Woolf (1882-1941).'), TRUE, STRINGDECODE('Virgin\u00eda'));   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2133, STRINGDECODE('Fr\u00e1 latneska nafninu Vivianus, sem var dregi\u00f0 af lat\u00ednu vivus \u201elifandi\u201c. Saint Vivian var franskur biskup sem veitti vernd vi\u00f0 innr\u00e1s Visigoth \u00e1 5. \u00f6ld. \u00dea\u00f0 hefur stundum veri\u00f0 nota\u00f0 sem enskt (karlkyns) nafn s\u00ed\u00f0an \u00e1 mi\u00f0\u00f6ldum. \u00cd n\u00fat\u00edmanum er \u00fea\u00f0 einnig nota\u00f0 sem kvenkynsnafn, en \u00fe\u00e1 er \u00fea\u00f0 anna\u00f0hvort anglicized form af B\u00c9BINN e\u00f0a afbrig\u00f0i af VIVIEN (2).'), TRUE, 'Vivian');            
