INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2161, STRINGDECODE('\u00de\u00fd\u00f0ir \u201el\u00edf\u201c \u00e1 gr\u00edsku. Fr\u00e1 fyrstu t\u00edmum var \u00fea\u00f0 sam\u00feykkt af gr\u00edskum gy\u00f0ingum sem \u00fe\u00fd\u00f0ingu \u00e1 EVE. \u00dea\u00f0 var bori\u00f0 af tveimur frumkristnum d\u00fdrlingum, annar p\u00edslarvottur undir stj\u00f3rn Hadr\u00edans keisara, en annar p\u00edslarvottur undir stj\u00f3rn Diocletianus. Nafni\u00f0 var algengt \u00ed Byzantine Empire, bori\u00f0 af r\u00edkjandi keisaraynju fr\u00e1 11. \u00f6ld. Sem ensku heiti hefur Zoe a\u00f0eins veri\u00f0 \u00ed notkun s\u00ed\u00f0an \u00e1 19. \u00f6ld. \u00dea\u00f0 hefur almennt veri\u00f0 algengara me\u00f0al kristinna manna \u00ed Austurl\u00f6ndum (\u00ed \u00fdmsum stafsetningum).'), TRUE, 'Zoe');       
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2162, STRINGDECODE('Enskt og d\u00f6nsk afbrig\u00f0i af SOPHIA auk fornaldar P\u00f3lsku afbrig\u00f0i af ZOFIA.'), TRUE, STRINGDECODE('Zoph\u00eda'));              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2163, STRINGDECODE('Fr\u00e1 gr\u00edska nafninu \u0398\u03ac\u03bb\u03b5\u03b9\u03b1 (Thaleia), dregi\u00f0 af \u03b8\u03ac\u03bb\u03bb\u03c9 (thallo) sem \u00fe\u00fd\u00f0ir \u201ea\u00f0 bl\u00f3mstra\u201c. \u00cd gr\u00edskri go\u00f0afr\u00e6\u00f0i var h\u00fan ein af n\u00edu m\u00fasum og stj\u00f3rna\u00f0i gamanleik og s\u00e1larlj\u00f3\u00f0um. \u00deetta var l\u00edka nafn einnar af \u00feremur Graces e\u00f0a \u03a7\u03ac\u03c1\u03b9\u03c4\u03b5\u03c2 (Charites).'), TRUE, STRINGDECODE('\u00deal\u00eda'));        
