INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2221, STRINGDECODE('Merkir \u201e\u00feyrna r\u00f3s\u201c \u00e1 \u00edslensku. \u00deetta er nota\u00f0 sem \u00edslenska nafni\u00f0 fyrir \u00e6vint\u00fdrapers\u00f3nuna \u00deyrnir\u00f3s, en \u00fea\u00f0 er \u00edslenska \u00fe\u00fd\u00f0ingin \u00e1 \u00fe\u00fdsku DORNR\u00d6SCHEN, titilpers\u00f3na br\u00e6\u00f0ra Grimm \u00e6vint\u00fdris (\u00feekkt sem Briar Rose \u00e1 ensku).'), TRUE, STRINGDECODE('\u00deyrnir\u00f3s'));            
