INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2235, STRINGDECODE('Norr\u00e6nt form af \u201e\u00c1ki\u201c sem merkir \u201eforfa\u00f0ir\u201c. Getur einnig merkt \u201epl\u00f3gma\u00f0ur\u201c e\u00f0a s\u00e1 sem pl\u00e6gir akur.'), TRUE, 'Aage');       
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2236, STRINGDECODE('\u00dar hebresku og merkir sennilega h\u00e1tt fjall e\u00f0a h\u00e1ttsettur ma\u00f0ur. Aaron var eldri br\u00f3\u00f0ir M\u00f3sesar samkv\u00e6mt Bibl\u00edunni og einn af sp\u00e1m\u00f6nnunum skv. Islamstr\u00fa. \u00c1 \u00cdslandi er rith\u00e1tturinn \u201eAron\u201c oftast nota\u00f0ur, en ritmyndin \u201eAaron\u201c var sam\u00feykkt \u00e1ri\u00f0 2013 af mannanafnanefnd.'), TRUE, 'Aaron');             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2237, STRINGDECODE('\u00dar hebresku, upphaflega Havel sem merkti \u201eandadr\u00e1ttur\u201c. Abel var annar sonur Adams og Evu samkv\u00e6mt Bibl\u00edunni og var myrtur af eldri br\u00f3\u00f0ur s\u00ednum, Kain.'), TRUE, 'Abel');            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2238, STRINGDECODE('Hebreska og merkir fa\u00f0ir margra (\u00fej\u00f3\u00f0a). Nafni\u00f0 kemur \u00far Bibl\u00edunni (1.M\u00f3s.17/5) og er upphaflega Abram, en samkv\u00e6mt Bibl\u00edunni breytti Gu\u00f0 \u00fev\u00ed. Fr\u00e6gir einstaklingar sem bera nafni\u00f0 eru Abraham \u00far Bibl\u00edunni og Abraham Lincoln, fyrrverandi forseti Bandar\u00edkjanna.'), TRUE, 'Abraham');
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2239, STRINGDECODE('Hebreska og merkir ma\u00f0ur, manneskja (1.M\u00f3s.2,7). Samkv\u00e6mt Bibl\u00edunni var Adam skapa\u00f0ur \u00far j\u00f6r\u00f0inni og var fyrsti ma\u00f0urinn, \u00e1samt konu sinni, Evu.'), TRUE, 'Adam');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2240, STRINGDECODE('Oft stytting \u00fdmsum karlmannsn\u00f6fnum, t.d. Arnar, Arn\u00f3r, Arngr\u00edmur, Arnfinnur, A\u00f0alsteinn, Andr\u00e9s og \u00d6rn.'), TRUE, 'Addi');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2241, STRINGDECODE('Rith\u00e1ttur af \u201eAdil\u201c, sem kemur \u00far arab\u00edsku og merkir r\u00e9ttl\u00e1tur e\u00f0a hei\u00f0arlegur.'), TRUE, 'Adel');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2242, STRINGDECODE('Hebreskt nafn sem merkir pr\u00fd\u00f0i e\u00f0a skraut Gu\u00f0s.'), TRUE, STRINGDECODE('Ad\u00edel'));         
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2243, STRINGDECODE('\u00dar \u00fe\u00fdsku, adalwolf sem merkir \u201cg\u00f6fugur \u00falfur\u201d.'), TRUE, 'Adolf');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2244, STRINGDECODE('\u00dar \u00fe\u00fdsku, adalwolf sem merkir \u201cg\u00f6fugur \u00falfur\u201d.'), TRUE, STRINGDECODE('Ad\u00f3lf'));           
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2245, STRINGDECODE('Form Hadrianusar (sj\u00e1 HADRIAN) nota\u00f0 \u00e1 nokkrum tungum\u00e1lum. Nokkrir d\u00fdrlingar og sex p\u00e1far hafa bori\u00f0 \u00feetta nafn, \u00fear \u00e1 me\u00f0al eini enski p\u00e1finn, Adrian IV, og eini hollenski p\u00e1finn, Adrian VI. Sem enskt nafn hefur \u00fea\u00f0 veri\u00f0 \u00ed notkun fr\u00e1 mi\u00f0\u00f6ldum, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 hafi ekki veri\u00f0 vins\u00e6lt fyrr en n\u00fat\u00edminn.'), TRUE, 'Adrian');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2246, STRINGDECODE('Af Hadrianus: fr\u00e1 Hadria. Hadria var b\u00e6r \u00ed nor\u00f0ur \u00cdtal\u00edu. Adr\u00edahafi\u00f0 hefur nafn sitt \u00fea\u00f0an, en \u00fea\u00f0 er hafi\u00f0 sem skilur a\u00f0 \u00cdtal\u00edu og Balkanskagann. Sj\u00f6 p\u00e1far hafa bori\u00f0 \u00feetta nafn.'), TRUE, STRINGDECODE('Adr\u00edan'));    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2247, STRINGDECODE('\u00dar hebresku og merkir \u201egu\u00f0s hj\u00f6r\u00f0\u201c.'), TRUE, STRINGDECODE('Adr\u00edel'));          
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2248, STRINGDECODE('G\u00f6fugur bjargv\u00e6ttur.'), TRUE, STRINGDECODE('A\u00f0alberg'));           
