INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2251, STRINGDECODE('G\u00f6fugur bj\u00f6rn'), TRUE, STRINGDECODE('A\u00f0albj\u00f6rn'));            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2252, STRINGDECODE('Samsett \u00far \u201eA\u00f0al-\u201c sem merkir g\u00f6fugur og \u201e-borgar\u201c sem merkir v\u00f6rn, skj\u00f3l e\u00f0a borg.'), TRUE, STRINGDECODE('A\u00f0alborgar'));  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2253, STRINGDECODE('G\u00f6fugt spj\u00f3t, vopn.'), TRUE, STRINGDECODE('A\u00f0algeir'));            
