INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2258, STRINGDECODE('Rith\u00e1ttur nafnsins \u201eAd\u00f3lf\u201c. \u00dar \u00fe\u00fdsku, adalwolf sem merkir \u201cg\u00f6fugur \u00falfur\u201d. Sam\u00feykkt af mannanafnanefnd \u00e1ri\u00f0 2008.'), TRUE, STRINGDECODE('A\u00f0\u00f3lf'));
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2259, STRINGDECODE('Norr\u00e6nt nafn dregi\u00f0 af agi: \u00f3gn, og -arr sem er stytting \u00e1 fornnorr\u00e6nu or\u00f0i harjaR: herma\u00f0ur. \u00cd norr\u00e6num m\u00e1lum merkir nafni\u00f0 sterkur e\u00f0a \u00feungur og var \u00fev\u00ed oft gefi\u00f0 sonum j\u00e1rnsmi\u00f0a.'), TRUE, 'Agnar');
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2260, STRINGDECODE('Norr\u00e6nt nafn skylt nafninu Agnar. Einn konunga Ynglinga, norr\u00e6nnar konungs\u00e6ttar, bar nafni\u00f0 Agni. Vert er a\u00f0 benda \u00e1 a\u00f0 nafni\u00f0 Agni aftur \u00e1 bak, er Inga. Eins fyrirfinnst nafni\u00f0 l\u00edka \u00ed Sanskr\u00edt, en Agni er einn af a\u00f0algu\u00f0unum \u00far Vedaritunum; gu\u00f0 eldsins og viskunnar.'), TRUE, 'Agni');
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2261, STRINGDECODE('Merking \u00feessa nafns er ekki \u00feekkt me\u00f0 vissu. \u00dea\u00f0 var nota\u00f0 \u00ed Bretagne a\u00f0 minnsta kosti strax \u00e1 6. \u00f6ld og \u00fe\u00fd\u00f0ir hugsanlega anna\u00f0 hvort \u201el\u00edti\u00f0 rokk\u201c e\u00f0a \u201emyndarlegt\u201c \u00e1 bret\u00f3nsku. A\u00f0 \u00f6\u00f0rum kosti kann \u00fea\u00f0 a\u00f0 koma fr\u00e1 \u00e6ttb\u00e1lkaheitinu Alans, \u00edr\u00f6nsku f\u00f3lki sem flutti til Evr\u00f3pu \u00e1 4. og 5. \u00f6ld. \u00deetta var nafn nokkurra hertoga \u00ed Bretagne og bret\u00f3nskir \u200b\u200blandnemar kynntu \u00fea\u00f0 fyrir Englandi eftir landn\u00e1m Normandans. Me\u00f0al fr\u00e6gra n\u00fat\u00edmabera eru Alan Shepard (1923-1998), fyrsti Bandar\u00edkjama\u00f0urinn \u00ed geimnum og fimmti ma\u00f0urinn sem gengur \u00e1 tunglinu, og Alan Turing (1912-1954), breskur st\u00e6r\u00f0fr\u00e6\u00f0ingur og t\u00f6lvunarfr\u00e6\u00f0ingur.'), TRUE, 'Alan');     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2262, STRINGDECODE('\u00dar \u00fe\u00fdsku, dregi\u00f0 af a\u00f0al, g\u00f6fugur, og bjartur e\u00f0a borinn: \u00e6ttg\u00f6fugur. Fr\u00e6gir sem bori\u00f0 hafa nafni\u00f0 eru til a\u00f0 mynda Albert Einstein, v\u00edsindama\u00f0ur.'), TRUE, 'Albert'); 
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2263, STRINGDECODE('\u00de\u00fd\u00f0ir \u201e\u00e1hugi, \u00e1str\u00ed\u00f0a, \u00fe\u00e6gindi\u201c.'), TRUE, 'Aldan');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2264, STRINGDECODE('Uppruni \u00f3kunnur. G\u00e6ti veri\u00f0 karlkynsmynd af kvenmannsnafninu Alda, sem merkir \u201esj\u00e1varalda\u201c, e\u00f0a dregi\u00f0 af \u201e\u00f6ld\u201c.'), TRUE, 'Aldar');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2265, STRINGDECODE('Afbrig\u00f0i ALDO og Halds.'), TRUE, 'Aldur');   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2266, STRINGDECODE('Styttri mynd af nafninu Alexander. Dregi\u00f0 af gr\u00edska or\u00f0inu alexo, a\u00f0 verja e\u00f0a hj\u00e1lpa.'), TRUE, 'Alex');            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2267, STRINGDECODE('\u00dar gr\u00edsku: verndari, e\u00f0a bjargv\u00e6ttur manna. Fr\u00e6gir sem bori\u00f0 hafa nafni\u00f0 eru til a\u00f0 mynda Alexander mikli, konungur Maked\u00f3n\u00edu til forna (d. 323 f.Kr.) og Alexander Graham Bell, sem me\u00f0al annars fann upp s\u00edmann.'), TRUE, 'Alexander');             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2268, STRINGDECODE('Annar rith\u00e1ttur af gr\u00edska nafninu Alexios, sem merkir \u201everndari\u201c.'), TRUE, STRINGDECODE('Alex\u00edus'));     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2269, STRINGDECODE('Nafni\u00f0 kemur \u00far \u00fe\u00fdsku og er upphafleg mynd \u00feess er Adelfuns, \u00fear sem adel- merkir g\u00f6fugur og -funs rei\u00f0ub\u00fainn e\u00f0a vi\u00f0b\u00fainn. Fr\u00e6gir sem bori\u00f0 hafa nafni\u00f0 eru til a\u00f0 mynda barnas\u00f6guhetjan Alfons \u00c5berg, betur \u00feetktur \u00e1 \u00cdslandi sem Einar \u00c1skell. Nafni\u00f0 er l\u00edka algengt \u00ed sp\u00e6nsku- og port\u00fag\u00f6lskum\u00e6landi l\u00f6ndum \u00ed myndinni Alfonso og b\u00e1ru margir g\u00f6fugir menn \u00ed Port\u00fagal nafni\u00f0 \u00e1 mi\u00f0\u00f6ldum.'), TRUE, 'Alfons');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2270, STRINGDECODE('\u00dar ensku: \u00e1lfur- og fri\u00f0ur, e\u00f0a \u00e1lfur og r\u00e1\u00f0. Fr\u00e6gir sem bori\u00f0 hafa nafni\u00f0 eru me\u00f0al annars Alfred Nobel, sem fann upp d\u00ednam\u00edti\u00f0 og Nobel-ver\u00f0launin eru nefnd eftir og Alfred Hitchcock, kvikmyndager\u00f0ama\u00f0ur og leikstj\u00f3ri.'), TRUE, 'Alfred');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2271, STRINGDECODE('\u00dar ensku: \u00e1lfur- og fri\u00f0ur, e\u00f0a \u00e1lfur og r\u00e1\u00f0. Fr\u00e6gir sem bori\u00f0 hafa nafni\u00f0 eru me\u00f0al annars Alfred Nobel, sem fann upp d\u00ednam\u00edti\u00f0 og Nobel-ver\u00f0launin eru nefnd eftir og Alfred Hitchcock, kvikmyndager\u00f0ama\u00f0ur og leikstj\u00f3ri.'), TRUE, STRINGDECODE('Alfre\u00f0'));     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2272, STRINGDECODE('Ali kemur \u00far arab\u00edsku og merkir \u201ehinn upphafni\u201c e\u00f0a \u201ehinn h\u00e1leiti\u201c. Ali var fr\u00e6ndi og tengdasonur M\u00fahamme\u00f0s og mikilv\u00e6g pers\u00f3na \u00ed Islamstr\u00fa. Fr\u00e6gir sem bori\u00f0 hafa nafni\u00f0 Ali eru til d\u00e6mis Ali Baba og r\u00e6ningjarnir fj\u00f6rut\u00edu, Muhammed Ali, hnefaleikakappi og a\u00f0 sj\u00e1lfs\u00f6g\u00f0u Ali G, \u00e1deilukarakter og sj\u00f3nvarpsstjarna.'), TRUE, 'Ali');             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2273, STRINGDECODE('Merking nafnsins er \u00e1 reiki. Nafni\u00f0 kemur ensku e\u00f0a keltnesku. \u00c1 bret\u00f3nsku merkir nafni\u00f0 \u201erefur\u201c \u00e1 g\u00f6tum\u00e1li, en upphaflega merkti \u00fea\u00f0 sennilega \u201ed\u00e1d\u00fdr\u201c. \u00c1 \u00edrsku merkir nafni\u00f0 \u201el\u00edtill steinn\u201c og \u00e1 skoskri gel\u00edsku \u201emyndarlegur\u201c e\u00f0a \u201efallegur\u201c. Fr\u00e6gir sem bori\u00f0 hafa nafni\u00f0 eru til d\u00e6mis rith\u00f6fundurinn Edgar Allan Poe.'), TRUE, 'Allan');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2274, STRINGDECODE('Yfirleitt g\u00e6lunafn fyrir n\u00f6fn sem byrja \u00e1 A\u00f0al- e\u00f0a Al-, svo sem A\u00f0alsteinn e\u00f0a Alfre\u00f0. Sam\u00feykkt af mannanafnanefnd \u00e1ri\u00f0 2013.'), TRUE, 'Alli');           
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2275, STRINGDECODE('norr\u00e6nt nafn, sennilega \u00e1lmur, tr\u00e9, sem nota\u00f0 var \u00ed boga, og -arr: herma\u00f0ur.'), TRUE, 'Almar');     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2276, STRINGDECODE('Samsett \u00far forli\u00f0num Al- og vi\u00f0skeytinu -rekur sem sennilega er dregi\u00f0 af \u201er\u00edkur\u201c.'), TRUE, 'Alrekur');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2277, STRINGDECODE('Samsett \u00far forli\u00f0num Al- og vi\u00f0skeytinu -rekur sem sennilega er dregi\u00f0 af \u201er\u00edkur\u201c.'), TRUE, 'Alvar');          
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2278, STRINGDECODE('Fr\u00e1 mi\u00f0aldaformi af einhverjum af fornu ensku n\u00f6fnunum \u00c6LFWINE, \u00c6\u00d0ELWINE e\u00f0a EALDWINE. \u00dea\u00f0 var endurvaki\u00f0 \u00e1 19. \u00f6ld, a\u00f0 hluta til fr\u00e1 eftirnafni sem var dregi\u00f0 af fornum enskum n\u00f6fnum. Sem skandinav\u00edskt nafn er \u00fea\u00f0 dregi\u00f0 af Alfvin, forn norr\u00e6num \u00e6ttb\u00e1lki \u00c6lfwine.'), TRUE, 'Alvin');               
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2279, STRINGDECODE('Afbrig\u00f0i Amel.'), TRUE, 'Amil');             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2280, STRINGDECODE('AMIR (1) m arab\u00edskt, persneska, \u00fard\u00fa, mala\u00edska, ind\u00f3nes\u00edska'), TRUE, STRINGDECODE('Am\u00edr'));    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2281, STRINGDECODE('Fr\u00e1 \u1f0c\u03bc\u03bc\u03c9\u03bd (Ammon), gr\u00edska myndin af Egyptian Ymn (endurbygg\u00f0 sem Yamanu) sem \u00fe\u00fd\u00f0ir \u201ehinn huldi\u201c. \u00cd upphafi go\u00f0afr\u00e6\u00f0i Egyptalands var hann gu\u00f0 loftsins, sk\u00f6punarg\u00e1fu og frj\u00f3semi, sem var s\u00e9rstaklega \u00e1litinn \u00ed \u00deebu. Seinna, me\u00f0an \u00e1 mi\u00f0r\u00edkinu st\u00f3\u00f0, voru eiginleikar hans sameinu\u00f0 gu\u00f0i Ra og hann var d\u00fdrka\u00f0ur sem \u00e6\u00f0sti s\u00f3lgu\u00f0inn Amon-Ra.'), TRUE, 'Amon');               
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2282, STRINGDECODE('\u00de\u00fd\u00f0ir \u201e\u00e1st\u201c \u00e1 lat\u00ednu. \u00deetta var anna\u00f0 nafn fyrir r\u00f3mverska gu\u00f0inn Cupid. \u00dea\u00f0 \u00fe\u00fd\u00f0ir einnig \u201e\u00e1st\u201c \u00e1 sp\u00e6nsku og port\u00fag\u00f6lsku og sem kvenkynsnafn er h\u00e6gt a\u00f0 draga \u00fea\u00f0 beint af \u00feessu or\u00f0afor\u00f0aor\u00f0i.'), TRUE, 'Amor'); 
