INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2302, STRINGDECODE('Ensk mynd af r\u00f3mverska \u00e6ttarnafninu Antonius, sem er af \u00f3\u00feekktum etrusk\u00edskum uppruna. Athyglisver\u00f0asti me\u00f0limur r\u00f3mversku fj\u00f6lskyldunnar var hersh\u00f6f\u00f0inginn Marcus Antonius (kalla\u00f0ur Mark Antony \u00e1 ensku), sem um skei\u00f0 \u00e1 1. \u00f6ld f.Kr. stj\u00f3rna\u00f0i R\u00f3maveldi \u00ed sameiningu me\u00f0 \u00c1g\u00fast. \u00deegar samband \u00feeirra var\u00f0 s\u00fdrt, var r\u00e1\u00f0ist \u00e1 hann og \u00e1stkonu hans Kle\u00f3p\u00f6tru og neydd til a\u00f0 svipta sig l\u00edfi, eins og raki\u00f0 er \u00ed h\u00f6rmungum Shakespeares, Antonius og Kle\u00f3p\u00f6tru (1606). Nafni\u00f0 var nota\u00f0 reglulega \u00ed hinum kristna heimi vegna fr\u00e6g\u00f0ar heilags Anthony mikla. egypskur einsetuma\u00f0ur fr\u00e1 4. \u00f6ld sem stofna\u00f0i kristna klausturhyggju. Vins\u00e6ldir \u00feess voru styrktar \u00e1 mi\u00f0\u00f6ldum af heil\u00f6gum Anthony fr\u00e1 Padua \u00e1 13. \u00f6ld, verndard\u00fdrlingi Port\u00fagals. \u00dea\u00f0 hefur veri\u00f0 almennt (en rangt) tengt gr\u00edsku \u1f04\u03bd\u03b8\u03bf\u03c2 (anthos) sem \u00fe\u00fd\u00f0ir \u201ebl\u00f3m\u201c, sem leiddi til \u00feess a\u00f0 h b\u00e6ttist vi\u00f0 \u00feessa stafsetningu \u00e1 17. \u00f6ld.'), TRUE, 'Anthony');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2303, STRINGDECODE('stytting latneska nafnsins Anton\u00edus, sem merkir \u00f3metanlegur. 17/1. heilagur Ant\u00f3n\u00edus, stofnandi fyrsta kristna klaustursins (d.356).'), TRUE, 'Anton');       
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2304, STRINGDECODE('Sp\u00e6nskt og \u00edtalskt form Antoniusar (sj\u00e1 ANTHONY). \u00deetta hefur veri\u00f0 algengt nafn \u00e1 \u00cdtal\u00edu s\u00ed\u00f0an \u00e1 14. \u00f6ld. \u00c1 Sp\u00e1ni var \u00fea\u00f0 vins\u00e6lasta nafn str\u00e1ka \u00e1 fimmta og fimmta \u00e1ratug s\u00ed\u00f0ustu aldar. Fr\u00e6gur handhafi var \u00edtalski endurreisnarm\u00e1larinn Antonio Pisanello (um 1395-1455). \u00dea\u00f0 er l\u00edka nafn a\u00f0alpers\u00f3nunnar \u00ed Kaupmanninum \u00ed Feneyjum (1596) eftir William Shakespeare.'), TRUE, 'Antonio');   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2305, STRINGDECODE('Fornt r\u00f3mverskt form af ANTHONY. \u00deetta er einnig opinbera hollenska formi\u00f0 \u00e1 nafninu, nota\u00f0 \u00e1 f\u00e6\u00f0ingarvottor\u00f0 en oft gefi\u00f0 Anton e\u00f0a Antoon \u00ed daglegu l\u00edfi.'), TRUE, STRINGDECODE('Anton\u00edus'));             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2306, STRINGDECODE('Fornt r\u00f3mverskt form af ANTHONY. \u00deetta er einnig opinbera hollenska formi\u00f0 \u00e1 nafninu, nota\u00f0 \u00e1 f\u00e6\u00f0ingarvottor\u00f0 en oft gefi\u00f0 Anton e\u00f0a Antoon \u00ed daglegu l\u00edfi.'), TRUE, STRINGDECODE('Ant\u00f3n\u00edus'));        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2307, STRINGDECODE('ARAN (1) f & m \u00edrska'), TRUE, 'Aran');       
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2308, STRINGDECODE('Mi\u00f0alda hollensk og austfirsk form af ARNOLD sem og skandinav\u00edskt afbrig\u00f0i af AREND. Hva\u00f0 Holland var\u00f0ar: \u00feetta eiginnafn er enn \u00ed notkun \u00fear \u00ed dag, en \u00fea\u00f0 er ekki eins algengt \u00fear og n\u00fat\u00edmaform \u00feess AREND er. Me\u00f0al \u00feekktra handhafa \u00feessa eiginnafns eru dansk-norski landsh\u00f6fundurinn Arent Berntsen (1610-1680), hollenski gull\u00f6ld landslagsm\u00e1larinn Arent Arentsz (1585-1631) og Arent van Curler (1620-1667; s\u00ed\u00f0ar \u00feekktur sem Arent van Corlaer), hollenski stofnandi \u00feess sem n\u00fa er bandar\u00edska borgin Schenectady (sta\u00f0sett \u00ed New York-fylki. ).'), TRUE, 'Arent');   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2309, STRINGDECODE('Kannski er anna\u00f0hvort \u00far gr\u00edsku \u1f00\u03c1\u03ae (are) sem \u00fe\u00fd\u00f0ir \u201ebane, ruin\u201c e\u00f0a \u1f04\u03c1\u03c3\u03b7\u03bd (arsen) sem \u00fe\u00fd\u00f0ir \u201emale\u201c. Nafni\u00f0 birtist fyrst sem a-re \u00ed M\u00fdkenu gr\u00edsku letri. Ares var bl\u00f3\u00f0\u00feyrsti str\u00ed\u00f0sgu\u00f0 \u00ed gr\u00edskri go\u00f0afr\u00e6\u00f0i, sonur Seifs og Heru.'), TRUE, 'Ares');      
