INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2337, STRINGDECODE('Fr\u00e1 germ\u00f6nsku nafni sem \u00fe\u00fd\u00f0ir \u201c\u00f6rn m\u00e1ttur\u201c, dregi\u00f0 af frumefnunum arn \u201c\u00f6rn\u201c og Wald \u201ckraftur\u201c. Normannar komu me\u00f0 \u00fea\u00f0 til Englands, \u00fear sem \u00fea\u00f0 leysti af h\u00f3lmi gamla enska hli\u00f0st\u00e6\u00f0a Earnweald. \u00dea\u00f0 d\u00f3 \u00fat sem enskt nafn eftir mi\u00f0aldir, en \u00fea\u00f0 var endurvaki\u00f0 \u00e1 19. \u00f6ld. Me\u00f0al d\u00fdrlinga sem bera nafni\u00f0 eru t\u00f3nlistarma\u00f0ur fr\u00e1 8. \u00f6ld vi\u00f0 hir\u00f0 Karlamagn\u00fas og franskur biskup fr\u00e1 11. \u00f6ld sem er verndard\u00fdrlingur bruggara. . \u00dea\u00f0 var einnig bori\u00f0 af Arnold fr\u00e1 Brescia, Augustinus munki fr\u00e1 12. \u00f6ld, sem ger\u00f0i uppreisn gegn kirkjunni og var loks hengdur. Me\u00f0al fr\u00e6gra n\u00fat\u00edmabera eru bandar\u00edski kylfingurinn Arnold Palmer (1929-2016) og austurr\u00edsk-amer\u00edski leikarinn og stj\u00f3rnm\u00e1lama\u00f0urinn Arnold Schwarzenegger (1947-).'), TRUE, 'Arnold');     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2338, STRINGDECODE('samsett af \u00f6rn e\u00f0a arinn og \u00de\u00f3r.'), TRUE, STRINGDECODE('Arn\u00f3r'));        
