INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2344, 'Stutt mynd af Arthur.', TRUE, 'Art');          
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2345, STRINGDECODE('Merking \u00feessa nafns er \u00f3\u00feekkt. \u00dea\u00f0 g\u00e6ti veri\u00f0 dregi\u00f0 af keltnesku frumefnunum artos \u201cbear\u201c \u00e1samt viros \u201cman\u201c e\u00f0a rigos \u201cking\u201c. A\u00f0 \u00f6\u00f0rum kosti g\u00e6ti \u00fea\u00f0 tengst \u00f3sk\u00fdrri r\u00f3mverskri \u00e6ttarnafn Artorius. Arthur er nafn a\u00f0alpers\u00f3nunnar \u00ed Arthurian go\u00f0s\u00f6gninni, konungur Breta \u00e1 6. \u00f6ld sem st\u00f3\u00f0st saxneska innr\u00e1sarher. Hann kann a\u00f0 hafa veri\u00f0 bygg\u00f0ur \u00e1 raunverulegri manneskju e\u00f0a ekki. Hann birtist fyrst \u00ed velskum lj\u00f3\u00f0um og ann\u00e1lum (kannski stuttlega \u00ed lj\u00f3\u00f0inu Y Gododdin fr\u00e1 7. \u00f6ld og \u00e1 endanlegan og v\u00ed\u00f0ari h\u00e1tt \u00ed s\u00f6gu 9. aldar Breta eftir Nennius [1]). Pers\u00f3na hans var \u00fe\u00f3 ekki \u00fer\u00f3u\u00f0 fyrr en \u00ed ann\u00e1lum 12. aldar Geoffrey fr\u00e1 Monmouth [2]. S\u00f6gur hans voru s\u00ed\u00f0ar teknar upp og auknar af fr\u00f6nskum og enskum rith\u00f6fundum. Nafni\u00f0 kom \u00ed almenna notkun \u00e1 Englandi \u00e1 mi\u00f0\u00f6ldum vegna t\u00ed\u00f0ni r\u00f3mant\u00edskra rith\u00f6funda \u00ed Arthur og naut mikilla vins\u00e6lda \u00e1 19. \u00f6ld. Me\u00f0al fr\u00e6gra handhafa eru \u00fe\u00fdski heimspekingurinn Arthur Schopenhauer (1788-1860), leyndard\u00f3msh\u00f6fundur og Sherlock Holmes skapari Arthur Conan Doyle (1859-1930) og v\u00edsindask\u00e1lds\u00f6guh\u00f6fundur Arthur C. Clarke (1917-2008).'), TRUE, 'Arthur');               
