INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2352, STRINGDECODE('fornnorr\u00e6nt nafn, sennilega dregi\u00f0 af nafni H\u00fanakonungsins illr\u00e6mda, Attila, en nafn hans \u00fe\u00fd\u00f0ir a\u00f0 l\u00edkindum fa\u00f0ir. Norr\u00e6nir menn tengdu \u00fea\u00f0 hins vegar \u00f6\u00f0ru or\u00f0i, sem merkir har\u00f0v\u00edtugur, har\u00f0ger, skylt \u00f6tull.'), TRUE, 'Atli');             
