INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2420, STRINGDECODE('djarfur vinur. Margir krossfarakonungar h\u00e9tu \u00feessu nafni. Baldvin Einarsson, l\u00f6gfr\u00e6\u00f0ingur og ritstj\u00f3ri (1801-1833).'), TRUE, 'Baldvin');            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2421, STRINGDECODE('\u00de\u00fd\u00f0ir \u201edjarfur vinur\u201c, dreginn af germ\u00f6nsku \u00fe\u00e6ttinum sk\u00f6ll\u00f3ttur \u201edj\u00f6rf, hugrakkur\u201c og unni\u00f0 \u201evinur\u201c. \u00c1 mi\u00f0\u00f6ldum var \u00feetta vins\u00e6lt nafn \u00ed Fl\u00e6mingjum og me\u00f0al Normanna, sem komu me\u00f0 \u00fea\u00f0 til Bretlands. \u00dea\u00f0 bar einn af lei\u00f0togum fyrstu krossfer\u00f0arinnar, a\u00f0alsma\u00f0ur fr\u00e1 Flandern fr\u00e1 11. \u00f6ld. Eftir a\u00f0 krossfararnir l\u00f6g\u00f0u undir sig Jer\u00fasalem var hann kr\u00fdndur sem konungur konungsr\u00edkisins Jer\u00fasalem.'), TRUE, 'Baldwin');              
