INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2466, STRINGDECODE('Diminutive af HUBERT og \u00f6\u00f0rum n\u00f6fnum sem innihalda bert (oft dregi\u00f0 af germanska frumefninu beraht sem \u00fe\u00fd\u00f0ir \u201cbjart\u201c). Fr\u00e6gur handhafi \u00feessa nafns er Berti Vogts (f\u00e6ddur: Hans-Hubert Vogts) sem er fyrrverandi \u00fe\u00fdskur knattspyrnuma\u00f0ur sem l\u00e9k sem varnarma\u00f0ur. Hann l\u00e9k me\u00f0 Borussia M\u00f6nchengladbach \u00ed Bundesligunni allan sinn atvinnumannaf\u00e9lagsferil og vann FIFA heimsmeistarakeppnina me\u00f0 Vestur-\u00de\u00fdskalandi \u00e1ri\u00f0 1974. Hann st\u00fdr\u00f0i s\u00ed\u00f0ar \u00de\u00fdskalandi (vann Euro 96 sem a\u00f0al\u00fej\u00e1lfari li\u00f0sins), Skotlandi, N\u00edger\u00edu og landsli\u00f0i Aserba\u00eddsjan.'), TRUE, 'Berti');
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2467, STRINGDECODE('\u00de\u00fd\u00f0ir \u201ebjartur hrafn\u201c, dreginn af germanska frumefninu beraht \u201ebjartur\u201c \u00e1samt hramn \u201ehrafni\u201c. Normannar kynntu \u00feetta nafn fyrir Englandi. Shakespeare nota\u00f0i \u00fea\u00f0 \u00ed leikritinu All`s Well That Ends Well (1603).'), TRUE, 'Bertram');   
