INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2470, STRINGDECODE('Stutt mynd af WILLIAM. \u00deessi stafsetning var fyrst notu\u00f0 \u00e1 19. \u00f6ld. Breytingin \u00e1 upphafssveiflinum kann a\u00f0 hafa veri\u00f0 undir \u00e1hrifum af fyrri \u00edrskum frambur\u00f0i \u00e1 nafninu. Me\u00f0al fr\u00e6gra handhafanna eru k\u00f6rfuboltama\u00f0urinn Bill Russell (1934-), gr\u00ednistinn Bill Cosby (1937-), Bill Clinton Bandar\u00edkjaforseti (1946-) og Bill Gates stofnandi Microsoft (1955-).'), TRUE, 'Bill');            
