INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2484, STRINGDECODE('Af \u00f3\u00feekktum uppruna og merkingu. N\u00faverandi kenningar fela \u00ed s\u00e9r beina uppt\u00f6ku \u00edslensks bjarmis \u201eloom, glamp of light\u201c og aflei\u00f0slu \u00far bjarmar, fornnorr\u00e6na nafni\u00f0 \u00e1 grein finnsk-\u00fagr\u00edskra \u00fej\u00f3\u00f0a sem kallast Perm\u00ednar \u00e1 ensku (\u00e1\u00f0ur einnig Bjarmar). Umr\u00e1\u00f0asv\u00e6\u00f0i \u00feeirra, Bjarmaland, var nefnt \u00ed norr\u00e6num s\u00f6gum fr\u00e1 v\u00edkinga\u00f6ld og \u00ed landfr\u00e6\u00f0ilegum fr\u00e1s\u00f6gnum \u00fear til \u00e1 16. \u00f6ld. Gert er r\u00e1\u00f0 fyrir a\u00f0 \u00e6ttarheiti tengist finnsku per\u00e4maa \u201efjarl\u00e6gu landi\u201c og ungversku perem \u201ebr\u00fan; barmi\u201c.'), TRUE, 'Bjarmi');            
