INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2554, STRINGDECODE('\u00de\u00fdsk form CHARLES. Tveir athyglisver\u00f0ir handhafar nafnsins voru \u00fe\u00fdski st\u00e6r\u00f0fr\u00e6\u00f0ingurinn Carl Gauss (1777-1855), sem lag\u00f0i sitt af m\u00f6rkum til talnakenninga og algebru auk e\u00f0lisfr\u00e6\u00f0i og stj\u00f6rnufr\u00e6\u00f0i, og svissneski s\u00e1lfr\u00e6\u00f0ingurinn Carl Jung (1875-1961), sem stofna\u00f0i greiningars\u00e1lfr\u00e6\u00f0i. \u00dea\u00f0 var flutt inn til Amer\u00edku \u00e1 19. \u00f6ld af \u00fe\u00fdskum innflytjendum.'), TRUE, 'Carl');         
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2555, STRINGDECODE('Fr\u00e1 r\u00f3mverska heitinu Caecilius (sj\u00e1 CECILIA). \u00deetta var nafn 3. aldar d\u00fdrlingur, f\u00e9lagi Saint Cyprian. \u00de\u00f3tt \u00fea\u00f0 hafi veri\u00f0 \u00ed notkun \u00e1 mi\u00f0\u00f6ldum \u00e1 Englandi var\u00f0 \u00fea\u00f0 ekki algengt fyrr en \u00e1 19. \u00f6ld \u00feegar \u00fea\u00f0 var gefi\u00f0 til hei\u00f0urs hinni g\u00f6fugu Cecil fj\u00f6lskyldu, sem haf\u00f0i veri\u00f0 \u00e1berandi s\u00ed\u00f0an \u00e1 16. \u00f6ld. Eftirnafn \u00feeirra var dregi\u00f0 af velska eiginnafninu Seisyll, sem var dregi\u00f0 af r\u00f3mverska nafninu Sextilius, aflei\u00f0a af SEXTUS.'), TRUE, 'Cecil');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2556, STRINGDECODE('Fr\u00f6nsku, sp\u00e6nsku og port\u00fag\u00f6lsku formi CAESAR. Fr\u00e6gur flutningsma\u00f0ur var bandar\u00edski vinnuveitandinn C\u00e9sar Ch\u00e1vez (1927-1993).'), TRUE, 'Cesar');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2557, STRINGDECODE('Fr\u00e1 germanska heitinu Karl, sem var dregi\u00f0 af germ\u00f6nsku or\u00f0i sem \u00fe\u00fd\u00f0ir \u201ema\u00f0ur\u201c. A\u00f0rar kenningar segja hins vegar a\u00f0 \u00fea\u00f0 s\u00e9 dregi\u00f0 af sameiginlega germanska heiti\u00fe\u00e6ttinum hari sem \u00fe\u00fd\u00f0ir \u201eher, str\u00ed\u00f0sma\u00f0ur\u201c. Vins\u00e6ldir nafnsins \u00e1 meginlandi Evr\u00f3pu voru vegna fr\u00e6g\u00f0ar Karls mikla (742-814), almennt \u00feekktur sem Karl mikli, konungur Frankanna sem kom til a\u00f0 stj\u00f3rna mestu Evr\u00f3pu. Afi hans Charles Martel haf\u00f0i einnig veri\u00f0 \u00feekktur lei\u00f0togi Frankanna. \u00dea\u00f0 var s\u00ed\u00f0an nafn nokkurra helga r\u00f3mverskra keisara, svo og konunga Frakklands, Sp\u00e1nar, Port\u00fagals, Sv\u00ed\u00fej\u00f3\u00f0ar og Ungverjalands (\u00ed \u00fdmsum stafsetningum). Eftir Karlamagn\u00fas var nafn hans teki\u00f0 upp sem or\u00f0 sem \u00fe\u00fd\u00f0ir \u201ekonungur\u201c \u00e1 m\u00f6rgum Austur-Evr\u00f3pu tungum\u00e1lum, til d\u00e6mis t\u00e9kkneska kr\u00e1l, ungverska kir\u00e1ly, r\u00fassneska \u043a\u043e\u0440\u043e\u043b\u044c (korol) og tyrkneska kral. Nafni\u00f0 var\u00f0 ekki algengt \u00ed Bretlandi fyrr en \u00e1 17. \u00f6ld. \u00feegar \u00fea\u00f0 var bori\u00f0 af Stuart-konunginum Charles I. \u00dea\u00f0 haf\u00f0i veri\u00f0 kynnt \u00ed Stuart-konungsfj\u00f6lskyldunni af Mary Queen of the Scots, sem haf\u00f0i veri\u00f0 alin upp \u00ed Frakklandi. Me\u00f0 fr\u00e6gum flytjendum nafnsins m\u00e1 nefna n\u00e1tt\u00farufr\u00e6\u00f0inginn Charles Darwin (1809-1882) sem gj\u00f6rbylti l\u00edffr\u00e6\u00f0i. me\u00f0 \u00fer\u00f3unarkenningu sinni, sk\u00e1ldsagnah\u00f6fundurinn Charles Dickens (1812-1870) sem skrifa\u00f0i sl\u00edk verk eins og Great Expectations and A Tale of Two Cities, franski r\u00edkisstj\u00f3rinn Charles de Gaulle (1890-1970) og bandar\u00edska teiknimyndager\u00f0armanninn Charles Schulz (1922-2000), skapari teiknimyndas\u00f6gunnar Peanuts.'), TRUE, 'Charles');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2558, STRINGDECODE('Fr\u00e1 latneska nafninu Christianus \u00e1 mi\u00f0\u00f6ldum sem \u00fe\u00fd\u00f0ir \u201ekristinn\u201c (sj\u00e1 CHRISTOS). \u00c1 Englandi hefur \u00fea\u00f0 veri\u00f0 \u00ed notkun fr\u00e1 mi\u00f0\u00f6ldum og \u00e1 \u00feeim t\u00edma var \u00fea\u00f0 nota\u00f0 b\u00e6\u00f0i af k\u00f6rlum og konum, en \u00fea\u00f0 var\u00f0 ekki algengt fyrr en \u00e1 17. \u00f6ld. \u00cd Danm\u00f6rku hefur nafni\u00f0 veri\u00f0 bori\u00f0 af t\u00edu konungum s\u00ed\u00f0an \u00e1 15. \u00f6ld. Fr\u00e6gur flutningsma\u00f0ur var Hans Christian Andersen (1805-1875), danskur h\u00f6fundur sl\u00edkra \u00e6vint\u00fdra eins og lj\u00f3ta andarungann og n\u00fd f\u00f6t keisarans.'), TRUE, 'Christian');     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2559, STRINGDECODE('Fr\u00e1 s\u00ed\u00f0gr\u00edska nafninu \u03a7\u03c1\u03b9\u03c3\u03c4\u03cc\u03c6\u03bf\u03c1\u03bf\u03c2 (Christophoros) sem \u00fe\u00fd\u00f0ir \u201ebera CHRIST\u201c, dregi\u00f0 af \u03a7\u03c1\u03b9\u03c3\u03c4\u03cc\u03c2 (Christos) \u00e1samt \u03c6\u03ad\u03c1\u03c9 (phero) sem \u00fe\u00fd\u00f0ir \u201ea\u00f0 bera, a\u00f0 bera\u201c. Frumkristnir menn notu\u00f0u \u00fea\u00f0 sem myndhverflegt nafn og l\u00fdstu \u00fev\u00ed yfir a\u00f0 \u00feeir b\u00e6ru Krist \u00ed hjarta s\u00ednu. \u00c1 mi\u00f0\u00f6ldum leiddu b\u00f3kstaflegar t\u00falkanir \u00e1 si\u00f0areglum nafnsins til \u00fej\u00f3\u00f0sagna um heilagan Krist\u00f3fer sem bar hinn unga Jes\u00fa yfir \u00e1na. Hann er talinn verndard\u00fdrlingur fer\u00f0amanna. Sem enskt eiginnafn hefur Christopher veri\u00f0 almennt \u00ed notkun s\u00ed\u00f0an \u00e1 15. \u00f6ld. \u00dea\u00f0 var\u00f0 mj\u00f6g vins\u00e6lt \u00e1 seinni hluta 20. aldar og n\u00e1\u00f0i topps\u00e6ti Englands og Wales \u00e1 n\u00edunda \u00e1ratugnum og n\u00e1lga\u00f0ist \u00fea\u00f0 \u00ed Bandar\u00edkjunum. \u00cd Danm\u00f6rku var \u00feetta nafn bori\u00f0 af \u00feremur konungum (n\u00f6fn \u00feeirra eru venjulega stafsett Christoffer), \u00fear \u00e1 me\u00f0al Krist\u00f3fer af B\u00e6jaralandi fr\u00e1 15. \u00f6ld sem einnig stj\u00f3rna\u00f0i Noregi og Sv\u00ed\u00fej\u00f3\u00f0. A\u00f0rir fr\u00e6gir handhafar eru \u00edtalski landk\u00f6nnu\u00f0urinn Christopher Columbus (1451-1506), enski leiksk\u00e1ldi\u00f0 Christopher Marlowe (1564-1593), enski arkitektinn Christopher Wren (1632-1723) og sk\u00e1ldskaparpers\u00f3nan Christopher Robin \u00far A. A. Milne`s Winnie-the-Pooh b\u00f3kum.'), TRUE, 'Christopher');  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2560, STRINGDECODE('Fr\u00e1 \u039a\u1fe6\u03c1\u03bf\u03c2 (Kyros), gr\u00edska form persneska nafnsins K\u016brush, sem getur \u00fe\u00fdtt \u201eframs\u00fdnn\u201c e\u00f0a \u201eungur\u201c. Nafni\u00f0 er stundum tengt vi\u00f0 gr\u00edska \u03ba\u03cd\u03c1\u03b9\u03bf\u03c2 (kyrios) sem \u00fe\u00fd\u00f0ir \u201eherra\u201c. \u00dea\u00f0 var bori\u00f0 af nokkrum konungum Persa, \u00fear \u00e1 me\u00f0al K\u00fdrusi mikla, sem lag\u00f0i undir sig Bab\u00fdlon. Hann er fr\u00e6gur \u00ed Gamla testamentinu fyrir a\u00f0 frelsa hina f\u00f6ngnu gy\u00f0inga og leyfa \u00feeim a\u00f0 sn\u00faa aftur til \u00cdsraels. Sem enskt nafn kom \u00fea\u00f0 fyrst \u00ed notkun me\u00f0al Puritana eftir si\u00f0askipti m\u00f3tm\u00e6lenda.'), TRUE, STRINGDECODE('C\u00fdrus'));
