INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2579, STRINGDECODE('Komi\u00f0 \u00far gr\u00edsku \u03b4\u03b1\u03bc\u03ac\u03b6\u03c9 (damazo) sem \u00fe\u00fd\u00f0ir \u201ea\u00f0 temja\u201c. Samkv\u00e6mt gr\u00edskri go\u00f0s\u00f6gn voru Damon og Pythias vinir sem bjuggu \u00e1 Syracuse \u00e1 4. \u00f6ld f.Kr. \u00deegar Pythias var d\u00e6mdur til dau\u00f0a m\u00e1tti hann fara t\u00edmabundi\u00f0 laus me\u00f0 \u00fev\u00ed skilyr\u00f0i a\u00f0 Damon t\u00e6ki s\u00e6ti hans \u00ed fangelsi. Pythias kom aftur r\u00e9tt \u00e1\u00f0ur en Damon \u00e1tti a\u00f0 taka af l\u00edfi \u00ed hans sta\u00f0 og konungur var svo hrifinn af hollustu \u00feeirra vi\u00f0 annan a\u00f0 hann n\u00e1\u00f0a\u00f0i Pythias. Sem enskt eiginnafn hefur \u00fea\u00f0 a\u00f0eins veri\u00f0 nota\u00f0 reglulega s\u00ed\u00f0an \u00e1 20. \u00f6ld.'), TRUE, 'Damon');              
