INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2582, STRINGDECODE('Fr\u00e1 hebreska nafninu \u05d3\u05b8\u05bc\u05e0\u05b4\u05d9\u05b5\u05d0\u05dc (Daniyyel) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0 er d\u00f3mari minn\u201c, fr\u00e1 r\u00f3tunum \u05d3\u05b4\u05bc\u05d9\u05df (din) sem \u00fe\u00fd\u00f0ir \u201ca\u00f0 d\u00e6ma\u201c og \u05d0\u05b5\u05dc (`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0\u201c. Dan\u00edel var hebreskur sp\u00e1ma\u00f0ur en saga hans er s\u00f6g\u00f0 \u00ed Dan\u00edelsb\u00f3k \u00ed Gamla testamentinu. Hann bj\u00f3 \u00e1 t\u00edmum Gy\u00f0inga \u00ed \u00fatleg\u00f0 \u00ed Bab\u00fdlon, \u00fear sem hann \u00fej\u00f3na\u00f0i \u00ed hir\u00f0 konungs og f\u00f3r \u00e1berandi me\u00f0 \u00fev\u00ed a\u00f0 t\u00falka drauma konungs. B\u00f3kin s\u00fdnir einnig fj\u00f3rar s\u00fdn Dan\u00edels \u00e1 heimsendi. Vegna vins\u00e6lda Bibl\u00edupers\u00f3nunnar kom nafni\u00f0 \u00ed notkun \u00e1 Englandi \u00e1 mi\u00f0\u00f6ldum. \u00de\u00f3tt \u00fea\u00f0 hafi or\u00f0i\u00f0 sjaldg\u00e6ft \u00e1 15. \u00f6ld var \u00fea\u00f0 endurvaki\u00f0 eftir si\u00f0askipti m\u00f3tm\u00e6lenda. Me\u00f0al fr\u00e6gra handhafa \u00feessa nafns eru enski rith\u00f6fundurinn Daniel Defoe (1660-1731), svissneski st\u00e6r\u00f0fr\u00e6\u00f0ingurinn Daniel Bernoulli (1700-1782) og bandar\u00edski landam\u00e6rinn Daniel Boone (1734-1820).'), TRUE, 'Daniel');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2583, STRINGDECODE('\u00cdslenskt afbrig\u00f0i af DANIEL.'), TRUE, 'Danival');       
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2584, STRINGDECODE('Fr\u00e1 hebreska nafninu \u05d3\u05b8\u05bc\u05e0\u05b4\u05d9\u05b5\u05d0\u05dc (Daniyyel) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0 er d\u00f3mari minn\u201c, fr\u00e1 r\u00f3tunum \u05d3\u05b4\u05bc\u05d9\u05df (din) sem \u00fe\u00fd\u00f0ir \u201ca\u00f0 d\u00e6ma\u201c og \u05d0\u05b5\u05dc (`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0\u201c. Dan\u00edel var hebreskur sp\u00e1ma\u00f0ur en saga hans er s\u00f6g\u00f0 \u00ed Dan\u00edelsb\u00f3k \u00ed Gamla testamentinu. Hann bj\u00f3 \u00e1 t\u00edmum Gy\u00f0inga \u00ed \u00fatleg\u00f0 \u00ed Bab\u00fdlon, \u00fear sem hann \u00fej\u00f3na\u00f0i \u00ed hir\u00f0 konungs og f\u00f3r \u00e1berandi me\u00f0 \u00fev\u00ed a\u00f0 t\u00falka drauma konungs. B\u00f3kin s\u00fdnir einnig fj\u00f3rar s\u00fdn Dan\u00edels \u00e1 heimsendi. Vegna vins\u00e6lda Bibl\u00edupers\u00f3nunnar kom nafni\u00f0 \u00ed notkun \u00e1 Englandi \u00e1 mi\u00f0\u00f6ldum. \u00de\u00f3tt \u00fea\u00f0 hafi or\u00f0i\u00f0 sjaldg\u00e6ft \u00e1 15. \u00f6ld var \u00fea\u00f0 endurvaki\u00f0 eftir si\u00f0askipti m\u00f3tm\u00e6lenda. Me\u00f0al fr\u00e6gra handhafa \u00feessa nafns eru enski rith\u00f6fundurinn Daniel Defoe (1660-1731), svissneski st\u00e6r\u00f0fr\u00e6\u00f0ingurinn Daniel Bernoulli (1700-1782) og bandar\u00edski landam\u00e6rinn Daniel Boone (1734-1820).'), TRUE, STRINGDECODE('Dan\u00edel'));           
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2585, STRINGDECODE('\u00cdslenskt afbrig\u00f0i af DANIEL.'), TRUE, STRINGDECODE('Dan\u00edval'));    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2586, STRINGDECODE('DURANTE stuttmynd mi\u00f0alda. Athyglisver\u00f0asti flutningsma\u00f0ur \u00feessa nafns var Dante Alighieri, \u00edtalska sk\u00e1ldi\u00f0 \u00e1 13. \u00f6ld sem skrifa\u00f0i hina gu\u00f0d\u00f3mlegu gamanmynd.'), TRUE, 'Dante');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2587, STRINGDECODE('R\u00f3mversk mynd af \u0394\u03b1\u03c1\u03b5\u1fd6\u03bf\u03c2 (Dareios), sem var gr\u00edska form persneska nafnsins D\u0101rayavahush sem \u00fe\u00fd\u00f0ir \u201ea\u00f0 eiga g\u00e6sku\u201c, samsett \u00far frumefnunum d\u00e2raya \u201ea\u00f0 eiga\u201c og vahu \u201egott\u201c. \u00der\u00edr fornir konungar Pers\u00edu b\u00e1ru \u00feetta nafn, \u00fear \u00e1 me\u00f0al Dar\u00edus mikli sem st\u00e6kka\u00f0i Achaemenidaveldi\u00f0 a\u00f0 mestu leyti. Sveitir hans r\u00e9\u00f0ust inn \u00ed Grikkland en voru sigra\u00f0ar \u00ed orrustunni vi\u00f0 mara\u00feon. \u00dea\u00f0 hefur aldrei veri\u00f0 mj\u00f6g algengt sem eiginnafn \u00ed enskum\u00e6landi heimi, \u00fe\u00f3 \u00fea\u00f0 hafi aukist \u00ed vins\u00e6ldum eftir mi\u00f0ja 20. \u00f6ld. \u00cd Lith\u00e1en g\u00e6ti \u00fea\u00f0 veri\u00f0 gefi\u00f0 til hei\u00f0urs lith\u00e1\u00edsk-amer\u00edska flugmanninum Steponas Darius (1896-1933), sem l\u00e9st vi\u00f0 a\u00f0 reyna a\u00f0 flj\u00faga beint fr\u00e1 New York til Lith\u00e1ens. Eftirnafn hans var amer\u00edskt form upprunalega Dara\u0161ius.'), TRUE, STRINGDECODE('Dar\u00edus'));            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2588, STRINGDECODE('Diminutive af \u00caDOUARD.'), TRUE, 'Darri');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2589, STRINGDECODE('Fr\u00e1 hebreska nafninu \u05d3\u05b8\u05bc\u05d5\u05b4\u05d3 (Dawid), sem var dregi\u00f0 af hebresku \u05d3\u05bc\u05d5\u05b9\u05d3 (dod) sem \u00fe\u00fd\u00f0ir \u201e\u00e1stvinur\u201c e\u00f0a \u201efr\u00e6ndi\u201c. Dav\u00ed\u00f0 var annar og mesti konungur \u00cdsraels og r\u00e9\u00f0 r\u00edkjum \u00e1 10. \u00f6ld f.Kr. Nokkrar s\u00f6gur af honum eru sag\u00f0ar \u00ed Gamla testamentinu, \u00fear \u00e1 me\u00f0al \u00f3sigur hans gegn Gol\u00edat, risast\u00f3rum Filista. Samkv\u00e6mt N\u00fdja testamentinu var Jes\u00fas \u00e6tta\u00f0ur fr\u00e1 honum og \u00feetta nafn hefur veri\u00f0 nota\u00f0 \u00ed Bretlandi s\u00ed\u00f0an \u00e1 mi\u00f0\u00f6ldum. \u00dea\u00f0 hefur veri\u00f0 s\u00e9rstaklega vins\u00e6lt \u00ed Wales, \u00fear sem \u00fea\u00f0 er nota\u00f0 til hei\u00f0urs 5. aldar verndard\u00fdrlinga \u00ed Wales (einnig kalla\u00f0 Dewi), svo og \u00ed Skotlandi, \u00fear sem \u00fea\u00f0 var bori\u00f0 af tveimur konungum. S\u00ed\u00f0ustu \u00f6ld hefur \u00fea\u00f0 veri\u00f0 eitt af vins\u00e6lustu n\u00f6fnum enskum\u00e6landi heimsins og skilur aldrei eftir 30 efstu n\u00f6fn str\u00e1ka \u00ed Bandar\u00edkjunum og n\u00e1\u00f0i efsta s\u00e6ti \u00ed Englandi og Wales \u00e1 fimmta og sj\u00f6tta \u00e1ratugnum. \u00c1 Sp\u00e1ni var \u00fea\u00f0 vins\u00e6lasta nafni\u00f0 fyrir str\u00e1ka \u00e1 \u00e1ttunda og n\u00edunda \u00e1ratugnum. Me\u00f0al fr\u00e6gra handhafanna eru heimspekingur David Hume (1711-1776), landk\u00f6nnu\u00f0ur David Livingstone (1813-1873), t\u00f3nlistarma\u00f0urinn David Bowie (1947-2016) og knattspyrnuma\u00f0ur David Beckham (1975-). \u00deetta er l\u00edka nafn hetjunnar \u00ed h\u00e1lf sj\u00e1lfs\u00e6vis\u00f6gulegri sk\u00e1lds\u00f6gu Charles Dickens, David Copperfield (1850).'), TRUE, STRINGDECODE('Dav\u00ed\u00f0'));               
