INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2594, STRINGDECODE('Fr\u00e1 atvinnu eftirnafn sem \u00fe\u00fd\u00f0ir \u201cs\u00e1 sem litar\u201c \u00e1 fornensku. \u00dea\u00f0 fellur einnig saman vi\u00f0 latneska or\u00f0i\u00f0 dexter sem \u00fe\u00fd\u00f0ir \u201er\u00e9tthentur, h\u00e6fir\u201c.'), TRUE, 'Dexter');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2595, STRINGDECODE('D\u00f6nsk, norsk og s\u00e6nsk form af DIETRICH auk sjaldg\u00e6frar hollenskrar styttrar mynd af DIEDERIK. \u00deekktur handhafi \u00feessa nafns er norski s\u00f6ngvarinn Didrik Solli-Tangen (f. 1987).'), TRUE, STRINGDECODE('Di\u00f0rik'));               
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2596, STRINGDECODE('Hugsanlega stytt mynd af SANTIAGO. \u00cd mi\u00f0\u00f6ldum hefur Diego veri\u00f0 lat\u00edn\u00edsera\u00f0 sem Didacus og \u00fev\u00ed hefur veri\u00f0 haldi\u00f0 fram a\u00f0 \u00fea\u00f0 stafi \u00ed raun af gr\u00edsku \u03b4\u03b9\u03b4\u03b1\u03c7\u03ae (didache) sem \u00fe\u00fd\u00f0ir \u201ekennsla\u201c. Saint Didacus (e\u00f0a Diego) var franskiskanskur br\u00f3\u00f0ir fr\u00e1 15. \u00f6ld me\u00f0 a\u00f0setur \u00ed Alcal\u00e1 \u00e1 Sp\u00e1ni. A\u00f0rir fr\u00e6gir handhafar \u00feessa nafns eru mex\u00edk\u00f3ski vegglistarma\u00f0urinn Diego Rivera (1886-1957) og argent\u00ednski knattspyrnuma\u00f0urinn Diego Maradona (1960-).'), TRUE, 'Diego');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2597, 'Karlkyns mynd af DILJA.', TRUE, 'Diljar');     
