INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2599, STRINGDECODE('Afleitt \u00far gr\u00edsku \u0394\u03b9\u03cc\u03c2 (Dios) sem \u00fe\u00fd\u00f0ir \u201eaf ZEUS\u201c og \u03bc\u03ae\u03b4\u03bf\u03bc\u03b1\u03b9 (medomai) sem \u00fe\u00fd\u00f0ir \u201ea\u00f0 hugsa, a\u00f0 skipuleggja\u201c. \u00cd gr\u00edsku go\u00f0s\u00f6gninni var Diomedes ein mesta hetja sem bar\u00f0ist gegn Tr\u00f3verjum. Me\u00f0 Odysseus f\u00f3r hann inn \u00ed Troja og stal Palladium. Eftir Tr\u00f3justr\u00ed\u00f0i\u00f0 stofna\u00f0i hann borgirnar Brindisi og Arpi \u00e1 \u00cdtal\u00edu.'), TRUE, STRINGDECODE('D\u00ed\u00f3medes'));             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2600, STRINGDECODE('Merking \u00f3\u00feekkt. Hugsanlega tengt or\u00f0inu dofrar (\u201edalur, dalur\u201c), e\u00f0a or\u00f0 sem \u00fe\u00fd\u00f0ir \u201elatur\u201c. \u00cd norr\u00e6nni go\u00f0afr\u00e6\u00f0i er \u00feetta nafn risa sem b\u00fdr \u00e1 fjallinu Dofrafjall.'), TRUE, 'Dofri');         
