INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2604, STRINGDECODE('\u00deetta nafn var einkum bori\u00f0 af Domald fr\u00e1 Sidraga (um 1160-1243), \u00f6flugur dalmat\u00edskur a\u00f0alsma\u00f0ur og feudal herra sem um nokkurra \u00e1ra skei\u00f0 var prins \u00ed borginni Split, sem var (og er) sta\u00f0sett \u00ed \u00fev\u00ed sem n\u00fa er Kr\u00f3at\u00eda. \u00dear sem ekki er miki\u00f0 vita\u00f0 um pers\u00f3nulegt l\u00edf hans (eins og fj\u00f6lskyldan sem hann f\u00e6ddist \u00ed, sem dregur \u00feannig \u00ed efa \u00fej\u00f3\u00f0erni hans), getum vi\u00f0 ekki sagt neitt me\u00f0 vissu um merkingu og uppruna eiginnafns hans. hann var \u00fej\u00f3\u00f0ernislegur Slavi (l\u00edkurnar \u00e1 \u00fev\u00ed eru miklar), \u00fe\u00e1 er fornafn hans l\u00edklegast einnig af slavneskum uppruna. Fyrsti \u00fe\u00e1ttur \u00feess er n\u00e6stum \u00f6rugglega fenginn \u00far slavnesku domu sem \u00fe\u00fd\u00f0ir \u201eheimili, h\u00fas\u201c (sj\u00e1 DOMAGOJ). Seinni \u00fe\u00e1ttur nafns hans er miklu minna \u00f6ruggur, en \u00fea\u00f0 vir\u00f0ist sem \u00fea\u00f0 s\u00e9u l\u00edkur \u00e1 \u00fev\u00ed a\u00f0 me\u00f0 metathesis geti \u00fea\u00f0 veri\u00f0 dregi\u00f0 af Slavic vladeti sem \u00fe\u00fd\u00f0ir \u201ca\u00f0 stj\u00f3rna\u201c (sj\u00e1 VSEVOLOD) e\u00f0a jafnvel Slavic mladu sem \u00fe\u00fd\u00f0ir \u201cungur\u201c (sj\u00e1 MLADEN En ef Domald var ekki \u00fej\u00f3\u00f0ernislegur Slaverur, \u00fe\u00e1 hef\u00f0i hann kannski veri\u00f0 dalmat\u00edskur \u00cdtali \u00ed sta\u00f0inn, en \u00fe\u00e1 vir\u00f0ist l\u00edklegt a\u00f0 nafn hans s\u00e9 af germ\u00f6nskum uppruna. \u00deegar \u00f6llu er \u00e1 botninn hvolft voru \u00cdtalir vel kunnir germ\u00f6nskum n\u00f6fnum, \u00fe\u00f6kk s\u00e9 \u00e1hrifum Ostrogoths, Lombards og Franka nokkrum \u00f6ldum \u00e1\u00f0ur. Nafn hans \u00e6tti \u00fe\u00e1 a\u00f0 vera afbrig\u00f0i af DOMUALD, sem er hi\u00f0 forna germanska saml\u00edki af norr\u00e6na nafninu D\u00d3MALDR. \u00dea\u00f0 g\u00e6ti jafnvel veri\u00f0 tvinna\u00f0 latnesk-germanskt nafn, \u00fear sem \u00feetta var til \u00e1 \u00cdtal\u00edu strax \u00e1 8. \u00f6ld e.Kr. Nafni\u00f0 \u00e6tti \u00fe\u00e1 a\u00f0 samanstanda af lat\u00ednu dominus sem \u00fe\u00fd\u00f0ir \u201ch\u00fasb\u00f3ndi, h\u00f6f\u00f0ingi, herra\u201c (a\u00f0 lokum fr\u00e1 anna\u00f0hvort lat\u00ednu domus \u201ch\u00fasi\u201c e\u00f0a lat\u00ednu domo \u201ctil a\u00f0 temja\u201c) og af germ\u00f6nskum wald sem \u00fe\u00fd\u00f0ir \u201cvald, stj\u00f3rn\u201c. Allt \u00ed allt er \u00fea\u00f0 lj\u00f3st a\u00f0 a\u00f0 minnsta kosti \u00feegar um er a\u00f0 r\u00e6\u00f0a \u00e1\u00f0urnefndan Dalmatian a\u00f0alsmann, \u00fe\u00e1 eru margv\u00edslegir m\u00f6guleikar fyrir or\u00f0sifjafr\u00e6\u00f0i nafnsins Domald. En \u00feanga\u00f0 til vi\u00f0 komumst meira a\u00f0 pers\u00f3nulegu l\u00edfi hans er aldrei h\u00e6gt a\u00f0 \u00fatiloka neitt \u00feeirra og \u00e6tti \u00fev\u00ed a\u00f0 hafa \u00ed huga.)'), TRUE, STRINGDECODE('D\u00f3mald'));          
