INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2607, STRINGDECODE('Fr\u00e1 gel\u00edska nafninu Domhnall sem \u00fe\u00fd\u00f0ir \u201ch\u00f6f\u00f0ingi heimsins\u201c, samanstendur af g\u00f6mlu keltnesku frumefnunum dumno \u201cheimur\u201c og val \u201cregla\u201c. \u00deetta var nafn tveggja konunga 9. aldar Skota og P\u00edkna. \u00dea\u00f0 hefur jafnan veri\u00f0 mj\u00f6g vins\u00e6lt \u00ed Skotlandi og \u00e1 20. \u00f6ldinni var\u00f0 \u00fea\u00f0 algengt \u00ed hinum enskum\u00e6landi heiminum. \u00deetta er nafn einnar vins\u00e6lustu teiknimyndapers\u00f3na Walt Disney, Donald Duck. \u00dea\u00f0 bar einnig \u00e1stralski krikketleikarinn Donald Bradman (1908-2001).'), TRUE, STRINGDECODE('D\u00f3nald'));          
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2608, STRINGDECODE('Fr\u00e1 gel\u00edska nafninu Domhnall sem \u00fe\u00fd\u00f0ir \u201ch\u00f6f\u00f0ingi heimsins\u201c, samanstendur af g\u00f6mlu keltnesku frumefnunum dumno \u201cheimur\u201c og val \u201cregla\u201c. \u00deetta var nafn tveggja konunga 9. aldar Skota og P\u00edkna. \u00dea\u00f0 hefur jafnan veri\u00f0 mj\u00f6g vins\u00e6lt \u00ed Skotlandi og \u00e1 20. \u00f6ldinni var\u00f0 \u00fea\u00f0 algengt \u00ed hinum enskum\u00e6landi heiminum. \u00deetta er nafn einnar vins\u00e6lustu teiknimyndapers\u00f3na Walt Disney, Donald Duck. \u00dea\u00f0 bar einnig \u00e1stralski krikketleikarinn Donald Bradman (1908-2001).'), TRUE, STRINGDECODE('D\u00f3naldur'));        
