INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2612, STRINGDECODE('\u00de\u00fd\u00f0ir \u201egullsmi\u00f0ur\u201c. Draupnir er nafn b\u00e6\u00f0i dvergsins og ODINs gullna armhrings, sem hann lag\u00f0i \u00e1 jar\u00f0arfararbraut BALDR til a\u00f0 s\u00fdna fram \u00e1 a\u00f0 HEL v\u00e6ri l\u00f6glegur h\u00f6f\u00f0ingi undirheimanna. \u201eDraupnir\u201c var einnig nota\u00f0 sem kenning fyrir \u201egull\u201c.'), TRUE, 'Draupnir');        
