INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2620, STRINGDECODE('Fornorr\u00e6nt nafn sem \u00fe\u00fd\u00f0ir \u201cs\u00e1 sem er sv\u00e6fandi\u201c. Hugsanlega dregi\u00f0 af sama or\u00f0i og s\u00e6nska dvala og danska og norska dvale, sem \u00fe\u00fd\u00f0ir \u201esvefn, dvala\u201c. Dvalinn er einn af fj\u00f3rum hj\u00f6rtum \u00ed norr\u00e6nni go\u00f0afr\u00e6\u00f0i sem \u00e1t buddana af Yggdrasil, heimstr\u00e9nu. Hann er l\u00edka dvergur og smi\u00f0ur sem bj\u00f3 til h\u00e1lsmen sem FREYJA nota\u00f0i.'), TRUE, 'Dvalinn');              
