INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2630, STRINGDECODE('Afleidd \u00far fornum enskum \u00fe\u00e1ttum ead \u201cau\u00f0ur, \u00f6rl\u00f6g\u201c og gar \u201cspj\u00f3t\u201c. \u00deetta var nafn enska konungs fr\u00e1 10. \u00f6ld, Edgar hinn fri\u00f0sami. Nafni\u00f0 lif\u00f0i ekki l\u00f6ngu eftir landn\u00e1m Normandans en \u00fea\u00f0 var endurvaki\u00f0 \u00e1 18. \u00f6ld, a\u00f0 hluta til vegna pers\u00f3na me\u00f0 \u00feessu nafni \u00ed sk\u00e1lds\u00f6gu Sir Walter Scott The Bride of Lammermoor (1819), sem segir fr\u00e1 h\u00f6rmulegum k\u00e6rleika Edgar Ravenswood og Lucy Ashton [1]. Me\u00f0al fr\u00e6gra handhafanna eru rith\u00f6fundurinn og sk\u00e1ldi\u00f0 Edgar Allan Poe (1809-1849), franski impressj\u00f3nistam\u00e1larinn Edgar Degas (1834-1917) og rith\u00f6fundurinn Edgar Rice Burroughs (1875-1950).'), TRUE, 'Edgar');            
