INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2635, STRINGDECODE('\u00de\u00fd\u00f0ir \u201er\u00edkur v\u00f6r\u00f0ur\u201c, fenginn \u00far forn-ensku frumefnunum ead \u201eau\u00f0ur, g\u00e6fa\u201c og slitinn \u201ev\u00f6r\u00f0ur\u201c. \u00deetta var nafn nokkurra engilsaxneskra konunga, s\u00ed\u00f0astur var hinn heilagi Edward j\u00e1tandi sk\u00f6mmu fyrir landn\u00e1m Normanda \u00e1 11. \u00f6ld. Hann var \u00feekktur sem r\u00e9ttl\u00e1tur h\u00f6f\u00f0ingi og vegna vins\u00e6lda hans h\u00e9lst nafn hans \u00ed notkun eftir landvinninginn \u00feegar flest \u00f6nnur forn-ensk n\u00f6fn voru skipt \u00fat fyrir Norman. 13. aldar Plantagenet konungur Hinrik III nefndi son sinn og eftirmann eftir d\u00fdrlingnum og sj\u00f6 konungar Englands \u00e1 eftir voru einnig nefndir Edward. Fr\u00e6gur flutningsma\u00f0ur var breska t\u00f3nsk\u00e1ldi\u00f0 Edward Elgar (1857-1934). \u00dea\u00f0 var einnig nota\u00f0 af rith\u00f6fundinum Charlotte Bront\u00eb fyrir pers\u00f3nuna Edward Rochester, a\u00f0al\u00e1hugam\u00e1l titilpers\u00f3nunnar \u00ed sk\u00e1lds\u00f6gu sinni Jane Eyre (1847).'), TRUE, 'Edward');            
