INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2652, STRINGDECODE('\u00de\u00fd\u00f0ir \u201ealltaf h\u00f6f\u00f0ingi\u201c, \u00far fornorr\u00e6na nafninu Eir\u00edkr, dreginn af frumefnunum ei \u201ealltaf, alltaf\u201c og r\u00edkr \u201eh\u00f6f\u00f0ingi, voldugur\u201c. Athyglisver\u00f0ur flutningsma\u00f0ur var Eir\u00edkr inn Rauda (Eric rau\u00f0i \u00e1 ensku), siglingama\u00f0ur og landk\u00f6nnu\u00f0ur fr\u00e1 10. \u00f6ld sem uppg\u00f6tva\u00f0i Gr\u00e6nland. \u00deetta var einnig nafn nokkurra fyrstu konunga \u00ed Sv\u00ed\u00fej\u00f3\u00f0, Danm\u00f6rku og Noregi. \u00deetta algenga norr\u00e6na nafn kom fyrst til Englands af d\u00f6nskum landnemum \u00e1 engilsaxneska t\u00edmabilinu. H\u00fan var ekki vins\u00e6l \u00e1 Englandi \u00e1 mi\u00f0\u00f6ldum en h\u00fan var endurvakin \u00e1 19. \u00f6ld, a\u00f0 hluta til vegna sk\u00e1lds\u00f6gu barna Eric, e\u00f0a Little by Little (1858) eftir Frederic William Farrar.'), TRUE, STRINGDECODE('Eir\u00edkur'));             
