INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2687, STRINGDECODE('Merking \u00f3\u00feekkt. \u00dea\u00f0 g\u00e6ti hugsanlega veri\u00f0 aflei\u00f0a af ALVIS e\u00f0a ELWIN. L\u00edklegra er a\u00f0 \u00fea\u00f0 s\u00e9 fr\u00e1 sjaldg\u00e6fa eftirnafninu Elvis, afbrig\u00f0i af Elwes, sem a\u00f0 lokum er dregi\u00f0 af eiginnafninu ELOISE. S\u00f6ngvarinn Elvis Presley (1935-1977) vakti nafni\u00f0 fyrir almenningi, en nafn hans kom fr\u00e1 millinafni f\u00f6\u00f0ur s\u00edns. \u00deetta nafn er einnig nota\u00f0 sem anglicized mynd af \u00edrska AILBHE.'), TRUE, 'Elvis');         
