INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2690, STRINGDECODE('Fr\u00e1 or\u00f0inu um gr\u00e6na d\u00fdrindissteininn, sem er f\u00e6\u00f0ingarsteinn ma\u00ed. Smarag\u00f0i\u00f0 mi\u00f0lar sem sagt \u00e1st til handhafa. Or\u00f0i\u00f0 er a\u00f0 lokum \u00far gr\u00edsku \u03c3\u03bc\u03ac\u03c1\u03b1\u03b3\u03b4\u03bf\u03c2 (smaragdos).'), TRUE, 'Emerald'); 
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2691, STRINGDECODE('Fr\u00e1 r\u00f3mverska \u00e6ttarnafninu Aemilius, sem var dregi\u00f0 af latnesku aemulus sem \u00fe\u00fd\u00f0ir \u201ekeppinautur\u201c.'), TRUE, 'Emil');   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2692, STRINGDECODE('Bosn\u00edskt form AMIR (1).'), TRUE, 'Emir');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2693, STRINGDECODE('Fr\u00e1 hebreska nafninu \u05e2\u05b4\u05de\u05b8\u05bc\u05e0\u05d5\u05bc\u05d0\u05b5\u05dc (`Immanu`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0 er me\u00f0 okkur\u201c, fr\u00e1 r\u00f3tunum \u05e2\u05b4\u05dd (` im) sem \u00fe\u00fd\u00f0ir \u201cme\u00f0\u201c og \u05d0\u05b5\u05dc (`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0\u201c. \u00deetta var fyrirsagt nafn Mess\u00edasar \u00ed Gamla testamentinu. \u00dea\u00f0 hefur veri\u00f0 nota\u00f0 \u00e1 Englandi s\u00ed\u00f0an \u00e1 16. \u00f6ld \u00ed stafsetningunum Emmanuel og Immanuel, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 hafi ekki veri\u00f0 \u00fatbreitt [1]. Nafni\u00f0 hefur veri\u00f0 algengara \u00e1 meginlandi Evr\u00f3pu, s\u00e9rstaklega \u00e1 Sp\u00e1ni og \u00ed Port\u00fagal (\u00ed stafsetningunum Manuel og Manoel).'), TRUE, STRINGDECODE('Emman\u00fael'));            
