INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2698, STRINGDECODE('Skandinav\u00edskt form ENOCH.'), TRUE, 'Enok');  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2699, STRINGDECODE('Nafn a\u00f0alpers\u00f3nunnar \u00ed arfleif\u00f0 sk\u00e1lds\u00f6gum bandar\u00edska rith\u00f6fundarins Christopher Paolini. \u00cd sk\u00e1lds\u00f6gunum er Eragon drekaferill og \u00ed vi\u00f0t\u00f6lum hefur Paolini l\u00fdst \u00fev\u00ed yfir a\u00f0 hann hafi komi\u00f0 upp nafni Eragon me\u00f0 \u00fev\u00ed a\u00f0 breyta fyrsta staf stafsins \u00ed drekanum. Sumir telja a\u00f0 Paolini hafi fengi\u00f0 Eragon \u00far pers\u00f3nunni Erragon \u00far Pern ser\u00edu rith\u00f6fundarins Anne McCaffery, einnig me\u00f0 drekum og sem Paolini hefur vi\u00f0urkennt a\u00f0 hafa haft \u00e1hrif \u00e1. McCaffery sj\u00e1lf g\u00e6ti hafa fengi\u00f0 nafni\u00f0 fr\u00e1 pers\u00f3nunni Erragon \u00far Orrustunni vi\u00f0 Lore, af lj\u00f3\u00f0um Ossian (um 1760), \u00fear sem Ossian er sk\u00e1ldskapur s\u00f6guma\u00f0ur gel\u00edskra go\u00f0sagna og \u00fej\u00f3\u00f0sagna sem skoska sk\u00e1ldi\u00f0 James Macpherson bj\u00f3 til.'), TRUE, 'Eragon'); 
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2700, STRINGDECODE('Afleitt \u00far gr\u00edsku \u1f10\u03c1\u03ac\u03c3\u03bc\u03b9\u03bf\u03c2 (erasmios) sem \u00fe\u00fd\u00f0ir \u201e\u00e1stvinur\u201c. Heilagur Erasmus, einnig \u00feekktur sem Saint Elmo, var p\u00edslarvottur \u00e1 4. \u00f6ld sem er verndard\u00fdrlingur sj\u00f3manna. Erasmus var einnig nafn hollenskra fr\u00e6\u00f0imanna \u00e1 endurreisnart\u00edmabilinu.'), TRUE, 'Erasmus');           
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2701, STRINGDECODE('\u00de\u00fd\u00f0ir \u201ealltaf h\u00f6f\u00f0ingi\u201c, \u00far fornorr\u00e6na nafninu Eir\u00edkr, dreginn af frumefnunum ei \u201ealltaf, alltaf\u201c og r\u00edkr \u201eh\u00f6f\u00f0ingi, voldugur\u201c. Athyglisver\u00f0ur flutningsma\u00f0ur var Eir\u00edkr inn Rauda (Eric rau\u00f0i \u00e1 ensku), siglingama\u00f0ur og landk\u00f6nnu\u00f0ur fr\u00e1 10. \u00f6ld sem uppg\u00f6tva\u00f0i Gr\u00e6nland. \u00deetta var einnig nafn nokkurra fyrstu konunga \u00ed Sv\u00ed\u00fej\u00f3\u00f0, Danm\u00f6rku og Noregi. \u00deetta algenga norr\u00e6na nafn kom fyrst til Englands af d\u00f6nskum landnemum \u00e1 engilsaxneska t\u00edmabilinu. H\u00fan var ekki vins\u00e6l \u00e1 Englandi \u00e1 mi\u00f0\u00f6ldum en h\u00fan var endurvakin \u00e1 19. \u00f6ld, a\u00f0 hluta til vegna sk\u00e1lds\u00f6gu barna Eric, e\u00f0a Little by Little (1858) eftir Frederic William Farrar.'), TRUE, 'Eric');   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2702, STRINGDECODE('Skandinav\u00edskt form ERIC. \u00deetta var nafn konunga Sv\u00ed\u00fej\u00f3\u00f0ar, Danmerkur og Noregs. Erik IX Sv\u00edakonungur (12. \u00f6ld) er verndard\u00fdrlingur \u00feess lands.'), TRUE, 'Erik');
