INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2708, STRINGDECODE('Komi\u00f0 fr\u00e1 germ\u00f6nsku eornost sem \u00fe\u00fd\u00f0ir \u201ealvarlegt\u201c. \u00dea\u00f0 var kynnt til Englands af \u00fe\u00fdska h\u00fasinu \u00ed Hannover \u00feegar \u00feeir erf\u00f0u breska h\u00e1s\u00e6ti\u00f0 \u00e1 18. \u00f6ld, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 hafi ekki or\u00f0i\u00f0 algengt fyrr en \u00e1 n\u00e6stu \u00f6ld. Bandar\u00edski rith\u00f6fundurinn og \u00e6vint\u00fdrama\u00f0urinn Ernest Hemingway (1899-1961) var fr\u00e6gur handhafi nafnsins. \u00dea\u00f0 var einnig nota\u00f0 af Oscar Wilde fyrir pers\u00f3nu \u00ed gamanmynd hans The Importance of Being Earnest (1895).'), TRUE, 'Ernest');         
