INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2745, STRINGDECODE('Fr\u00e1 r\u00f3mverskum skilningi sem \u00fe\u00fd\u00f0ir \u201eheppinn, vel heppna\u00f0ur\u201c \u00e1 lat\u00ednu. \u00dea\u00f0 hlaut r\u00f3mverski hersh\u00f6f\u00f0inginn Sulla sem d\u00e1naror\u00f0 e\u00f0a g\u00e6lunafn. \u00dea\u00f0 birtist einnig \u00ed N\u00fdja testamentinu sem tilheyrir landstj\u00f3ra J\u00fadeu sem fangelsa\u00f0i heilagan Paul. Vegna hagst\u00e6\u00f0rar merkingar \u00feess var \u00feetta nafn vins\u00e6lt me\u00f0al frumkristinna manna og var bori\u00f0 af m\u00f6rgum frumd\u00fdrlingum og fj\u00f3rum p\u00e1fum. \u00dea\u00f0 hefur veri\u00f0 nota\u00f0 \u00e1 Englandi fr\u00e1 mi\u00f0\u00f6ldum, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 hafi veri\u00f0 vins\u00e6lla \u00e1 meginlandi Evr\u00f3pu. Athyglisver\u00f0ur flutningsma\u00f0ur var \u00fe\u00fdska t\u00f3nsk\u00e1ldi\u00f0 Felix Mendelssohn (1809-1847).'), TRUE, 'Felix');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2746, 'MISSING', TRUE, 'Fengur');     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2747, STRINGDECODE('Hugsanlega \u00fe\u00fd\u00f0ir \u00fea\u00f0 \u201efenb\u00fai\u201c, a\u00f0 hluta til \u00far norr\u00e6nu feni \u201em\u00fdri, m\u00fdr, m\u00fdri\u201c. \u00cd norr\u00e6nni go\u00f0s\u00f6gn var \u00feetta nafn risast\u00f3rs, \u00f3freskislegs \u00falfs - sonur Loka af hinni illu tr\u00f6llkonu Angrbo\u00f0u - sem \u00e1tti a\u00f0 drepa gu\u00f0inn \u00d3\u00f0inn \u00ed lokabardaga Ragnar\u00f6k. J. K. Rowling f\u00e9kk nafni\u00f0 fyrir var\u00falf a\u00f0 l\u00e1ni \u00ed sk\u00e1lds\u00f6gunum s\u00ednum um Harry Potter og tungl Sat\u00farnusar var nefnt eftir Fenri \u00e1ri\u00f0 2005.'), TRUE, 'Fenrir');
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2748, STRINGDECODE('Fr\u00e1 Ferdinando, gamla sp\u00e6nska formi\u00f0 af germ\u00f6nsku nafni sem samanstendur af frumefnunum \u201efer\u00f0\u201c og nand \u201e\u00e1r\u00e6\u00f0i, hugrakkur\u201c. Visgoths komu me\u00f0 nafni\u00f0 til \u00cdber\u00eduskagans, \u00fear sem \u00fea\u00f0 gekk inn \u00ed konungsfj\u00f6lskyldur Sp\u00e1nar og Port\u00fagals. \u00dea\u00f0an var\u00f0 \u00fea\u00f0 algengt me\u00f0al Habsborgar konungsfj\u00f6lskyldu Heilaga r\u00f3mverska heimsveldisins og Austurr\u00edkis og byrja\u00f0i \u00e1 sp\u00e6nska f\u00e6ddum Ferdinand I \u00e1 16. \u00f6ld. Athyglisver\u00f0ur flutningsma\u00f0ur var port\u00fagalski landk\u00f6nnu\u00f0urinn Ferdinand Magellan (1480-1521), kalla\u00f0ur Fern\u00e3o de Magalh\u00e3es \u00e1 port\u00fag\u00f6lsku, sem var lei\u00f0togi fyrsta lei\u00f0angursins sem sigldi um j\u00f6r\u00f0ina.'), TRUE, 'Ferdinand');         
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2749, STRINGDECODE('Fr\u00e1 Ferdinando, gamla sp\u00e6nska formi\u00f0 af germ\u00f6nsku nafni sem samanstendur af frumefnunum \u201efer\u00f0\u201c og nand \u201e\u00e1r\u00e6\u00f0i, hugrakkur\u201c. Visgoths komu me\u00f0 nafni\u00f0 til \u00cdber\u00eduskagans, \u00fear sem \u00fea\u00f0 gekk inn \u00ed konungsfj\u00f6lskyldur Sp\u00e1nar og Port\u00fagals. \u00dea\u00f0an var\u00f0 \u00fea\u00f0 algengt me\u00f0al Habsborgar konungsfj\u00f6lskyldu Heilaga r\u00f3mverska heimsveldisins og Austurr\u00edkis og byrja\u00f0i \u00e1 sp\u00e6nska f\u00e6ddum Ferdinand I \u00e1 16. \u00f6ld. Athyglisver\u00f0ur flutningsma\u00f0ur var port\u00fagalski landk\u00f6nnu\u00f0urinn Ferdinand Magellan (1480-1521), kalla\u00f0ur Fern\u00e3o de Magalh\u00e3es \u00e1 port\u00fag\u00f6lsku, sem var lei\u00f0togi fyrsta lei\u00f0angursins sem sigldi um j\u00f6r\u00f0ina.'), TRUE, STRINGDECODE('Ferd\u00ednand'));      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2750, STRINGDECODE('\u00cdslenskt nafn af \u00f3\u00feekktum uppruna og merkingu, fundi\u00f0 upp fyrir \u00e6vint\u00fdri Sagan af Fertram og \u00cds\u00f3l bj\u00f6rtu, sem \u00fe\u00fd\u00f0ir sem Sagan um Fertram og bjarta \u00cds\u00f3l \u00e1 ensku. Nafni\u00f0 er l\u00edklega undir \u00e1hrifum fr\u00e1 n\u00f6fnum BERTRAM og FERDINAND.'), TRUE, 'Fertram');        
