INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2766, STRINGDECODE('Merking \u00f3\u00feekkt. Hugsanlega tengt vi\u00f0 norr\u00e6nu fela \u201ea\u00f0 fela sig\u201c, norska fjela \u201etil a\u00f0 nj\u00f3sna\u201c e\u00f0a fornnorr\u00e6na fj\u01ebl \u201emiki\u00f0, margfaldt\u201c. \u00cd norr\u00e6nni go\u00f0afr\u00e6\u00f0i er \u00feetta nafn nokkurra risa, hana og dvergs. Dvergurinn Fjalarr, me\u00f0 hj\u00e1lp GALARR br\u00f3\u00f0ur s\u00edns, myrti KVASIR og brugga\u00f0i mj\u00f6\u00f0 skaldanna \u00far bl\u00f3\u00f0i hans.'), TRUE, 'Fjalarr');  
