INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2777, STRINGDECODE('R\u00f3mverskt \u00e6ttarnafn sem \u00fe\u00fd\u00f0ir \u201egulli\u00f0\u201c e\u00f0a \u201egult h\u00e1r\u201c fr\u00e1 lat\u00ednu flavus \u201egult, gyllt\u201c. Flavius \u200b\u200bvar \u00e6ttarnafn r\u00f3mversku keisaranna 1. aldar Vespasian, Titus og Domitian. \u00dea\u00f0 var nota\u00f0 sem pers\u00f3nulegt nafn af nokkrum seinna keisurum, einkum af Constantine.'), TRUE, STRINGDECODE('Fl\u00f3vent'));  
