INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2781, STRINGDECODE('Enskt form seint latneska nafnsins Franciscus sem \u00fe\u00fd\u00f0ir \u201eFrakki\u201c, a\u00f0 lokum fr\u00e1 germ\u00f6nsku \u00e6ttb\u00e1lki Frankanna, sem voru nefndir fyrir tegund spj\u00f3ts sem \u00feeir notu\u00f0u. \u00deetta nafn var bori\u00f0 af heil\u00f6gum Frans fr\u00e1 Assisi \u00e1 13. \u00f6ld, sem upphaflega var kalla\u00f0ur Giovanni en hlaut vi\u00f0urnefni\u00f0 Francesco af f\u00f6\u00f0ur s\u00ednum, a\u00f0d\u00e1anda Frakka. Francis h\u00e9lt \u00e1fram a\u00f0 afsala s\u00e9r au\u00f0i f\u00f6\u00f0ur s\u00edns og helga l\u00edf sitt f\u00e1t\u00e6kum og stofna\u00f0i franskiskanareglu friaranna. S\u00ed\u00f0ar \u00e1 \u00e6vinni f\u00e9kk hann greinilega stigmata. Vegna fr\u00e6g\u00f0ar d\u00fdr\u00f0arinnar var\u00f0 \u00feetta nafn \u00fatbreitt \u00ed Vestur-Evr\u00f3pu \u00e1 mi\u00f0\u00f6ldum. \u00dea\u00f0 var \u00fe\u00f3 ekki nota\u00f0 reglulega \u00ed Bretlandi fyrr en \u00e1 16. \u00f6ld. Me\u00f0al fr\u00e6gra handhafa eru Saint Francis Xavier (1506-1552), tr\u00fabo\u00f0i til Austur-As\u00edu, heimspekingur og v\u00edsindama\u00f0ur Francis Bacon (1561-1626) og landk\u00f6nnu\u00f0ur og a\u00f0m\u00edr\u00e1ll Sir Francis Drake (1540-1595). \u00cd enskum\u00e6landi heiminum \u00feetta nafn er stundum nota\u00f0 fyrir stelpur, sem afbrig\u00f0i af h\u00f3m\u00f3f\u00f3ninum Frances.'), TRUE, 'Francis');     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2782, STRINGDECODE('Fr\u00e1 germ\u00f6nsku nafni sem v\u00edsa\u00f0i til me\u00f0lims germanska \u00e6ttb\u00e1lksins, Frankanna. Frankar settust a\u00f0 \u00e1 \u00feeim sv\u00e6\u00f0um sem n\u00fa eru k\u00f6llu\u00f0 Frakkland og Holland \u00e1 3. og 4. \u00f6ld. \u00deeir fengu hugsanlega \u00e6ttarnafn sitt af nafni spj\u00f3tategundar sem \u00feeir notu\u00f0u. Fr\u00e1 mi\u00f0\u00f6ldum hafa \u00fdmsar ger\u00f0ir \u00feessa nafns almennt veri\u00f0 sameina\u00f0ar hinum \u00fdmsu ger\u00f0um Francis. \u00cd n\u00fat\u00edmanum er \u00fea\u00f0 stundum nota\u00f0 sem stutt mynd af Francis e\u00f0a Franklin.Nafni\u00f0 flutti nafni\u00f0 til Englands. Me\u00f0al athyglisver\u00f0ra handhafanna eru rith\u00f6fundurinn L. Frank Baum (1856-1919), arkitekt Frank Lloyd Wright (1867-1959) og s\u00f6ngvarinn Frank Sinatra (1915-1998).'), TRUE, 'Frank');  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2783, STRINGDECODE('Fr\u00e1 ensku eftirnafni sem var dregi\u00f0 af mi\u00f0-ensku frankelin \u201efreeman\u201c. Fr\u00e6gur handhafi eftirnafnsins var Benjamin Franklin (1706-1790), bandar\u00edskur stj\u00f3rnm\u00e1lama\u00f0ur, uppfinningama\u00f0ur, v\u00edsindama\u00f0ur og heimspekingur. Nafni\u00f0 hefur oft veri\u00f0 gefi\u00f0 honum til hei\u00f0urs \u00ed Bandar\u00edkjunum. \u00dea\u00f0 f\u00e9kk einnig upp\u00f6rvun \u00e1 kj\u00f6rt\u00edmabili forseta Bandar\u00edkjanna, Franklins D. Roosevelt (1882-1945).'), TRUE, 'Franklin');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2784, STRINGDECODE('Fr\u00e1 ensku eftirnafni sem var dregi\u00f0 af mi\u00f0-ensku frankelin \u201efreeman\u201c. Fr\u00e6gur handhafi eftirnafnsins var Benjamin Franklin (1706-1790), bandar\u00edskur stj\u00f3rnm\u00e1lama\u00f0ur, uppfinningama\u00f0ur, v\u00edsindama\u00f0ur og heimspekingur. Nafni\u00f0 hefur oft veri\u00f0 gefi\u00f0 honum til hei\u00f0urs \u00ed Bandar\u00edkjunum. \u00dea\u00f0 f\u00e9kk einnig upp\u00f6rvun \u00e1 kj\u00f6rt\u00edmabili forseta Bandar\u00edkjanna, Franklins D. Roosevelt (1882-1945).'), TRUE, STRINGDECODE('Frankl\u00edn'));           
