INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2786, STRINGDECODE('\u00de\u00fdska mynd Franciscus (sj\u00e1 FRANCIS). \u00deetta nafn bar hinn \u00e1hrifamikli rith\u00f6fundur Franz Kafka (1883-1924), h\u00f6fundur R\u00e9ttarhalda og Kastalans me\u00f0al annarra verka. \u00dea\u00f0 var l\u00edka nafn r\u00e1\u00f0amanna \u00ed Austurr\u00edki og Heilaga r\u00f3mverska heimsveldinu.'), TRUE, 'Franz');              
