INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2795, STRINGDECODE('\u00de\u00fd\u00f0ir \u201eherra\u201c \u00e1 fornorr\u00e6nu. \u00deetta var nafn norr\u00e6ns gu\u00f0s. Hann kann a\u00f0 hafa veri\u00f0 upphaflega kalla\u00f0ur Yngvi en nafni\u00f0 Freyr er titill hans. Freyr stj\u00f3rna\u00f0i frj\u00f3semi, s\u00f3larlj\u00f3si og rigningu og var eiginma\u00f0ur frostrisans Gerd. Me\u00f0 tv\u00edburasystur sinni Freya og f\u00f6\u00f0ur Njord var hann einn af \u00feeim gu\u00f0um sem kallast Vanir.'), TRUE, 'Freyr');  
