INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2829, STRINGDECODE('Fr\u00e1 hebreska heitinu \u05d2\u05b7\u05d1\u05b0\u05e8\u05b4\u05d9\u05d0\u05b5\u05dc (Gavri`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0 er minn sterki ma\u00f0ur\u201c, dreginn af \u05d2\u05b6\u05d1\u05b6\u05e8 (gever) sem \u00fe\u00fd\u00f0ir \u201csterkur ma\u00f0ur, hetja\u201c og \u05d0\u05b5\u05dc (`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0\u201c. Gabriel er erkiengill a\u00f0 hef\u00f0 hebresku og birtist oft sem sendibo\u00f0i Gu\u00f0s. \u00cd Gamla testamentinu er hann sendur til a\u00f0 t\u00falka s\u00fdnir Dan\u00edels sp\u00e1manns, en \u00ed N\u00fdja testamentinu er hann bo\u00f0beri f\u00e6\u00f0inga J\u00f3hannesar til Sakar\u00eda og Jes\u00fa fyrir Mar\u00edu. Samkv\u00e6mt \u00edsl\u00f6mskum si\u00f0 var hann engillinn sem fyrirskipa\u00f0i M\u00fahame\u00f0 K\u00f3raninn. \u00deetta nafn hefur veri\u00f0 nota\u00f0 stundum \u00e1 Englandi s\u00ed\u00f0an \u00e1 12. \u00f6ld. \u00dea\u00f0 var ekki algengt \u00ed enskum\u00e6landi heimi fyrr en \u00ed lok 20. aldar.'), TRUE, 'Gabriel');
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2830, STRINGDECODE('Fr\u00e1 hebreska heitinu \u05d2\u05b7\u05d1\u05b0\u05e8\u05b4\u05d9\u05d0\u05b5\u05dc (Gavri`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0 er minn sterki ma\u00f0ur\u201c, dreginn af \u05d2\u05b6\u05d1\u05b6\u05e8 (gever) sem \u00fe\u00fd\u00f0ir \u201csterkur ma\u00f0ur, hetja\u201c og \u05d0\u05b5\u05dc (`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0\u201c. Gabriel er erkiengill a\u00f0 hef\u00f0 hebresku og birtist oft sem sendibo\u00f0i Gu\u00f0s. \u00cd Gamla testamentinu er hann sendur til a\u00f0 t\u00falka s\u00fdnir Dan\u00edels sp\u00e1manns, en \u00ed N\u00fdja testamentinu er hann bo\u00f0beri f\u00e6\u00f0inga J\u00f3hannesar til Sakar\u00eda og Jes\u00fa fyrir Mar\u00edu. Samkv\u00e6mt \u00edsl\u00f6mskum si\u00f0 var hann engillinn sem fyrirskipa\u00f0i M\u00fahame\u00f0 K\u00f3raninn. \u00deetta nafn hefur veri\u00f0 nota\u00f0 stundum \u00e1 Englandi s\u00ed\u00f0an \u00e1 12. \u00f6ld. \u00dea\u00f0 var ekki algengt \u00ed enskum\u00e6landi heimi fyrr en \u00ed lok 20. aldar.'), TRUE, STRINGDECODE('Gabr\u00edel'));             
