INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2840, STRINGDECODE('Hugsanlega fr\u00e1 germ\u00f6nsku nafni dregi\u00f0 af frumefninu gast sem \u00fe\u00fd\u00f0ir \u201e\u00f3kunnugur, gestur\u201c. \u00deetta er venjulega franska nafni\u00f0 \u00e1 Saint Vedastus, kalla\u00f0 Vaast \u00e1 Fl\u00e6mska, og a\u00f0 \u00f6\u00f0rum kosti getur nafni\u00f0 veri\u00f0 tengt \u00fev\u00ed. Nafni\u00f0 var einnig bori\u00f0 af nokkrum talningum Foix-B\u00e9arn, sem h\u00f3fst \u00e1 13. \u00f6ld.'), TRUE, 'Gaston'); 
