INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2867, STRINGDECODE('Fr\u00e1 gr\u00edska heitinu \u0393\u03b5\u03ce\u03c1\u03b3\u03b9\u03bf\u03c2 (Georgios), sem var dregi\u00f0 af gr\u00edska or\u00f0inu \u03b3\u03b5\u03c9\u03c1\u03b3\u03cc\u03c2 (georgos) sem \u00fe\u00fd\u00f0ir \u201eb\u00f3ndi, jar\u00f0vinnuma\u00f0ur\u201c, sj\u00e1lft dregi\u00f0 af frumefnunum \u03b3\u1fc6 (ge) sem \u00fe\u00fd\u00f0ir \u201ej\u00f6r\u00f0\u201c og \u1f14\u03c1\u03b3\u03bf\u03bd (ergon) sem \u00fe\u00fd\u00f0ir \u201evinna\u201c. Saint George var r\u00f3mverskur herma\u00f0ur fr\u00e1 3. \u00f6ld fr\u00e1 Palest\u00ednu sem var p\u00edslarv\u00e6ttur \u00ed ofs\u00f3knum Diocletianusar keisara. S\u00ed\u00f0ari \u00fej\u00f3\u00f0s\u00f6gur l\u00fdsa \u00f3sigri hans \u00e1 drekanum, sem hann var oft s\u00fdndur me\u00f0 \u00ed mi\u00f0alda list. Upphaflega var Saint George fyrst og fremst d\u00e1\u00f0ur af austur kristnum m\u00f6nnum, en aftur krossfarar komu s\u00f6gum af honum til Vestur-Evr\u00f3pu og hann var\u00f0 verndari Englands, Port\u00fagals, Katal\u00f3n\u00edu. og Aragon. Nafni\u00f0 var sjaldan nota\u00f0 \u00e1 Englandi fyrr en \u00dej\u00f3\u00f0verjinn George I kom til breska h\u00e1s\u00e6tisins \u00e1 18. \u00f6ld. Fimm breskir konungar \u00ed kj\u00f6lfari\u00f0 hafa bori\u00f0 nafni\u00f0. A\u00f0rir fr\u00e6gir handhafar eru tveir konungar Grikklands, t\u00f3nsk\u00e1ldi\u00f0 George Frideric Handel (1685-1759), fyrsti forseti Bandar\u00edkjanna, George Washington (1732-1797) og Kyrrahafsk\u00f6nnu\u00f0urinn George Vancouver (1757-1798). \u00deetta var einnig pennafn h\u00f6funda George Eliot (1819-1880) og George Orwell (1903-1950), r\u00e9ttu n\u00f6fnin Mary Anne Evans og Eric Arthur Blair \u00ed s\u00f6mu r\u00f6\u00f0.'), TRUE, 'George');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2868, STRINGDECODE('Fr\u00e1 germ\u00f6nsku nafni sem \u00fe\u00fd\u00f0ir \u201cregla spj\u00f3tsins\u201c, fr\u00e1 frumefnunum ger sem \u00fe\u00fd\u00f0ir \u201cspj\u00f3t\u201c og wald \u00fe\u00fd\u00f0ir \u201cregla\u201c. Normannar komu \u00feessu nafni til Bretlands. \u00der\u00e1tt fyrir a\u00f0 \u00fea\u00f0 d\u00f3 \u00fat \u00e1 Englandi \u00e1 mi\u00f0\u00f6ldum h\u00e9lst \u00fea\u00f0 algengt \u00e1 \u00cdrlandi. \u00dea\u00f0 var endurvaki\u00f0 \u00ed enskum\u00e6landi heimi \u00e1 19. \u00f6ld.'), TRUE, 'Gerald');            
