INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2993, STRINGDECODE('Merkir \u201en\u00e1\u00f0 Baals\u201c fr\u00e1 F\u00f6nis\u00edska hann \u201en\u00e1\u00f0\u201c \u00e1samt nafni gu\u00f0sins BA`AL. Hannibal var Carthaginian hersh\u00f6f\u00f0ingi sem \u00f3gna\u00f0i R\u00f3m \u00ed seinna p\u00fanverska str\u00ed\u00f0inu \u00e1 3. \u00f6ld f.Kr.'), TRUE, 'Hannibal');             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2994, STRINGDECODE('\u00de\u00fdska stuttmynd af JOHANNES, n\u00fa nota\u00f0 sj\u00e1lfst\u00e6tt. \u00deetta nafn hefur veri\u00f0 mj\u00f6g algengt \u00e1 \u00fe\u00fdskum\u00e6landi sv\u00e6\u00f0um \u00ed Evr\u00f3pu s\u00ed\u00f0an seint \u00e1 mi\u00f0\u00f6ldum. Fr\u00e1 \u00fev\u00ed snemma var \u00fea\u00f0 sent til l\u00e1glandanna og Skandinav\u00edu. Tveir fr\u00e6gir bur\u00f0arberar voru Hans Holbein (1497-1543), \u00fe\u00fdskur portrettm\u00e1lari, og Hans Christian Andersen (1805-1875), danskur \u00e6vint\u00fdrah\u00f6fundur.'), TRUE, 'Hans');              
