INSERT INTO "PUBLIC"."NAME_CARD" VALUES(2998, STRINGDECODE('HENRY \u00e1 ensku formi mi\u00f0alda. \u00cd n\u00fat\u00edmanum er \u00fea\u00f0 nota\u00f0 sem afbrig\u00f0i b\u00e6\u00f0i af Henry og HAROLD. Fr\u00e6gur flutningsma\u00f0ur var Harry S. Truman forseti Bandar\u00edkjanna (1884-1972). \u00dea\u00f0 er l\u00edka nafn galdrakarlsins \u00ed Harry Potter b\u00f3kaflokki J. K. Rowling sem kom fyrst \u00fat \u00e1ri\u00f0 1997.'), TRUE, 'Harry');     
