INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3018, STRINGDECODE('Latinized form af gr\u00edsku \u1f1d\u03ba\u03c4\u03c9\u03c1 (Hektor), sem var dregi\u00f0 af \u1f15\u03ba\u03c4\u03c9\u03c1 (hektor) sem \u00fe\u00fd\u00f0ir \u201ca\u00f0 halda fast\u201c, a\u00f0 lokum fr\u00e1 \u1f14\u03c7\u03c9 (echo) sem \u00fe\u00fd\u00f0ir \u201ca\u00f0 halda, a\u00f0 eiga\u201c. \u00cd gr\u00edsku go\u00f0s\u00f6gninni var Hector einn af tr\u00f3jumeisturunum sem b\u00f6r\u00f0ust gegn Grikkjum. Eftir a\u00f0 hann drap Patroclus vin Achilles, var hann sj\u00e1lfur drepinn grimmilega af Achilles, sem h\u00e9lt \u00e1fram a\u00f0 binda l\u00edk hans vi\u00f0 vagn og draga \u00fea\u00f0 um. \u00deetta nafn birtist einnig \u00ed \u00fej\u00f3\u00f0s\u00f6gum Arthur \u00fear sem \u00fea\u00f0 tilheyrir f\u00f3sturf\u00f6\u00f0ur Arthur. Hector hefur stundum veri\u00f0 nota\u00f0 sem eiginnafn fr\u00e1 mi\u00f0\u00f6ldum, l\u00edklega vegna g\u00f6fugrar e\u00f0li klass\u00edskrar hetju. \u00dea\u00f0 hefur veri\u00f0 s\u00f6gulega algengt \u00ed Skotlandi, \u00fear sem \u00fea\u00f0 var nota\u00f0 sem anglicized mynd af Eachann.'), TRUE, 'Hector');     
