INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3041, STRINGDECODE('HENRY form \u00e1 nokkrum tungum\u00e1lum. Fr\u00e6gur flutningsma\u00f0ur var norski leiksk\u00e1ldi\u00f0 Henrik Ibsen (1828-1906).'), TRUE, 'Henrik');         
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3042, STRINGDECODE('Fr\u00e1 \u00fe\u00fdska heitinu Heimirich sem \u00fe\u00fd\u00f0ir \u201eheimastj\u00f3rnandi\u201c, samsettur \u00far frumefnunum heim \u201eheim\u201c og ric \u201eh\u00f6f\u00f0ingi\u201c. \u00dea\u00f0 var s\u00ed\u00f0ar almennt stafsett Heinrich, me\u00f0 stafsetningu breytt vegna \u00e1hrifa annarra germanskra nafna eins og Haganrich, \u00fear sem fyrsti \u00fe\u00e1tturinn er hagan \u201egir\u00f0ing\u201c. Heinrich var vins\u00e6ll me\u00f0al meginlandsh\u00f6funda, enda nafn sj\u00f6 \u00fe\u00fdskra konunga og byrja\u00f0i \u00e1 10. aldar Hinrik 1. fugli, og fj\u00f3rir franskir \u200b\u200bkonungar. \u00cd Frakklandi var \u00fea\u00f0 venjulega gert Henri af latnesku formi Henricus. Normannar kynntu fr\u00f6nsku formi\u00f0 fyrir Englandi og \u00fea\u00f0 var s\u00ed\u00f0an nota\u00f0 af \u00e1tta konungum og enda\u00f0i me\u00f0 hinum alr\u00e6mda Henry VIII \u00e1 16. \u00f6ld. \u00c1 s\u00ed\u00f0ari mi\u00f0\u00f6ldum var \u00fea\u00f0 nokku\u00f0 vins\u00e6lt og var almennt gert sem Harry e\u00f0a Herry \u00ed enskum frambur\u00f0i. Me\u00f0al athyglisver\u00f0ra handhafanna eru me\u00f0al annars nor\u00f0urskautssiglingurinn Henry Hudson (1570-1611), breski sk\u00e1ldsagnah\u00f6fundurinn Henry James (1843-1916), bandar\u00edski b\u00edlaframlei\u00f0andinn Henry Ford (1863-1947) og bandar\u00edski leikarinn Henry Fonda (1905-1982).'), TRUE, 'Henry');
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3043, STRINGDECODE('Fr\u00e1 \u00fe\u00fdska heitinu Heimirich sem \u00fe\u00fd\u00f0ir \u201eheimastj\u00f3rnandi\u201c, samsettur \u00far frumefnunum heim \u201eheim\u201c og ric \u201eh\u00f6f\u00f0ingi\u201c. \u00dea\u00f0 var s\u00ed\u00f0ar almennt stafsett Heinrich, me\u00f0 stafsetningu breytt vegna \u00e1hrifa annarra germanskra nafna eins og Haganrich, \u00fear sem fyrsti \u00fe\u00e1tturinn er hagan \u201egir\u00f0ing\u201c. Heinrich var vins\u00e6ll me\u00f0al meginlandsh\u00f6funda, enda nafn sj\u00f6 \u00fe\u00fdskra konunga og byrja\u00f0i \u00e1 10. aldar Hinrik 1. fugli, og fj\u00f3rir franskir \u200b\u200bkonungar. \u00cd Frakklandi var \u00fea\u00f0 venjulega gert Henri af latnesku formi Henricus. Normannar kynntu fr\u00f6nsku formi\u00f0 fyrir Englandi og \u00fea\u00f0 var s\u00ed\u00f0an nota\u00f0 af \u00e1tta konungum og enda\u00f0i me\u00f0 hinum alr\u00e6mda Henry VIII \u00e1 16. \u00f6ld. \u00c1 s\u00ed\u00f0ari mi\u00f0\u00f6ldum var \u00fea\u00f0 nokku\u00f0 vins\u00e6lt og var almennt gert sem Harry e\u00f0a Herry \u00ed enskum frambur\u00f0i. Me\u00f0al athyglisver\u00f0ra handhafanna eru me\u00f0al annars nor\u00f0urskautssiglingurinn Henry Hudson (1570-1611), breski sk\u00e1ldsagnah\u00f6fundurinn Henry James (1843-1916), bandar\u00edski b\u00edlaframlei\u00f0andinn Henry Ford (1863-1947) og bandar\u00edski leikarinn Henry Fonda (1905-1982).'), TRUE, STRINGDECODE('Henr\u00fd'));             
