INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3081, STRINGDECODE('L\u00edklega af f\u00f6n\u00edskum uppruna, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 g\u00e6ti veri\u00f0 \u00far hebresku sem \u00fe\u00fd\u00f0ir \u201eupphafinn br\u00f3\u00f0ir\u201c. \u00deetta var nafn konungs \u00ed T\u00fdrus \u00ed Gamla testamentinu. Sem ensku eiginnafn kom Hiram \u00ed notkun eftir si\u00f0askipti m\u00f3tm\u00e6lenda. \u00c1 17. \u00f6ld komu Puritanar me\u00f0 \u00fea\u00f0 til Amer\u00edku \u00fear sem \u00feeir fengu einhvern gjaldeyri.'), TRUE, STRINGDECODE('H\u00edram'));          
