INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3124, STRINGDECODE('Fr\u00e1 hebreska nafninu \u05d4\u05d5\u05b9\u05e9\u05b5\u05c1\u05e2\u05b7 (Hoshe`a) sem \u00fe\u00fd\u00f0ir \u201chj\u00e1lpr\u00e6\u00f0i\u201c, fr\u00e1 r\u00f3tinni \u05d9\u05b8\u05e9\u05b7\u05c1\u05e2 (yasha `). \u00cd Gamla testamentinu \u00ed 4. M\u00f3seb\u00f3k 13:16 gefur M\u00f3se nj\u00f3snaranum H\u00f3sea n\u00fdja nafni\u00f0 Yehoshu`a (sj\u00e1 JOSHUA), sem hefur skyldan uppruna. \u00deetta nafn var einnig bori\u00f0 af 8. \u00f6ld f.Kr., konungi \u00cdsraels, sem var s\u00ed\u00f0asti h\u00f6f\u00f0ingi \u00feess r\u00edkis \u00e1\u00f0ur en Ass\u00fdr\u00eda lag\u00f0i \u00fea\u00f0 undir sig.'), TRUE, STRINGDECODE('H\u00f3seas'));
