INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3162, STRINGDECODE('Fr\u00e1 ensku eftirnafni sem var dregi\u00f0 af nafni b\u00e6jar \u00ed Cheshire. Loka\u00fe\u00e1tturinn er fornenska enska \u201csk\u00f3glendi, hreinsa\u201c, en fyrsti \u00fe\u00e1tturinn g\u00e6ti veri\u00f0 hux \u201cm\u00f3\u00f0gun, h\u00e1\u00f0ung\u201c. Fr\u00e6gur handhafi eftirnafnsins var breski rith\u00f6fundurinn Aldous Huxley (1894-1963).'), TRUE, 'Huxley');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3163, STRINGDECODE('Merkir \u201ebjart hjarta\u201c, dregi\u00f0 af germ\u00f6nskum \u00fe\u00e1ttum fa\u00f0ma \u201ehjarta, huga\u201c og beraht \u201ebjart\u201c. Saint Hubert var 8. aldar biskup \u00ed Maastricht sem er talinn verndard\u00fdrlingur vei\u00f0imanna. Normannar komu me\u00f0 nafni\u00f0 til Englands, \u00fear sem \u00fea\u00f0 leysti af h\u00f3lmi gamla enska samb\u00e6rilega Hygebeorht. \u00dea\u00f0 d\u00f3 \u00fat \u00e1 mi\u00f0\u00f6ldum en var endurvaki\u00f0 \u00e1 19. \u00f6ld [2].'), TRUE, STRINGDECODE('H\u00fabert'));               
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3164, STRINGDECODE('Latinized form af HUGH. Sem eftirnafn hefur \u00fea\u00f0 tilheyrt franska rith\u00f6fundinum Victor Hugo (1802-1885), rith\u00f6fundi hn\u00fafubaksins \u00ed Notre Dame og Les Mis\u00e9rables.'), TRUE, STRINGDECODE('H\u00fag\u00f3'));      
