INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3210, STRINGDECODE('R\u00fassneska mynd Yngvarr (sj\u00e1 INGVAR). Varang\u00edumenn komu me\u00f0 \u00fea\u00f0 til R\u00fasslands \u00e1 10. \u00f6ld. \u00dea\u00f0 var bori\u00f0 af tveimur st\u00f3rh\u00f6f\u00f0ingjum \u00ed K\u00e6nugar\u00f0i. Me\u00f0al fr\u00e6gra bur\u00f0arbera eru Igor Stravinsky (1882-1971), r\u00fassneskt t\u00f3nsk\u00e1ld sem hefur fr\u00e6gasta verki\u00f0 The Rite of Spring, og Igor Sikorsky (1889-1972), r\u00fassneska-amer\u00edska h\u00f6nnu\u00f0inn af fyrstu vel heppnu\u00f0u \u00feyrlunni.'), TRUE, STRINGDECODE('\u00cdgor'));           
