INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3221, STRINGDECODE('Fyrsti \u00fe\u00e1tturinn er fenginn af \u201e\u00eds\u201c, en \u00fea\u00f0 g\u00e6ti l\u00edka veri\u00f0 stutt form af isan (sj\u00e1 ISANMAR). Seinni \u00fe\u00e1tturinn er fenginn \u00far fornh\u00e1\u00fe\u00fdsku m\u00e2ri \u201efr\u00e6gu\u201c.'), TRUE, STRINGDECODE('\u00cdsmar'));             
