INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3223, STRINGDECODE('Fr\u00e1 hebreska heitinu \u05d9\u05b4\u05e9\u05b0\u05c2\u05e8\u05b8\u05d0\u05b5\u05dc (Yisra`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0 keppir\u201c, fr\u00e1 r\u00f3tunum \u05e9\u05b8\u05c2\u05e8\u05b8\u05d4 (sarah) sem \u00fe\u00fd\u00f0ir \u201ca\u00f0 berjast, berjast\u201c og \u05d0\u05b5\u05dc (`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0\u201c. \u00cd Gamla testamentinu gl\u00edmir \u00cdsrael (sem \u00e1\u00f0ur h\u00e9t Jakob; sj\u00e1 1. M\u00f3seb\u00f3k 32:28) vi\u00f0 engil. Forn og n\u00fat\u00edmar\u00edki \u00cdsraels t\u00f3ku n\u00f6fn s\u00edn af honum.'), TRUE, STRINGDECODE('\u00cdsrael'));       
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3224, STRINGDECODE('N\u00fdrri mynd af gamla slavneska nafninu \u0406\u0461\u0430\u043d\u043d\u044a (Ioannu), sem var dregi\u00f0 af gr\u00edsku Ioannes (sj\u00e1 JOHN). \u00deetta var nafn sex r\u00fassneskra h\u00f6f\u00f0ingja, \u00fear \u00e1 me\u00f0al 15. aldar \u00cdvan III hinn mikli og 16. \u00f6ld \u00cdvan IV hinn hr\u00e6\u00f0ilegi, fyrsti tsari R\u00fasslands. \u00dea\u00f0 var einnig bori\u00f0 af n\u00edu keisurum \u00ed B\u00falgar\u00edu. A\u00f0rir athyglisver\u00f0ir handhafar eru r\u00fassneski rith\u00f6fundurinn Ivan Turgenev (1818-1883), sem skrifa\u00f0i fe\u00f0ur og synir, og r\u00fassneski l\u00edfe\u00f0lisfr\u00e6\u00f0ingurinn Ivan Pavlov (1849-1936), sem er \u00feekktastur fyrir uppg\u00f6tvun s\u00edna \u00e1 skilyrta vi\u00f0brag\u00f0inu.'), TRUE, STRINGDECODE('\u00cdvan'));  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3225, STRINGDECODE('anna\u00f0 hvort \u00fdvi\u00f0ur, vi\u00f0arheiti, og -ar: herma\u00f0ur, \u00fe. e. herma\u00f0ur vopna\u00f0ur \u00fdvi\u00f0arboga, e\u00f0a dregi\u00f0 af \u00cdvi: s\u00e6konungur og -ar.'), TRUE, STRINGDECODE('\u00cdvar'));            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3226, STRINGDECODE('Komi\u00f0 fr\u00e1 Jackin (fyrr Jankin), mi\u00f0lungs minnkandi JOHN. \u00dea\u00f0 er oft liti\u00f0 \u00e1 sem sj\u00e1lfst\u00e6tt nafn. \u00c1 mi\u00f0\u00f6ldum var \u00fea\u00f0 mj\u00f6g algengt og \u00fea\u00f0 var\u00f0 slangur sem \u00fe\u00fd\u00f0ir \u201ema\u00f0ur\u201c. \u00dea\u00f0 var oft nota\u00f0 \u00ed \u00e6vint\u00fdrum og leiksk\u00f3lar\u00edmum, svo sem Jack and the Beanstalk, Little Jack Horner og Jack Sprat. Amer\u00edkuh\u00f6fundarnir Jack London (1876-1916) og Jack Kerouac (1922-1969) voru tveir fr\u00e6gir handhafar \u00feessa nafns. . \u00dea\u00f0 er einnig bori\u00f0 af leikaranum Jack Nicholson (1937-) og kylfingnum Jack Nicklaus (1940-). Burts\u00e9\u00f0 fr\u00e1 Nicklaus f\u00e9kk enginn \u00feessara fr\u00e6gu bur\u00f0armanna nafni\u00f0 Jack vi\u00f0 f\u00e6\u00f0ingu. \u00cd Bretlandi hefur \u00feetta form veri\u00f0 gefi\u00f0 oftar en John s\u00ed\u00f0an \u00e1 t\u00edunda \u00e1ratugnum, en \u00fea\u00f0 var vins\u00e6lasta nafni\u00f0 fyrir str\u00e1ka fr\u00e1 1996 til 2008.'), TRUE, 'Jack');               
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3227, STRINGDECODE('\u00far hebresku og merkir fagur. Einn sonur N\u00f3a h\u00e9t Jafet.'), TRUE, 'Jafet');          
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3228, STRINGDECODE('Fr\u00e1 venjulega enska atvinnu eftirnafninu sem \u00fe\u00fd\u00f0ir \u201ccarter, peddler\u201c. Fr\u00e1 mi\u00f0-ensku jag \u00fe\u00fd\u00f0ir `pakki, hla\u00f0a`. H\u00e6kkun \u00e1 vins\u00e6ldum nafnsins er l\u00edklega vegna vins\u00e6lda enska rokkstj\u00f6rnunnar Mick Jagger, a\u00f0als\u00f6ngvara og stofnf\u00e9laga hinnar go\u00f0sagnakenndu rokk- og r\u00f3lsveitar Rolling Stones.'), TRUE, 'Jagger');               
