INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3231, 'MISSING', TRUE, 'Jakop');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3232, STRINGDECODE('Ensk mynd af s\u00ed\u00f0 latneska heitinu Iacomus, afbrig\u00f0i af bibl\u00edulegu lat\u00ednuforminu Iacobus, fr\u00e1 hebreska nafninu Ya`aqov (sj\u00e1 JACOB). \u00deetta var nafn tveggja postula \u00ed N\u00fdja testamentinu. S\u00e1 fyrsti var heilagur Jakob hinn meiri, br\u00f3\u00f0ir J\u00f3hannesar postula, sem var h\u00e1lsh\u00f6ggvinn undir Her\u00f3des Agrippa \u00ed Postulas\u00f6gunni. \u00d6nnur var Jakob sm\u00e6rri, sonur Alfaeus. Annar Jakob (\u00feekktur sem Jakob hinn r\u00e9ttl\u00e1ti) er einnig nefndur \u00ed Bibl\u00edunni sem br\u00f3\u00f0ir Jes\u00fa. \u00deetta nafn hefur veri\u00f0 nota\u00f0 \u00e1 Englandi s\u00ed\u00f0an \u00e1 13. \u00f6ld, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 hafi or\u00f0i\u00f0 algengara \u00ed Skotlandi \u00fear sem \u00fea\u00f0 var bori\u00f0 af nokkrum konungum. \u00c1 17. \u00f6ld erf\u00f0i skoski konungurinn James VI enska h\u00e1s\u00e6ti\u00f0 og var\u00f0 fyrsti h\u00f6f\u00f0ingi alls Bretlands og nafni\u00f0 var\u00f0 mun vins\u00e6lli. \u00cd bandar\u00edskum t\u00f6lfr\u00e6\u00f0ilegum nafng\u00f6gnum (skr\u00e1\u00f0 s\u00ed\u00f0an 1880) hefur \u00feetta nafn aldrei veri\u00f0 \u00far topp 20, sem gerir \u00fea\u00f0 a\u00f0 \u00f6llum l\u00edkindum vins\u00e6lasta nafn t\u00edmabilsins. \u00dea\u00f0 var efsta s\u00e6ti\u00f0 fyrir str\u00e1ka \u00ed Bandar\u00edkjunum fr\u00e1 1940 til 1952. Me\u00f0al \u00feekktra handhafa eru enski landk\u00f6nnu\u00f0urinn Captain James Cook (1728-1779), skoski uppfinningama\u00f0urinn James Watt (1736-1819) og \u00edrski sk\u00e1ldsagnah\u00f6fundurinn og sk\u00e1ldi\u00f0 James Joyce (1882-1941). \u00deetta nafn hefur einnig veri\u00f0 bori\u00f0 af sex bandar\u00edskum forsetum. \u00c1berandi sk\u00e1ldskaparma\u00f0ur er breski nj\u00f3snarinn James Bond, b\u00fainn til af rith\u00f6fundinum Ian Fleming.'), TRUE, 'James');       
