INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3240, STRINGDECODE('\u00dar lat\u00ednu Gaspar, kannski \u00far bibl\u00edu hebreska or\u00f0inu \u05d2\u05b4\u05bc\u05d6\u05b0\u05d1\u05b8\u05bc\u05e8 (gizbar) sem \u00fe\u00fd\u00f0ir \u201cgjaldkeri\u201c, dregi\u00f0 af persnesku ganzabara. \u00deessu nafni var jafnan \u00fathluta\u00f0 einum vitringanna (einnig \u00feekktir sem Magi, e\u00f0a \u00fer\u00edr konungar) sem sag\u00f0ir voru hafa heims\u00f3tt n\u00fdf\u00e6ddan Jes\u00fa. Stundum hefur \u00fea\u00f0 veri\u00f0 nota\u00f0 \u00ed enskum\u00e6landi heimi fr\u00e1 mi\u00f0\u00f6ldum. Nafni\u00f0 er einnig h\u00e6gt a\u00f0 gefa me\u00f0 v\u00edsan til enska or\u00f0sins fyrir gemstone.'), TRUE, 'Jasper');
