INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3253, STRINGDECODE('Enska mynd af Iohannes, latneska formi\u00f0 af gr\u00edska nafninu \u1f38\u03c9\u03ac\u03bd\u03bd\u03b7\u03c2 (Ioannes), sj\u00e1lft dregi\u00f0 af hebreska heitinu \u05d9\u05d5\u05b9\u05d7\u05b8\u05e0\u05b8\u05df (Yochanan) sem \u00fe\u00fd\u00f0ir \u201cYAHWEH er n\u00e1\u00f0ugur\u201c, af r\u00f3tunum \u05d9\u05d5\u05b9 (yo) sem v\u00edsar til hebreska gu\u00f0sins og \u05d7\u05e0\u05e0 (Chanan) ) sem \u00fe\u00fd\u00f0ir \u201ea\u00f0 vera n\u00e1\u00f0ugur\u201c. Hebreska formi\u00f0 kemur fyrir \u00ed Gamla testamentinu (stafsett Johanan e\u00f0a Jehohanan \u00ed ensku \u00fatg\u00e1funni), en \u00feetta nafn \u00e1 vins\u00e6ldir s\u00ednar a\u00f0 rekja til tveggja pers\u00f3na \u00ed N\u00fdja testamentinu, b\u00e1\u00f0ir mj\u00f6g d\u00fdrka\u00f0ir d\u00fdrlingar. S\u00e1 fyrsti er J\u00f3hannes sk\u00edrari, as\u00edskur gy\u00f0ingur sem er talinn forveri Jes\u00fa. Hann sk\u00edr\u00f0i Jes\u00fa og var s\u00ed\u00f0ar tekinn af l\u00edfi af Her\u00f3des Ant\u00edpas. Anna\u00f0 er J\u00f3hannes postuli, sem jafnan er talinn h\u00f6fundur fj\u00f3r\u00f0a gu\u00f0spjallsins og Opinberunarb\u00f3karinnar. Me\u00f0 postulunum P\u00e9tri og Jakobi (br\u00f3\u00f0ir hans) var hann hluti af innsta hring Jes\u00fa. \u00deetta nafn var upphaflega algengara me\u00f0al kristinna manna \u00ed Austurr\u00edki \u00ed B\u00fdsansveldinu, en \u00fea\u00f0 bl\u00f3mstra\u00f0i \u00ed Vestur-Evr\u00f3pu eftir fyrstu krossfer\u00f0ina. \u00c1 Englandi var\u00f0 \u00fea\u00f0 \u00e1kaflega vins\u00e6lt, venjulega algengasta karlmannsnafni\u00f0 fr\u00e1 13. til 20. aldar (en stundum umfram William). \u00c1 s\u00ed\u00f0ari mi\u00f0\u00f6ldum var \u00fea\u00f0 gefinn u.\u00fe.b. fimmtungur allra enskra drengja. \u00cd Bandar\u00edkjunum var \u00fea\u00f0 algengasta nafni\u00f0 fyrir str\u00e1ka til 1923. Nafni\u00f0 (\u00ed \u00fdmsum stafsetningum) hefur veri\u00f0 bori\u00f0 af 21 p\u00e1fa og \u00e1tta byzant\u00edskum keisurum auk r\u00e1\u00f0amanna \u00ed Englandi, Frakklandi, Sv\u00ed\u00fej\u00f3\u00f0, Danm\u00f6rku, P\u00f3llandi, Port\u00fagal, B\u00falgar\u00edu, R\u00fasslandi og Ungverjalandi. \u00dea\u00f0 bar einnig sk\u00e1ldi\u00f0 John Milton (1608-1674), heimspekingurinn John Locke (1632-1704), bandar\u00edskur stofnfa\u00f0ir og forseti John Adams (1735-1826) og sk\u00e1ldi\u00f0 John Keats (1795-1821). Fr\u00e6gir flutningsmenn 20. aldar eru me\u00f0al annars rith\u00f6fundurinn John Steinbeck (1902-1968), Bandar\u00edkjaforseti John F. Kennedy (1917-1963) og t\u00f3nlistarma\u00f0urinn John Lennon (1940-1980). Formin Ian (skosk), Sean (\u00edrsk) og Evan (velska) hafa einnig veri\u00f0 oft nota\u00f0ar \u00ed enskum\u00e6landi heimi, sem og sm\u00e6rri mi\u00f0alda fr\u00e1 Jack.'), TRUE, 'John');   
