INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3256, STRINGDECODE('Fr\u00e1 hebreska heitinu \u05d9\u05b0\u05d4\u05d5\u05b9\u05e9\u05bb\u05c1\u05e2\u05b7 (Yehoshu`a) sem \u00fe\u00fd\u00f0ir \u201cYAHWEH er hj\u00e1lpr\u00e6\u00f0i\u201c, fr\u00e1 r\u00f3tunum \u05d9\u05b0\u05d4\u05d5\u05b9 (yeho) sem v\u00edsar til hebreska Gu\u00f0s og \u05d9\u05b8\u05e9\u05b7\u05c1\u05e2 (yasha `) sem \u00fe\u00fd\u00f0ir \u201ca\u00f0 frelsa\u201c. Eins og sagt er fr\u00e1 \u00ed Gamla testamentinu var Joshua f\u00e9lagi M\u00f3se. Hann f\u00f3r upp \u00e1 S\u00edna\u00edfjall me\u00f0 M\u00f3se \u00feegar hann f\u00e9kk bo\u00f0or\u00f0in t\u00edu fr\u00e1 Gu\u00f0i og s\u00ed\u00f0ar var hann einn af t\u00f3lf nj\u00f3snurum sendur til Kanaan. Eftir a\u00f0 M\u00f3se d\u00f3 t\u00f3k J\u00f3s\u00faa vi\u00f0 af honum sem lei\u00f0togi \u00cdsraelsmanna og hann st\u00fdr\u00f0i landvinningum Kanaan. Upprunalega nafni\u00f0 hans var Hoshea. Nafni\u00f0 Jes\u00fas kemur fr\u00e1 gr\u00edskri \u00fe\u00fd\u00f0ingu \u00e1 aramesku stuttmyndinni \u05d9\u05b5\u05e9\u05c1\u05d5\u05bc\u05e2\u05b7 (Yeshu`a), sem var raunverulega nafn Jes\u00fa. Sem enskt nafn hefur Joshua veri\u00f0 \u00ed notkun s\u00ed\u00f0an si\u00f0askipti m\u00f3tm\u00e6lenda.'), TRUE, 'Joshua');
