INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3284, STRINGDECODE('Fr\u00e1 r\u00f3mverska heitinu Iulianus, sem var dregi\u00f0 af JULIUS. \u00deetta var nafn s\u00ed\u00f0asta hei\u00f0na r\u00f3mverska keisarans, Julian fr\u00e1hvarfs (4. \u00f6ld). \u00dea\u00f0 var einnig bori\u00f0 af nokkrum fyrstu d\u00fdrlingum, \u00fear \u00e1 me\u00f0al hinum go\u00f0sagnakennda Saint Julian the Hospitaller. \u00deetta nafn hefur veri\u00f0 nota\u00f0 \u00e1 Englandi fr\u00e1 mi\u00f0\u00f6ldum, en \u00fe\u00e1 var \u00fea\u00f0 einnig kvenlegt nafn (fr\u00e1 Juliana, a\u00f0 lokum a\u00f0 ver\u00f0a Gillian).'), TRUE, 'Julian');              
