INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3389, STRINGDECODE('Fr\u00e1 s\u00ed\u00f0gr\u00edska nafninu \u03a7\u03c1\u03b9\u03c3\u03c4\u03cc\u03c6\u03bf\u03c1\u03bf\u03c2 (Christophoros) sem \u00fe\u00fd\u00f0ir \u201ebera CHRIST\u201c, dregi\u00f0 af \u03a7\u03c1\u03b9\u03c3\u03c4\u03cc\u03c2 (Christos) \u00e1samt \u03c6\u03ad\u03c1\u03c9 (phero) sem \u00fe\u00fd\u00f0ir \u201ea\u00f0 bera, a\u00f0 bera\u201c. Frumkristnir menn notu\u00f0u \u00fea\u00f0 sem myndhverflegt nafn og l\u00fdstu \u00fev\u00ed yfir a\u00f0 \u00feeir b\u00e6ru Krist \u00ed hjarta s\u00ednu. \u00c1 mi\u00f0\u00f6ldum leiddu b\u00f3kstaflegar t\u00falkanir \u00e1 si\u00f0areglum nafnsins til \u00fej\u00f3\u00f0sagna um heilagan Krist\u00f3fer sem bar hinn unga Jes\u00fa yfir \u00e1na. Hann er talinn verndard\u00fdrlingur fer\u00f0amanna. Sem enskt eiginnafn hefur Christopher veri\u00f0 almennt \u00ed notkun s\u00ed\u00f0an \u00e1 15. \u00f6ld. \u00dea\u00f0 var\u00f0 mj\u00f6g vins\u00e6lt \u00e1 seinni hluta 20. aldar og n\u00e1\u00f0i topps\u00e6ti Englands og Wales \u00e1 n\u00edunda \u00e1ratugnum og n\u00e1lga\u00f0ist \u00fea\u00f0 \u00ed Bandar\u00edkjunum. \u00cd Danm\u00f6rku var \u00feetta nafn bori\u00f0 af \u00feremur konungum (n\u00f6fn \u00feeirra eru venjulega stafsett Christoffer), \u00fear \u00e1 me\u00f0al Krist\u00f3fer af B\u00e6jaralandi fr\u00e1 15. \u00f6ld sem einnig stj\u00f3rna\u00f0i Noregi og Sv\u00ed\u00fej\u00f3\u00f0. A\u00f0rir fr\u00e6gir handhafar eru \u00edtalski landk\u00f6nnu\u00f0urinn Christopher Columbus (1451-1506), enski leiksk\u00e1ldi\u00f0 Christopher Marlowe (1564-1593), enski arkitektinn Christopher Wren (1632-1723) og sk\u00e1ldskaparpers\u00f3nan Christopher Robin \u00far A. A. Milne`s Winnie-the-Pooh b\u00f3kum.'), TRUE, 'Kristofer');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3390, STRINGDECODE('\u00deetta nafn er stranglega karlkyns \u00ed Alban\u00edu og Eistlandi, en unisex \u00ed Georg\u00edu. \u00cd Alban\u00edu er \u00fea\u00f0 sm\u00e6rri e\u00f0a stutt mynd af KRISTAQ og / e\u00f0a KRISTOFOR. \u00cd Eistlandi er \u00fea\u00f0 minnkandi e\u00f0a stutt form KRISTER og / e\u00f0a KRISTJAN.In Georg\u00eda, \u00fea\u00f0 er stutt form KRISTESIA og / e\u00f0a KRISTEPORE fyrir karla, og KRISTINE fyrir konur.'), TRUE, STRINGDECODE('Krist\u00f3'));      
