INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3399, STRINGDECODE('Komi\u00f0 fr\u00e1 nafninu \u00e1 gerja\u00f0a safanum af berjunum. \u00cd norr\u00e6nni go\u00f0afr\u00e6\u00f0i var Kvasir vitrastur af \u00f6llum verum. Dvergarnir FJALARR og GALARR dr\u00e1pu hann, helltu bl\u00f3\u00f0i hans \u00ed skipin Bo\u00f0n, S\u00f3n og \u00d3\u00f0r\u0153rir og bl\u00f6ndu\u00f0u \u00fev\u00ed saman hunangi til a\u00f0 gera skald\u00f3ttan mj\u00f6\u00f0, sem ger\u00f0i hver sem drakk \u00fea\u00f0 sk\u00e1ld.'), TRUE, 'Kvasir'); 
