INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3412, STRINGDECODE('Fr\u00e1 fornnorr\u00e6na nafninu Leifr sem \u00fe\u00fd\u00f0ir \u201eafkomandi, erfingi\u201c. Leif Eriksson var norr\u00e6nn landk\u00f6nnu\u00f0ur sem n\u00e1\u00f0i til Nor\u00f0ur-Amer\u00edku snemma \u00e1 11. \u00f6ld. Hann var sonur Eriks rau\u00f0a.'), TRUE, 'Leif');             
