INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3415, STRINGDECODE('Fr\u00e1 \u00edrsku eftirnafni, anglicized mynd af \u00d3 Leann\u00e1in, sem \u00fe\u00fd\u00f0ir \u201cafkomandi Leann\u00e1n\u201c. Nafni\u00f0 Leann\u00e1n \u00fe\u00fd\u00f0ir \u201eelskhugi\u201c \u00e1 \u00edrsku. \u00deetta eftirnafn bar t\u00f3nlistarma\u00f0urinn John Lennon (1940-1980), me\u00f0limur B\u00edtlanna.'), TRUE, 'Lennon');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3416, STRINGDECODE('Komi\u00f0 fr\u00e1 latnesku le\u00f3 sem \u00fe\u00fd\u00f0ir \u201clj\u00f3n\u201c, fylgikona LEON. \u00dea\u00f0 var vins\u00e6lt me\u00f0al frumkristinna og var nafn 13 p\u00e1fa, \u00fear \u00e1 me\u00f0al heilags Le\u00f3 mikils sem fullyrti yfirbur\u00f0i r\u00f3mversku biskupanna (p\u00e1fanna) yfir \u00f6llum \u00f6\u00f0rum \u00e1 5. \u00f6ld. \u00dea\u00f0 var einnig bori\u00f0 af sex b\u00fdsanskum keisurum og fimm armenskum konungum. Annar fr\u00e6gur handhafi var Leo Tolstoy (1828-1910), r\u00fassneskur sk\u00e1ldsagnah\u00f6fundur en \u00ed verkum hans eru Str\u00ed\u00f0 og fri\u00f0ur og Anna Karenina. Leo er einnig nafn stj\u00f6rnumerkis og fimmta stj\u00f6rnumerki\u00f0.'), TRUE, 'Leo');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3417, STRINGDECODE('Afleitt \u00far gr\u00edsku \u03bb\u03ad\u03c9\u03bd (le\u00f3n) sem \u00fe\u00fd\u00f0ir \u201elj\u00f3n\u201c. \u00c1 kristnu t\u00edmabili var \u00feetta gr\u00edska heiti sameina\u00f0 latneska samst\u00e6\u00f0unni Leo, me\u00f0 \u00feeim aflei\u00f0ingum a\u00f0 formin tv\u00f6 eru notu\u00f0 nokku\u00f0 til skiptis \u00e1 evr\u00f3pskum tungum\u00e1lum. \u00cd Englandi \u00e1 mi\u00f0\u00f6ldum var \u00feetta algengt nafn me\u00f0al gy\u00f0inga. Fr\u00e6gur handhafi var Leon Trotsky (1879-1940), r\u00fassneskur komm\u00fanistabyltingarma\u00f0ur.'), TRUE, 'Leon');
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3418, STRINGDECODE('\u00de\u00fd\u00f0ir \u201ehugrakkur lj\u00f3n\u201c, dreginn af germ\u00f6nsku frumefnunum lewo \u201elj\u00f3n\u201c (af latneskum uppruna) og har\u00f0ur \u201ehugrakkur, har\u00f0ger\u00f0ur\u201c. \u00deetta var nafn 5. aldar Frankish d\u00fdrlingur fr\u00e1 Noblac sem er verndari fanga og hesta. Normannar komu me\u00f0 \u00feetta nafn til Englands, \u00fear sem \u00fea\u00f0 var nota\u00f0 jafnt og \u00fe\u00e9tt \u00ed gegnum mi\u00f0alda og var\u00f0 enn algengara \u00e1 20. \u00f6ld.'), TRUE, 'Leonard');            
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3419, STRINGDECODE('\u00cdtalska, sp\u00e6nska og port\u00fagalska mynd af LEONARD. Athyglisver\u00f0ur flutningsma\u00f0ur var Leonardo da Vinci (1452-1519), \u00edtalskur listama\u00f0ur og v\u00edsindama\u00f0ur endurreisnart\u00edmabilsins. Hann er \u00feekktur sem uppfinningama\u00f0ur nokkurra gagna, \u00fear \u00e1 me\u00f0al flugv\u00e9la, sem og m\u00e1lari Mona Lisa. Annar fr\u00e6gur handhafi var Leonardo Fibonacci, \u00edtalskur st\u00e6r\u00f0fr\u00e6\u00f0ingur fr\u00e1 13. \u00f6ld. N\u00fdlegri handhafi er bandar\u00edski leikarinn Leonardo DiCaprio (1974-).'), TRUE, STRINGDECODE('Leonard\u00f3'));         
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3420, STRINGDECODE('Sp\u00e6nskt og port\u00fagalskt form LIONEL.'), TRUE, 'Leonel'); 
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3421, STRINGDECODE('\u00de\u00fdska mynd LEONARD. Fr\u00e6gur handhafi var svissneski st\u00e6r\u00f0fr\u00e6\u00f0ingurinn Leonhard Euler (1707-1783), sem lag\u00f0i m\u00f6rg mikilv\u00e6g framl\u00f6g til reikniv\u00e9lar, talnafr\u00e6\u00f0i, r\u00famfr\u00e6\u00f0i og fr\u00e6\u00f0ilegra e\u00f0lisfr\u00e6\u00f0i.'), TRUE, 'Leonhard');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3422, STRINGDECODE('\u00far lat\u00ednu: lj\u00f3n. 11/4. Le\u00f3 mikli, p\u00e1fi.'), TRUE, STRINGDECODE('Le\u00f3'));              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3423, STRINGDECODE('Afleiddur af germ\u00f6nskum \u00fe\u00e1ttum leud \u201cf\u00f3lk\u201c og sk\u00f6ll\u00f3ttur \u201cfeitletra\u00f0\u201c. Stafsetningunni var breytt vegna tengsla vi\u00f0 latneskt le\u00f3 \u201elj\u00f3n\u201c. \u00deetta nafn var algengt me\u00f0al \u00fe\u00fdskra k\u00f3ngaf\u00f3lks, fyrst me\u00f0 Babenbergs og s\u00ed\u00f0an Habsburgara. Saint Leopold var 12. aldar Babenberg ja\u00f0ri Austurr\u00edkis, sem n\u00fa er talinn verndari \u00feess lands. \u00dea\u00f0 var einnig bori\u00f0 af tveimur keisurum fr\u00e1 Habsburg, helgum r\u00f3mverjum, auk \u00feriggja konunga \u00ed Belg\u00edu. Fr\u00e1 19. \u00f6ld hefur \u00feetta nafn stundum veri\u00f0 nota\u00f0 \u00e1 Englandi, upphaflega til hei\u00f0urs fr\u00e6nda Viktor\u00edu drottningar, konungs \u00ed Belg\u00edu, en eftir \u00fea\u00f0 nefndi h\u00fan einn af sonum s\u00ednum. \u00dea\u00f0 var s\u00ed\u00f0ar nota\u00f0 af James Joyce fyrir a\u00f0alpers\u00f3nuna, Leopold Bloom, \u00ed sk\u00e1lds\u00f6gu sinni Ulysses (1920).'), TRUE, STRINGDECODE('Le\u00f3pold'));  
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3424, STRINGDECODE('\u00far bibl\u00edunni og \u00fe\u00fd\u00f0ir sameina\u00f0ur.'), TRUE, STRINGDECODE('Lev\u00ed'));              
