INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3444, STRINGDECODE('Merking \u00f3\u00feekkt, hugsanlega fengin af germ\u00f6nsku r\u00f3tinni * luka sem \u00fe\u00fd\u00f0ir \u201ehn\u00fatur, l\u00e6sing\u201c. \u00cd norr\u00e6nu go\u00f0s\u00f6gninni var Loki trickster god sem tengdist t\u00f6fra og eldi. Me\u00f0 t\u00edmanum var\u00f0 hann illari og illari og a\u00f0 lokum var hann hlekkja\u00f0ur vi\u00f0 klett af \u00f6\u00f0rum gu\u00f0um.'), TRUE, 'Loki');
