INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3449, STRINGDECODE('Fr\u00e1 nafni lotusbl\u00f3msins (tegundin Nelumbo nucifera) e\u00f0a go\u00f0sagnakennda lotus-tr\u00e9sins. \u00deau eru a\u00f0 lokum fengin \u00far gr\u00edsku \u03bb\u03c9\u03c4\u03cc\u03c2 (lotos). \u00cd gr\u00edskri og r\u00f3mverskri go\u00f0afr\u00e6\u00f0i var sagt a\u00f0 l\u00f3t\u00f3tr\u00e9\u00f0 myndi framlei\u00f0a \u00e1v\u00f6xt sem olli syfju og gleymsku.'), TRUE, STRINGDECODE('L\u00f3tus')); 
