INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3457, STRINGDECODE('Fr\u00e1 \u00fe\u00fdsku eftirnafni, sj\u00e1lft fr\u00e1 germanska eiginnafninu LEUTHAR. Eftirnafni\u00f0 var bori\u00f0 af Martin Luther, munki og gu\u00f0fr\u00e6\u00f0ingi fr\u00e1 16. \u00f6ld, sem byrja\u00f0i si\u00f0askipti m\u00f3tm\u00e6lenda me\u00f0 \u00fev\u00ed a\u00f0 negla fr\u00e6gar 95 ritger\u00f0ir s\u00ednar vi\u00f0 kirkjudyr. \u00dea\u00f0 hefur s\u00ed\u00f0an veri\u00f0 nota\u00f0 sem eiginnafn honum til hei\u00f0urs, s\u00e9rstaklega me\u00f0al m\u00f3tm\u00e6lenda. Athyglisver\u00f0ur flutningsma\u00f0ur fr\u00e1 n\u00fat\u00edmanum var bandar\u00edski borgaralegi lei\u00f0toginn Martin Luther King (1929-1968).'), TRUE, STRINGDECODE('L\u00father'));      
