INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3468, STRINGDECODE('Afleitt af germ\u00f6nskum \u00fe\u00e1ttum magan \u201estyrkur\u201c og frid \u201efri\u00f0ur\u201c. \u00deetta er nafn a\u00f0alpers\u00f3nunnar \u00ed Manfred leiklist Lord Byron (1817). \u00deetta nafn bar einnig Manfred von Richthofen (1892-1918), \u00fe\u00fdski flugma\u00f0urinn \u00ed fyrri heimsstyrj\u00f6ldinni sem var \u00feekktur sem Rau\u00f0i bar\u00f3ninn.'), TRUE, 'Manfred');       
