INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3470, STRINGDECODE('Sp\u00e6nsku og port\u00fag\u00f6lsku formi EMMANUEL. \u00cd stafsetningunni \u039c\u03b1\u03bd\u03bf\u03c5\u03ae\u03bb (Manouel) var \u00fea\u00f0 einnig nota\u00f0 \u00ed B\u00fdsanska heimsveldinu, einkum af tveimur keisurum. \u00dea\u00f0 er m\u00f6gulegt a\u00f0 \u00feetta form nafnsins hafi veri\u00f0 sent til Sp\u00e1nar og Port\u00fagals fr\u00e1 B\u00fdsans, \u00fear sem tengsl voru milli konungsfj\u00f6lskyldnanna (Ferdinand III konungur \u00ed Kastil\u00edu kv\u00e6ntist Elisabeth af Hohenstaufen, sem \u00e1tti b\u00fdsanskar r\u00e6tur og \u00e1tti son a\u00f0 nafni Manuel). Nafni\u00f0 hefur veri\u00f0 nota\u00f0 \u00ed \u00cdber\u00edu s\u00ed\u00f0an a\u00f0 minnsta kosti 13. \u00f6ld og var bori\u00f0 af tveimur konungum Port\u00fagals.'), TRUE, 'Manuel');    
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3471, STRINGDECODE('Sp\u00e6nsku og port\u00fag\u00f6lsku formi EMMANUEL. \u00cd stafsetningunni \u039c\u03b1\u03bd\u03bf\u03c5\u03ae\u03bb (Manouel) var \u00fea\u00f0 einnig nota\u00f0 \u00ed B\u00fdsanska heimsveldinu, einkum af tveimur keisurum. \u00dea\u00f0 er m\u00f6gulegt a\u00f0 \u00feetta form nafnsins hafi veri\u00f0 sent til Sp\u00e1nar og Port\u00fagals fr\u00e1 B\u00fdsans, \u00fear sem tengsl voru milli konungsfj\u00f6lskyldnanna (Ferdinand III konungur \u00ed Kastil\u00edu kv\u00e6ntist Elisabeth af Hohenstaufen, sem \u00e1tti b\u00fdsanskar r\u00e6tur og \u00e1tti son a\u00f0 nafni Manuel). Nafni\u00f0 hefur veri\u00f0 nota\u00f0 \u00ed \u00cdber\u00edu s\u00ed\u00f0an a\u00f0 minnsta kosti 13. \u00f6ld og var bori\u00f0 af tveimur konungum Port\u00fagals.'), TRUE, STRINGDECODE('Man\u00fael')); 
