INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3486, STRINGDECODE('Form af lat\u00ednu MARCUS nota\u00f0 \u00e1 nokkrum tungum\u00e1lum. Heilagur Mark\u00fas var h\u00f6fundur annarrar gu\u00f0spjallsins \u00ed N\u00fdja testamentinu. \u00de\u00f3 a\u00f0 sj\u00e1lfsmynd h\u00f6fundar s\u00e9 ekki viss, halda sumar hef\u00f0ir a\u00f0 hann s\u00e9 sami ma\u00f0urinn og J\u00f3hannes Mark\u00fas sem birtist \u00ed Postulas\u00f6gunni. Hann er verndard\u00fdrlingur Feneyja, \u00fear sem hann er sag\u00f0ur grafinn. \u00de\u00f3 a\u00f0 Mark hafi veri\u00f0 nota\u00f0ur \u00e1 mi\u00f0\u00f6ldum var hann ekki algengur \u00ed enskum\u00e6landi heimi fyrr en \u00e1 19. \u00f6ld, \u00feegar hann byrja\u00f0i a\u00f0 nota samhli\u00f0a klass\u00edska forminu Marcus. \u00cd keltnesku \u00fej\u00f3\u00f0s\u00f6gunni um Tristan og Isolde var \u00feetta nafn konungs. fr\u00e1 Cornwall. \u00dea\u00f0 bar einnig bandar\u00edski rith\u00f6fundurinn Mark Twain (1835-1910), r\u00e9ttu nafni Samuel Clemens, h\u00f6fundur \u00c6vint\u00fdra Tom Sawyer og \u00c6vint\u00fdri Huckleberry Finns. Hann t\u00f3k pennanafn sitt fr\u00e1 s\u00edmtali sem starfsmenn \u00e1rb\u00e1ta vi\u00f0 Mississippi-\u00e1na notu\u00f0u til a\u00f0 gefa til kynna d\u00fdpi tveggja fa\u00f0ma. \u00deetta er einnig venjulegur enskur stafsetning \u00e1 nafni 1. aldar f.Kr. r\u00f3mverski triumvir Marcus Antonius (Mark Antony).'), TRUE, 'Mark');     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3487, STRINGDECODE('MARK form \u00e1 nokkrum tungum\u00e1lum.'), TRUE, STRINGDECODE('Mark\u00f3'));   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3488, STRINGDECODE('\u00far lat\u00ednu, dregi\u00f0 af nafni herna\u00f0argu\u00f0sins Mars. 25/4. Mark\u00fas gu\u00f0spjallarma\u00f0ur. Af nafninu Mark\u00fas er dregi\u00f0 \u00e6ttarnafni\u00f0 Marx: Karl Marx (1818-1883).'), TRUE, STRINGDECODE('Mark\u00fas'));           
