INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3490, STRINGDECODE('Fr\u00e1 eftirnafni sem var teki\u00f0 \u00far \u00f6rnefni sem \u00fe\u00fd\u00f0ir anna\u00f0 hvort \u201eskemmtilegur vi\u00f0ur\u201c, \u201elandamerki vi\u00f0ur\u201c e\u00f0a \u201emar\u00f0arvi\u00f0\u201c \u00e1 fornensku. Fr\u00e6gur handhafi eftirnafnsins var Jama\u00edka t\u00f3nlistarma\u00f0urinn Bob Marley (1945-1981).'), TRUE, 'Marley');               
