INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3492, STRINGDECODE('T\u00e6knilega hefur \u00feetta nafn ekki merkingu \u00fear sem \u00fea\u00f0 er skrifa\u00f0 me\u00f0 hlj\u00f3\u00f0fr\u00e6\u00f0ilegum st\u00f6fum. \u00deetta nafn er mj\u00f6g sjaldan gefi\u00f0 stelpum, ef \u00fea\u00f0 er gefi\u00f0 neitt.'), TRUE, 'Maron');         
