INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3499, STRINGDECODE('Fr\u00e1 r\u00f3mverska nafninu Martinus, sem var dregi\u00f0 af Martis, er kynf\u00e6ri\u00f0 um nafn r\u00f3mverska gu\u00f0sins MARS. Saint Martin of Tours var biskup \u00e1 4. \u00f6ld sem er verndard\u00fdrlingur Frakklands. Samkv\u00e6mt go\u00f0s\u00f6gninni rakst hann \u00e1 kaldan betlara um mi\u00f0jan vetur svo hann reif skikkjuna \u00ed tvennt og gaf betlaranum helminginn af henni. Hann var eftirl\u00e6tis d\u00fdrlingur \u00e1 mi\u00f0\u00f6ldum og nafn hans hefur or\u00f0i\u00f0 algengt um allan hinn kristna heim. \u00c1hrifamikill handhafi nafnsins var Martin Luther (1483-1546), gu\u00f0fr\u00e6\u00f0ingurinn sem h\u00f3f si\u00f0askipti m\u00f3tm\u00e6lenda. Nafni\u00f0 var einnig bori\u00f0 af fimm p\u00e1fum (tveir \u00feeirra oftar \u00feekktir sem Marinus). A\u00f0rir n\u00fdlegri handhafar eru \u00fe\u00fdski heimspekingurinn Martin Heidegger (1889-1976), bandar\u00edski borgaralegi lei\u00f0toginn Martin Luther King (1929-1968) og bandar\u00edski kvikmyndager\u00f0arma\u00f0urinn Martin Scorsese (1942-).'), TRUE, 'Martin');             
