INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3523, STRINGDECODE('Fr\u00e1 hebreska nafninu \u05de\u05b4\u05d9\u05db\u05b8\u05d0\u05b5\u05dc (Mikha`el) sem \u00fe\u00fd\u00f0ir \u201chver er eins og Gu\u00f0?\u201c. \u00deetta er or\u00f0r\u00e6\u00f0uspurning sem gefur \u00ed skyn a\u00f0 engin manneskja s\u00e9 eins og Gu\u00f0. Michael er einn af erkienglum \u00ed hebreskum si\u00f0 og s\u00e1 eini sem er au\u00f0kenndur sem erkiengill \u00ed Bibl\u00edunni. \u00cd Dan\u00edelsb\u00f3k \u00ed Gamla testamentinu er hann nefndur sem verndari \u00cdsraels. \u00cd Opinberunarb\u00f3kinni \u00ed N\u00fdja testamentinu er hann s\u00fdndur sem lei\u00f0togi himinsherja \u00ed str\u00ed\u00f0inu gegn Satan og er \u00fev\u00ed talinn verndard\u00fdrlingur hermanna \u00ed kristni. Vins\u00e6ldir d\u00fdrlingsins leiddu til \u00feess a\u00f0 nafni\u00f0 var nota\u00f0 af n\u00edu B\u00fds\u00f6ntum. keisarar, \u00fear \u00e1 me\u00f0al Michael VIII Palaeologus sem endurreisti heimsveldi\u00f0 \u00e1 13. \u00f6ld. \u00dea\u00f0 hefur veri\u00f0 algengt \u00ed Vestur-Evr\u00f3pu fr\u00e1 mi\u00f0\u00f6ldum og \u00e1 Englandi s\u00ed\u00f0an \u00e1 12. \u00f6ld. \u00dea\u00f0 hefur veri\u00f0 bori\u00f0 (\u00ed \u00fdmsum stafsetningum) af r\u00e1\u00f0am\u00f6nnum \u00ed R\u00fasslandi (stafsett \u041c\u0438\u0445\u0430\u0438\u043b), R\u00famen\u00edu (Mihai), P\u00f3llandi (Micha\u0142) og Port\u00fagal (Miguel). \u00cd Bandar\u00edkjunum n\u00e1\u00f0i \u00feetta nafn flj\u00f3tt vins\u00e6ldum fr\u00e1 og me\u00f0 1930, a\u00f0 lokum var\u00f0 vins\u00e6lasta karlmannsnafni\u00f0 fr\u00e1 1954 til 1998. \u00dea\u00f0 var \u00fe\u00f3 ekki eins yfir\u00feyrmandi algengt \u00ed Bretlandi \u00fear sem \u00fea\u00f0 n\u00e1\u00f0i aldrei topps\u00e6tinu. Me\u00f0 fr\u00e6gum flytjendum \u00feessa nafns m\u00e1 nefna breska efnafr\u00e6\u00f0inginn / e\u00f0lisfr\u00e6\u00f0inginn Michael Faraday (1791-1867) , t\u00f3nlistarma\u00f0urinn Michael Jackson (1958-2009), og k\u00f6rfuboltama\u00f0urinn Michael Jordan (1963-).'), TRUE, 'Michael');   
