INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3549, STRINGDECODE('Fr\u00e1 hebreska heitinu \u05de\u05b9\u05e9\u05b6\u05c1\u05d4 (Mosheh), sem er l\u00edklegast dregi\u00f0 af egypskum mes sem \u00fe\u00fd\u00f0ir \u201csonur\u201c, en g\u00e6ti einnig \u00fe\u00fdtt \u201cafhenda\u201c \u00e1 hebresku. Merkingin sem l\u00f6g\u00f0 er til \u00ed Gamla testamentinu \u201edregi\u00f0 \u00fat\u201c \u00far hebresku \u05de\u05e9\u05d4 (mashah) er l\u00edklega fundin uppskrift (sj\u00e1 2. M\u00f3seb\u00f3k 2:10). Bibl\u00edan M\u00f3se var dregin upp \u00far N\u00edl af d\u00f3ttur fara\u00f3s og tekin upp \u00ed konungsfj\u00f6lskylduna. , \u00e1 sama t\u00edma og \u00cdsraelsmenn voru \u00fer\u00e6lar \u00ed Egyptalandi. Me\u00f0 Aroni br\u00f3\u00f0ur s\u00ednum kraf\u00f0ist hann fara\u00f3sins a\u00f0 l\u00e1ta \u00cdsraelsmenn lausa, sem var a\u00f0eins gert eftir a\u00f0 Gu\u00f0 sendi t\u00edu pl\u00e1gur yfir Egyptaland. M\u00f3se leiddi f\u00f3lki\u00f0 yfir Rau\u00f0ahafi\u00f0 og til S\u00edna\u00edfjalls \u00fear sem hann f\u00e9kk bo\u00f0or\u00f0in t\u00edu fr\u00e1 Gu\u00f0i. Eftir 40 \u00e1ra flakk \u00ed ey\u00f0im\u00f6rkinni n\u00e1\u00f0i \u00fej\u00f3\u00f0in til Kanaan, fyrirheitna landsins, en M\u00f3se d\u00f3 r\u00e9tt \u00e1\u00f0ur en hann f\u00f3r inn \u00ed \u00fea\u00f0. \u00c1 Englandi hefur \u00feetta nafn veri\u00f0 almennt nota\u00f0 af kristnum m\u00f6nnum fr\u00e1 si\u00f0askiptum m\u00f3tm\u00e6lenda, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 hafi lengi veri\u00f0 vins\u00e6lt me\u00f0al gy\u00f0inga.'), TRUE, STRINGDECODE('M\u00f3ses'));             
