INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3554, STRINGDECODE('Afleidd \u00far fornnorr\u00e6num munr \u201chuga\u201c (sj\u00e1 einnig MUNIMUND). \u00cd norr\u00e6nni go\u00f0afr\u00e6\u00f0i er Muninn nafn annars tveggja hrafna \u00d3\u00f0ins. Muninn t\u00e1knar minni og \u00e1 hverjum degi flj\u00faga hann og Huginn (hinn hrafninn) yfir alla n\u00edu heima sem \u00feekkjast \u00ed norr\u00e6nni go\u00f0afr\u00e6\u00f0i til a\u00f0 safna fr\u00e9ttum og uppl\u00fdsingum fyrir \u00d3\u00f0inn.'), TRUE, 'Muninn');         
