INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3564, STRINGDECODE('Fr\u00e1 hebreska nafninu \u05e0\u05b8\u05ea\u05b8\u05df (Natan) sem \u00fe\u00fd\u00f0ir \u201chann gaf\u201c. \u00cd Gamla testamentinu er \u00feetta nafn sp\u00e1manns \u00e1 valdat\u00edma Dav\u00ed\u00f0s konungs. Hann \u00e1taldi Dav\u00ed\u00f0 fyrir framhj\u00e1hald sitt vi\u00f0 Batseba og fyrir dau\u00f0a \u00dar\u00eda Het\u00edta. S\u00ed\u00f0ar bar\u00f0ist hann fyrir Sal\u00f3mon sem arftaka Dav\u00ed\u00f0s. \u00deetta var einnig nafn sonar Dav\u00ed\u00f0s og Batsebu. \u00dea\u00f0 hefur veri\u00f0 nota\u00f0 sem kristilegt eiginnafn \u00ed enskum\u00e6landi heimi fr\u00e1 si\u00f0askiptum m\u00f3tm\u00e6lenda. Fr\u00e6gur handhafi var Nathan Hale (1755-1776), bandar\u00edskur nj\u00f3snari sem var tekinn af l\u00edfi af Bretum \u00e1 t\u00edmum bandar\u00edsku byltingarinnar.'), TRUE, 'Nathan');          
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3565, STRINGDECODE('Fr\u00e1 hebreska nafninu \u05e0\u05b0\u05ea\u05b7\u05e0\u05b0\u05d0\u05b5\u05dc (Netan`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0 hefur gefi\u00f0\u201c, fr\u00e1 frumefnunum \u05e0\u05b8\u05d8\u05b7\u05df (natan) sem \u00fe\u00fd\u00f0ir \u201ca\u00f0 gefa\u201c og \u05d0\u05b5\u05dc (`el) sem \u00fe\u00fd\u00f0ir \u201cGu\u00f0\u201c. \u00dea\u00f0 bera nokkrar minnih\u00e1ttar pers\u00f3nur \u00ed Gamla testamentinu, venjulega stafsettar Nethanel e\u00f0a Nethaneel. \u00cd N\u00fdja testamentinu er \u00feetta nafn postula, l\u00edklega anna\u00f0 nafn postulans sem heitir Bartholomew.'), TRUE, 'Nathanael');       
