INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3637, STRINGDECODE('Fr\u00e1 Olivier, normandi fr\u00f6nsk mynd af germ\u00f6nsku nafni eins og ALFHER e\u00f0a fornnorr\u00e6nu nafni eins og \u00c1leifr (sj\u00e1 OLAF). Stafsetningunni var breytt me\u00f0 tengslum vi\u00f0 lat\u00ednu oliva \u201eol\u00edutr\u00e9\u201c. \u00c1 mi\u00f0\u00f6ldum var\u00f0 nafni\u00f0 vel \u00feekkt \u00ed Vestur-Evr\u00f3pu vegna fr\u00f6nsku Epic La Chanson de Roland, \u00fear sem Olivier var vinur og r\u00e1\u00f0gjafi hetjunnar Roland. \u00c1 Englandi var Oliver algengt nafn mi\u00f0alda, en \u00fea\u00f0 var\u00f0 \u00fe\u00f3 sjaldg\u00e6ft eftir 17. \u00f6ld vegna herforingjans Oliver Cromwell, sem stj\u00f3rna\u00f0i landinu \u00ed kj\u00f6lfar borgarastyrjaldarinnar. Nafni\u00f0 var endurvaki\u00f0 \u00e1 19. \u00f6ld, a\u00f0 hluta til vegna titilpers\u00f3nunnar \u00ed sk\u00e1lds\u00f6gu Charles Dickens, Oliver Twist (1838), sem fjalla\u00f0i um f\u00e1t\u00e6kt muna\u00f0arleysingja sem bj\u00f3 \u00e1 g\u00f6tum London. \u00dea\u00f0 var\u00f0 mj\u00f6g vins\u00e6lt \u00ed byrjun 21. aldar, n\u00e1\u00f0i efstu s\u00e6tum str\u00e1ka \u00ed Englandi og Wales \u00e1ri\u00f0 2009 og komst inn \u00e1 topp t\u00edu \u00ed Bandar\u00edkjunum \u00e1ri\u00f0 2017.'), TRUE, STRINGDECODE('\u00d3liver'));     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3638, STRINGDECODE('Fr\u00e1 Olivier, normandi fr\u00f6nsk mynd af germ\u00f6nsku nafni eins og ALFHER e\u00f0a fornnorr\u00e6nu nafni eins og \u00c1leifr (sj\u00e1 OLAF). Stafsetningunni var breytt me\u00f0 tengslum vi\u00f0 lat\u00ednu oliva \u201eol\u00edutr\u00e9\u201c. \u00c1 mi\u00f0\u00f6ldum var\u00f0 nafni\u00f0 vel \u00feekkt \u00ed Vestur-Evr\u00f3pu vegna fr\u00f6nsku Epic La Chanson de Roland, \u00fear sem Olivier var vinur og r\u00e1\u00f0gjafi hetjunnar Roland. \u00c1 Englandi var Oliver algengt nafn mi\u00f0alda, en \u00fea\u00f0 var\u00f0 \u00fe\u00f3 sjaldg\u00e6ft eftir 17. \u00f6ld vegna herforingjans Oliver Cromwell, sem stj\u00f3rna\u00f0i landinu \u00ed kj\u00f6lfar borgarastyrjaldarinnar. Nafni\u00f0 var endurvaki\u00f0 \u00e1 19. \u00f6ld, a\u00f0 hluta til vegna titilpers\u00f3nunnar \u00ed sk\u00e1lds\u00f6gu Charles Dickens, Oliver Twist (1838), sem fjalla\u00f0i um f\u00e1t\u00e6kt muna\u00f0arleysingja sem bj\u00f3 \u00e1 g\u00f6tum London. \u00dea\u00f0 var\u00f0 mj\u00f6g vins\u00e6lt \u00ed byrjun 21. aldar, n\u00e1\u00f0i efstu s\u00e6tum str\u00e1ka \u00ed Englandi og Wales \u00e1ri\u00f0 2009 og komst inn \u00e1 topp t\u00edu \u00ed Bandar\u00edkjunum \u00e1ri\u00f0 2017.'), TRUE, STRINGDECODE('\u00d3l\u00edver'));
