INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3651, STRINGDECODE('Fr\u00e1 latneska heitinu Patricius, sem \u00fe\u00fdddi \u201ea\u00f0alsma\u00f0ur\u201c. \u00deetta nafn var teki\u00f0 upp \u00e1 5. \u00f6ld af Saint Patrick, en f\u00e6\u00f0ingarnafn hans var Sucat. Hann var r\u00f3mverskur Breti sem var tekinn og \u00fer\u00e6ldur \u00ed \u00e6sku af \u00edrskum \u00e1r\u00e1sarm\u00f6nnum. Eftir sex \u00e1ra \u00fer\u00e6ld\u00f3m slapp hann heim en hann var\u00f0 a\u00f0 lokum biskup og f\u00f3r aftur til \u00cdrlands sem tr\u00fabo\u00f0i. Hann er jafnan \u00e1litinn kristna eyjuna og er \u00e1litinn verndard\u00fdrlingur \u00cdrlands. \u00cd Englandi og annars sta\u00f0ar \u00ed Evr\u00f3pu \u00e1 mi\u00f0\u00f6ldum var \u00feetta nafn nota\u00f0 til hei\u00f0urs d\u00fdrlingnum. Hins vegar var \u00fea\u00f0 almennt ekki gefi\u00f0 \u00e1 \u00cdrlandi fyrir 17. \u00f6ld vegna \u00feess a\u00f0 \u00fea\u00f0 var tali\u00f0 of heilagt til daglegrar notkunar. \u00dea\u00f0 hefur s\u00ed\u00f0an or\u00f0i\u00f0 mj\u00f6g algengt \u00fear.'), TRUE, 'Patrek');             
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3652, STRINGDECODE('\u00far \u00edrsku, merking \u00f3kunn. 17/3. Patrekur helgi, verndard\u00fdrlingur \u00cdra (d. 492).'), TRUE, 'Patrekur');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3653, STRINGDECODE('Fr\u00e1 latneska heitinu Patricius, sem \u00fe\u00fdddi \u201ea\u00f0alsma\u00f0ur\u201c. \u00deetta nafn var teki\u00f0 upp \u00e1 5. \u00f6ld af Saint Patrick, en f\u00e6\u00f0ingarnafn hans var Sucat. Hann var r\u00f3mverskur Breti sem var tekinn og \u00fer\u00e6ldur \u00ed \u00e6sku af \u00edrskum \u00e1r\u00e1sarm\u00f6nnum. Eftir sex \u00e1ra \u00fer\u00e6ld\u00f3m slapp hann heim en hann var\u00f0 a\u00f0 lokum biskup og f\u00f3r aftur til \u00cdrlands sem tr\u00fabo\u00f0i. Hann er jafnan \u00e1litinn kristna eyjuna og er \u00e1litinn verndard\u00fdrlingur \u00cdrlands. \u00cd Englandi og annars sta\u00f0ar \u00ed Evr\u00f3pu \u00e1 mi\u00f0\u00f6ldum var \u00feetta nafn nota\u00f0 til hei\u00f0urs d\u00fdrlingnum. Hins vegar var \u00fea\u00f0 almennt ekki gefi\u00f0 \u00e1 \u00cdrlandi fyrir 17. \u00f6ld vegna \u00feess a\u00f0 \u00fea\u00f0 var tali\u00f0 of heilagt til daglegrar notkunar. \u00dea\u00f0 hefur s\u00ed\u00f0an or\u00f0i\u00f0 mj\u00f6g algengt \u00fear.'), TRUE, 'Patrick');            
