INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3658, STRINGDECODE('Sp\u00e6nskt og port\u00fagalskt form PETER. \u00deetta var nafn a\u00f0eins tveggja keisara \u00ed Brasil\u00edu.'), TRUE, STRINGDECODE('Pedr\u00f3'));          
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3659, STRINGDECODE('Skandinav\u00edskt og bret\u00f3nskt form PETER.'), TRUE, 'Per'); 
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3660, STRINGDECODE('Komi\u00f0 \u00far gr\u00edsku \u03a0\u03ad\u03c4\u03c1\u03bf\u03c2 (Petros) sem \u00fe\u00fd\u00f0ir \u201esteinn\u201c. \u00deetta er \u00fe\u00fd\u00f0ing sem er notu\u00f0 \u00ed flestum \u00fatg\u00e1fum af N\u00fdja testamentinu af nafninu Kefas, sem \u00fe\u00fd\u00f0ir \u201esteinn\u201c \u00e1 arame\u00edsku, sem Jes\u00fas gaf S\u00edmon postula, (samanber Matteus 16:18 og J\u00f3hannes 1:42). S\u00edmon P\u00e9tur var mest \u00e1berandi postulanna \u00ed starfi Jes\u00fa og er oft talinn fyrsti p\u00e1finn. Vegna fr\u00e6g\u00f0ar postulans var\u00f0 \u00feetta nafn algengt um allan hinn kristna heim (\u00ed \u00fdmsum stafsetningum). \u00cd Englandi kynntu Normannar \u00fea\u00f0 \u00ed fornfr\u00f6nsku forminu Piers, sem var sm\u00e1m saman skipt \u00fat fyrir stafsetningu P\u00e9turs sem byrja\u00f0i \u00e1 15. \u00f6ld [1]. Fyrir utan postulann eru a\u00f0rir d\u00fdrlingar me\u00f0 \u00feessu nafni ma si\u00f0b\u00f3tarma\u00f0urinn 11. aldar Saint Peter Damian og Predikarinn fr\u00e1 13. \u00f6ld heilagur P\u00e9tur p\u00edslarvottur. \u00dea\u00f0 var einnig bori\u00f0 af r\u00e1\u00f0am\u00f6nnum \u00ed Aragon, Port\u00fagal og R\u00fasslandi, \u00fear \u00e1 me\u00f0al r\u00fassneski tsarinn P\u00e9tur mikli (1672-1725), sem sigra\u00f0i Sv\u00ed\u00fej\u00f3\u00f0 \u00ed Nor\u00f0ur-str\u00ed\u00f0inu mikla. Me\u00f0al fr\u00e6gra sk\u00e1ldskaparbera eru Peter Rabbit \u00far barnab\u00f3kum Beatrix Potters og Peter Pan, drengurinn sem neita\u00f0i a\u00f0 alast upp \u00ed leikverki J. M. Barrie fr\u00e1 1904.'), TRUE, 'Peter');           
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3661, STRINGDECODE('S\u00e6nskt og norskt form PETER.'), TRUE, 'Petter');             
