INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3695, STRINGDECODE('Fr\u00e1 germanska nafninu Raginhard, sem samanstendur af frumefnunum ragin \u201cr\u00e1\u00f0\u201c og har\u00f0ur \u201chugrakkur, har\u00f0ger\u00f0ur\u201c. Normannar komu me\u00f0 \u00fea\u00f0 til Englands \u00ed formi Reinard, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 hafi aldrei or\u00f0i\u00f0 mj\u00f6g algengt \u00fear. \u00cd s\u00f6gum fr\u00e1 mi\u00f0\u00f6ldum var nafni\u00f0 bori\u00f0 af sl\u00e6gum hetju Reynard refi (me\u00f0 \u00feeim aflei\u00f0ingum a\u00f0 renard er or\u00f0i\u00f0 a\u00f0 fr\u00f6nsku or\u00f0i sem \u00fe\u00fd\u00f0ir \u201erefur\u201c).'), TRUE, STRINGDECODE('Reynar\u00f0'));       
