INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3698, STRINGDECODE('\u00de\u00fd\u00f0ir \u201ehugrakkur h\u00f6f\u00f0ingi\u201c, dreginn af germ\u00f6nskum \u00fe\u00e1ttum ric \u201eh\u00f6f\u00f0ingi, voldugur\u201c og har\u00f0ur \u201ehugrakkur, har\u00f0ger\u00f0ur\u201c. Normannar kynntu \u00feetta nafn fyrir Bretum og \u00fea\u00f0 hefur veri\u00f0 mj\u00f6g algengt \u00fear fr\u00e1 \u00feeim t\u00edma. \u00dea\u00f0 var bori\u00f0 af \u00feremur konungum Englands, \u00fear \u00e1 me\u00f0al Richard I Lionheart, einn af lei\u00f0togum \u00feri\u00f0ju krossfer\u00f0arinnar \u00e1 12. \u00f6ld. \u00c1 s\u00ed\u00f0mi\u00f0\u00f6ldum var \u00feetta nafn venjulega me\u00f0al fimm algengustu karla (me\u00f0 John, William, Robert og T\u00f3mas). \u00dea\u00f0 h\u00e9lst nokku\u00f0 vins\u00e6lt fram \u00e1 n\u00fat\u00edmann og n\u00e1\u00f0i h\u00e1marki \u00ed Bandar\u00edkjunum \u00e1 fj\u00f3r\u00f0a \u00e1ratug s\u00ed\u00f0ustu aldar og \u00ed Sameinu\u00f0u konungsveldinu a\u00f0eins s\u00ed\u00f0ar og f\u00f3r st\u00f6\u00f0ugt f\u00e6kkandi fr\u00e1 \u00feeim t\u00edma. Richard Strauss (1864-1949), sem og breski landk\u00f6nnu\u00f0urinn Sir Richard Burton (1821-1890), bandar\u00edski e\u00f0lisfr\u00e6\u00f0ingurinn Richard Feynman (1918-1988), breski leikarinn Richard Burton (1925-1984) og bandar\u00edski t\u00f3nlistarma\u00f0urinn Little Richard (1932-) .'), TRUE, 'Richard');              
