INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3707, STRINGDECODE('Fr\u00e1 \u00fe\u00fdska nafninu Hrodebert sem \u00fe\u00fd\u00f0ir \u201cbjarta fr\u00e6g\u00f0\u201c, dregi\u00f0 af germ\u00f6nsku frumefnunum hrod \u201cfr\u00e6g\u00f0\u201c og beraht \u201cbjart\u201c. Normannar kynntu \u00feetta nafn fyrir Bretlandi, \u00fear sem \u00fea\u00f0 leysti af h\u00f3lmi gamla enska hli\u00f0st\u00e6\u00f0a Hreodbeorht. \u00dea\u00f0 hefur veri\u00f0 st\u00f6\u00f0ugt me\u00f0al algengustu ensku n\u00f6fnanna fr\u00e1 13. til 20. aldar. \u00cd Bandar\u00edkjunum var \u00fea\u00f0 vins\u00e6lasta nafni\u00f0 fyrir str\u00e1ka \u00e1 \u00e1runum 1924 til 1939 (og aftur 1953). \u00deetta nafn hefur veri\u00f0 bori\u00f0 af tveimur frumk\u00f3ngum Frakklands, tveimur hertogum \u00ed Normand\u00ed og \u00feremur konungum Skotlands, \u00fear \u00e1 me\u00f0al Robert the Bruce. sem endurheimti sj\u00e1lfst\u00e6\u00f0i Skotlands fr\u00e1 Englandi \u00e1 14. \u00f6ld. Rith\u00f6fundurinn Robert Browning (1812-1889) og sk\u00e1ldin Robert Burns (1759-1796) og Robert Frost (1874-1963) eru fr\u00e6gir b\u00f3kmenntakennarar me\u00f0 \u00feessu nafni. A\u00f0rir handhafar eru Robert E. Lee (1807-1870), yfirma\u00f0ur samtakahersins \u00ed borgarastyrj\u00f6ldinni \u00ed Bandar\u00edkjunum, og bandar\u00edsku leikararnir Robert Redford (1936-), Robert De Niro (1943-) og Robert Downey Jr. (1965- ).'), TRUE, 'Robert');   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3708, STRINGDECODE('Fr\u00e1 germanska heitinu Hrolf (e\u00f0a fornnorr\u00e6nt samheiti Hr\u00f3lfr), samdr\u00e1ttarform Hrodulf (sj\u00e1 RUDOLF). Normannar kynntu \u00feetta nafn fyrir Englandi en \u00fea\u00f0 var\u00f0 flj\u00f3tt sjaldg\u00e6ft. \u00cd n\u00fat\u00edmanum hefur \u00fea\u00f0 stundum veri\u00f0 nota\u00f0 \u00ed enskum\u00e6landi heimi sem \u00fe\u00fdskur innflutningur.'), TRUE, 'Rolf');        
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3709, STRINGDECODE('Skosk mynd af RAGNVALDR, nafn sem Skandinav\u00edskir landnemar og innr\u00e1sarmenn kynntu Skotlandi. \u00dea\u00f0 var\u00f0 vins\u00e6lt utan Skotlands \u00e1 20. \u00f6ldinni. Fr\u00e6gur handhafi var bandar\u00edski leikarinn og forsetinn Ronald Reagan (1911-2004).'), TRUE, 'Ronald');
