INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3713, STRINGDECODE('\u00cdtalskt form s\u00ed\u00f0-lat\u00ednu Romaeus e\u00f0a s\u00ed\u00f0-gr\u00edsku \u03a1\u03c9\u03bc\u03b1\u1fd6\u03bf\u03c2 (Romaios), sem \u00fe\u00fdddi \u201efr\u00e1 R\u00d3M\u201c e\u00f0a \u201er\u00f3mverskt\u201c. \u00c1 \u00edt\u00f6lsku mi\u00f0alda \u00fe\u00fdddi \u00feetta \u201ep\u00edlagr\u00edma til R\u00f3mar\u201c. Romeo er \u00feekktastur sem elskhugi J\u00fal\u00edu \u00ed h\u00f6rmungum Shakespeares R\u00f3me\u00f3 og J\u00fal\u00edu (1596).'), TRUE, STRINGDECODE('R\u00f3me\u00f3'));               
