INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3724, STRINGDECODE('Fr\u00e1 germanska heitinu Hrodulf, sem var dregi\u00f0 af frumefnunum hrod \u201cfr\u00e6g\u00f0\u201c og wulf \u201c\u00falfur\u201c. \u00dea\u00f0 var bori\u00f0 af \u00feremur konungum B\u00fargundar, svo og nokkrum Habsborgarh\u00f6f\u00f0ingjum Heilaga r\u00f3mverska heimsveldisins og Austurr\u00edki. Anthony Hope nota\u00f0i \u00feetta nafn fyrir hetjuna \u00ed vins\u00e6lli sk\u00e1lds\u00f6gu sinni Fanginn af Zenda (1894).'), TRUE, 'Rudolf');           
