INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3747, STRINGDECODE('Fr\u00e1 hebreska heitinu \u05e9\u05b4\u05c1\u05de\u05b0\u05e9\u05c1\u05d5\u05b9\u05df (Shimshon), dregi\u00f0 af \u05e9\u05b6\u05c1\u05de\u05b6\u05e9\u05c1 (shemesh) sem \u00fe\u00fd\u00f0ir \u201cs\u00f3l\u201c. Samson var hetja fr\u00e1 Gamla testamentinu sem Gu\u00f0 veitti \u00f3venjulegan styrk. H\u00fasfreyja hans, Delila, sveik hann og klippti \u00e1 s\u00e9r h\u00e1ri\u00f0 og svipti hann m\u00e1tti s\u00ednum. \u00deannig var hann tekinn af Filistum, blinda\u00f0ur og f\u00e6r\u00f0ur \u00ed musteri \u00feeirra. En \u00ed lokaafreki dr\u00f3 hann ni\u00f0ur s\u00falur musterisins yfir sig og hernema s\u00edna. \u00deetta nafn var \u00feekkt me\u00f0al Normanna vegna velska biskups Saint Samson, sem stofna\u00f0i klaustur \u00ed Bretagne og Normand\u00ed \u00e1 6. \u00f6ld. \u00cd hans tilviki g\u00e6ti nafni\u00f0 veri\u00f0 \u00fe\u00fd\u00f0ing \u00e1 sanna keltneska nafni hans. Sem enskt nafn var Samson algengur \u00e1 mi\u00f0\u00f6ldum, en Normandi haf\u00f0i kynnt hann.'), TRUE, 'Samson');      
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3748, STRINGDECODE('hebreska: Gu\u00f0 hefur b\u00e6nheyrt (1. Sam. 1, 20).'), TRUE, STRINGDECODE('Sam\u00fael'));    
