INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3752, STRINGDECODE('l\u00edklega saxneskur ma\u00f0ur, fremur en a\u00f0 \u00fea\u00f0 s\u00e9 dregi\u00f0 af vopnsheitinu sax. Vi\u00f0 son landn\u00e1msmanns er Saxahvoll kenndur.'), TRUE, 'Saxi');               
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3753, STRINGDECODE('Fr\u00e1 latneska nafninu Sebastianus, sem \u00fe\u00fdddi \u201efr\u00e1 Sebaste\u201c. Sebaste var nafni\u00f0 b\u00e6r \u00ed Litlu-As\u00edu en nafn \u00feess er dregi\u00f0 af gr\u00edsku \u03c3\u03b5\u03b2\u03b1\u03c3\u03c4\u03cc\u03c2 (sebastos) sem \u00fe\u00fd\u00f0ir \u201evir\u00f0ulegur\u201c (\u00fe\u00fd\u00f0ing \u00e1 lat\u00ednu \u00c1g\u00fast, titill r\u00f3mversku keisaranna). Samkv\u00e6mt kristnum si\u00f0 var Saint Sebastian r\u00f3mverskur herma\u00f0ur \u00e1 3. \u00f6ld p\u00edslarv\u00e6ttur \u00ed ofs\u00f3knum Diocletianusar keisara. Eftir a\u00f0 hann uppg\u00f6tva\u00f0ist kristinn var hann bundinn vi\u00f0 staur og skotinn me\u00f0 \u00f6rvum. \u00deetta drap hann \u00fe\u00f3 ekki. Heilagur Irene fr\u00e1 R\u00f3m l\u00e6kna\u00f0i hann og hann sneri aftur til a\u00f0 \u00e1minna Diocletianus pers\u00f3nulega, \u00fear sem keisarinn l\u00e9t berja hann til bana. Vegna vins\u00e6lda d\u00fdrlingsins kom nafni\u00f0 \u00ed almenna notkun \u00ed Evr\u00f3pu \u00e1 mi\u00f0\u00f6ldum, s\u00e9rstaklega \u00e1 Sp\u00e1ni og \u00ed Frakklandi. \u00dea\u00f0 var einnig bori\u00f0 af 16. aldar konungi \u00ed Port\u00fagal sem l\u00e9st \u00ed krossfer\u00f0 gegn Marokk\u00f3.'), TRUE, 'Sebastian');         
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3754, STRINGDECODE('Fr\u00e1 latneska nafninu Sebastianus, sem \u00fe\u00fdddi \u201efr\u00e1 Sebaste\u201c. Sebaste var nafni\u00f0 b\u00e6r \u00ed Litlu-As\u00edu en nafn \u00feess er dregi\u00f0 af gr\u00edsku \u03c3\u03b5\u03b2\u03b1\u03c3\u03c4\u03cc\u03c2 (sebastos) sem \u00fe\u00fd\u00f0ir \u201evir\u00f0ulegur\u201c (\u00fe\u00fd\u00f0ing \u00e1 lat\u00ednu \u00c1g\u00fast, titill r\u00f3mversku keisaranna). Samkv\u00e6mt kristnum si\u00f0 var Saint Sebastian r\u00f3mverskur herma\u00f0ur \u00e1 3. \u00f6ld p\u00edslarv\u00e6ttur \u00ed ofs\u00f3knum Diocletianusar keisara. Eftir a\u00f0 hann uppg\u00f6tva\u00f0ist kristinn var hann bundinn vi\u00f0 staur og skotinn me\u00f0 \u00f6rvum. \u00deetta drap hann \u00fe\u00f3 ekki. Heilagur Irene fr\u00e1 R\u00f3m l\u00e6kna\u00f0i hann og hann sneri aftur til a\u00f0 \u00e1minna Diocletianus pers\u00f3nulega, \u00fear sem keisarinn l\u00e9t berja hann til bana. Vegna vins\u00e6lda d\u00fdrlingsins kom nafni\u00f0 \u00ed almenna notkun \u00ed Evr\u00f3pu \u00e1 mi\u00f0\u00f6ldum, s\u00e9rstaklega \u00e1 Sp\u00e1ni og \u00ed Frakklandi. \u00dea\u00f0 var einnig bori\u00f0 af 16. aldar konungi \u00ed Port\u00fagal sem l\u00e9st \u00ed krossfer\u00f0 gegn Marokk\u00f3.'), TRUE, STRINGDECODE('Sebast\u00edan'));      
