INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3988, STRINGDECODE('\u00de\u00fdska mynd THEODORE, sem og skandinav\u00edsk, t\u00e9kknesk og r\u00famensk afbrig\u00f0i af TEODOR. Fr\u00e6gur flutningsma\u00f0ur var bandar\u00edski barnab\u00f3kah\u00f6fundurinn Theodor Seuss Geisel (1904-1991), betur \u00feekktur sem Dr. Seuss.'), TRUE, STRINGDECODE('Theod\u00f3r'));    
