INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3990, STRINGDECODE('Gr\u00edsk mynd af arame\u00edska nafninu \u05ea\u05b8\u05bc\u05d0\u05d5\u05b9\u05de\u05b8\u05d0 (Ta`oma `) sem \u00fe\u00fd\u00f0ir \u201ctv\u00edburi\u201c. \u00cd N\u00fdja testamentinu er \u00feetta nafn postula. \u00deegar hann fr\u00e9tti a\u00f0 Jes\u00fas v\u00e6ri risinn upp fr\u00e1 dau\u00f0um efa\u00f0ist hann upphaflega um s\u00f6guna, \u00fear til Jes\u00fas birtist fyrir honum og hann sko\u00f0a\u00f0i s\u00e1r s\u00edn sj\u00e1lfur. Samkv\u00e6mt hef\u00f0 var hann p\u00edslarv\u00e6ttur \u00e1 Indlandi. Vegna fr\u00e6g\u00f0ar sinnar kom nafni\u00f0 \u00ed almenna notkun \u00ed hinum kristna heimi. \u00c1 Englandi var nafni\u00f0 kynnt af Norm\u00f6nnum og var\u00f0 mj\u00f6g vins\u00e6lt vegna heilags Thomas Becket, erkibiskups fr\u00e1 Kantaraborg og p\u00edslarvottur \u00e1 12. \u00f6ld. \u00dea\u00f0 var \u00e1rei\u00f0anlega me\u00f0al fimm helstu algengustu ensku nafna drengja fr\u00e1 13. til 19. aldar og \u00fea\u00f0 hefur veri\u00f0 st\u00f6\u00f0ugt vins\u00e6lt fram \u00e1 \u00feennan dag. Annar athyglisver\u00f0ur d\u00fdrlingur me\u00f0 \u00feessu nafni var \u00edtalski heimspekingurinn og gu\u00f0fr\u00e6\u00f0ingurinn 13. aldar Thomas Aquinas, er talinn l\u00e6knir kirkjunnar. A\u00f0rir fr\u00e6gir handhafar eru me\u00f0al annars heimspekingurinn Thomas Hobbes (1588-1679), Thomas Jefferson Bandar\u00edkjaforseti (1743-1826), sk\u00e1ldsagnah\u00f6fundurinn Thomas Hardy (1840-1928) og uppfinningama\u00f0urinn Thomas Edison (1847-1931).'), TRUE, 'Thomas');          
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3991, STRINGDECODE('Fr\u00e1 norr\u00e6na \u00de\u00f3rr sem \u00fe\u00fd\u00f0ir \u201c\u00ferumur\u201c, a\u00f0 lokum fr\u00e1 frum-germ\u00f6nsku * \u00deunraz. \u00de\u00f3r var norr\u00e6ni gu\u00f0 styrks, \u00ferumu, str\u00ed\u00f0s og storma, sonur \u00d3\u00f0ins. Hann var vopna\u00f0ur hamri sem kalla\u00f0ur var Mj\u00f6lnir og var me\u00f0 t\u00f6fra belti sem tv\u00f6falda\u00f0i styrk hans.'), TRUE, 'Thor');           
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(3992, STRINGDECODE('Gamall \u00edslenskur \u00de\u00f3rr, nafn \u00ferumugu\u00f0sins, sem stafar af frumgerm\u00f6nsku \u00feunraz \u201e\u00ferumu\u201c + forn\u00edslensku bergi, sem dregur af frumgermanskri bergaz \u201efjall, h\u00e6\u00f0\u201c.'), TRUE, 'Thorberg');     
