INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4009, STRINGDECODE('Gr\u00edskt form TOBIAH. \u00deetta er nafn hetjunnar ap\u00f3kr\u00fdfu T\u00f3b\u00edtarb\u00f3kar, sem birtist \u00ed m\u00f6rgum enskum \u00fatg\u00e1fum af Gamla testamentinu. \u00dea\u00f0 fjallar um \u00fea\u00f0 hvernig sonur Tob\u00edts, Tobias, me\u00f0 hj\u00e1lp engilsins Rafaels, er f\u00e6r um a\u00f0 hrekja burt p\u00fakann sem hefur hrj\u00e1\u00f0 S\u00f6ru, sem s\u00ed\u00f0an ver\u00f0ur kona hans. \u00deessi saga var vins\u00e6l \u00e1 mi\u00f0\u00f6ldum og nafni\u00f0 kom einstaka sinnum \u00ed notkun \u00ed hlutum Evr\u00f3pu \u00e1 \u00feeim t\u00edma. \u00c1 Englandi var\u00f0 \u00fea\u00f0 algengt eftir si\u00f0askipti m\u00f3tm\u00e6lenda.'), TRUE, STRINGDECODE('Tob\u00edas'));          
