INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4019, STRINGDECODE('N\u00fat\u00edma skandinav\u00edsk form \u00de\u00f3rs (sj\u00e1 THOR). \u00dea\u00f0 var ekki nota\u00f0 sem pers\u00f3nulegt nafn fyrr en \u00e1 18. \u00f6ld. \u00dea\u00f0 er stundum nota\u00f0 sem stutt form nafna af fornorr\u00e6num uppruna sem byrja \u00e1 frumefninu Tor, sem er einnig aflei\u00f0a \u00de\u00f3rs.'), TRUE, STRINGDECODE('T\u00f3r'));             
