INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4022, STRINGDECODE('Heimildir eru um nafni\u00f0 fr\u00e1 s\u00ed\u00f0ari hluta 18. aldar og var \u00fea\u00f0 rita\u00f0 Silpha. Nafnmyndin Sylva \u00feekkist \u00ed Noregi sem hli\u00f0armynd af Sylvia en er einnig talin myndu\u00f0 beint af latneska nafnor\u00f0inu silva \u00b4sk\u00f3gur\u00b4. \u00cdslenska nafni\u00f0 Silf\u00e1 er laga\u00f0 eftir \u00feeirri nafnmynd.'), TRUE, 'Tristan');      
