INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4032, STRINGDECODE('\u00de\u00fd\u00f0ir b\u00f3kstaflega \u201eugluspegill\u201c, fenginn \u00far \u00edslenskri uglu \u201euglu\u201c \u00e1samt spegill \u201espegill, gler\u201c. \u00deetta fornafn er bein \u00edslensk \u00fe\u00fd\u00f0ing \u00e1 Ulenspegel, sem er eftirnafn DYL Ulenspegel (\u00feekkt \u00ed samt\u00edsku \u00fe\u00fdsku sem TILL Eulenspiegel ), br\u00f6g\u00f0ukona \u00far mi\u00f0-l\u00e1g\u00fe\u00fdskri \u00fej\u00f3\u00f0tr\u00fa. Eftirnafni\u00f0 hans er \u00f3eiginlegt, \u00fear sem \u00fea\u00f0 v\u00edsar ekki a\u00f0eins til h\u00e6fileika hans til a\u00f0 plata f\u00f3lk, heldur einnig heimsku f\u00f3lksins sem l\u00e9t blekkja sig af honum. \u00de\u00fa s\u00e9r\u00f0 a\u00f0 \u00e1 \u00feeim t\u00edma og sta\u00f0 \u00fear sem s\u00f6gur af Ulenspegel komu fyrst upp \u00e1 yfirbor\u00f0i\u00f0 (\u00fe.e. \u00de\u00fdskalandi fr\u00e1 14. \u00f6ld) var uglan t\u00e1kn heimsku, frekar en visku (eins og h\u00fan er n\u00fa \u00e1 t\u00edmum). \u00cd sambandi vi\u00f0 mi\u00f0l\u00e1g\u00fe\u00fdska or\u00f0i\u00f0 spegel \u201espegill\u201c er lj\u00f3st a\u00f0 eftirnafn Dyls v\u00edsar til \u00feess a\u00f0 (me\u00f0 \u00fev\u00ed a\u00f0 plata \u00fe\u00e1) s\u00fdnir hann f\u00f3lki sj\u00e1lfum s\u00e9r, hva\u00f0 \u00fea\u00f0 er \u00ed raun: eins heimskur og ugla.'), TRUE, 'Ugluspegill');   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4033, STRINGDECODE('merking vafas\u00f6m. Kemur fyrir um 1200.'), TRUE, 'Ullur');     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4034, STRINGDECODE('Fr\u00e1 \u00fe\u00fdska heitinu Odalric sem \u00fe\u00fd\u00f0ir \u201cvelmegun og kraftur\u201c, \u00far frumefninu odal \u201carfleif\u00f0\u201c \u00e1samt ric \u201ch\u00f6f\u00f0ingja, voldugur\u201c. \u00dea\u00f0 hefur lengi veri\u00f0 rugla\u00f0 saman vi\u00f0 germanska nafni\u00f0 Hulderic. \u00deetta var nafn tveggja \u00fe\u00fdskra d\u00fdrlinga. Annar fr\u00e6gur flutningsma\u00f0ur var Ulrich Zwingli (1484-1531), einnig \u00feekktur sem Huldrych, lei\u00f0togi si\u00f0b\u00f3tarinnar \u00ed Sviss.'), TRUE, 'Ulrich');        
