INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4094, STRINGDECODE('Geir helga\u00f0ur v\u00e9um. ,,Geir h\u00e9t ma\u00f0ur \u00e1g\u00e6tur \u00ed Sogni; hann var kalla\u00f0ur V\u00e9geir, \u00fev\u00ed hann var bl\u00f3tma\u00f0ur mikill. Hann \u00e1tti m\u00f6rg b\u00f6rn. V\u00e9bj\u00f6rn Sygnakappi var elztur sona hans, og V\u00e9steinn, V\u00e9\u00feormur, V\u00e9mundur, V\u00e9gestur og V\u00e9\u00feorn, en V\u00e9d\u00eds d\u00f3ttir\u201c(Landn\u00e1ma). B\u00e6jarnafni\u00f0 V\u00e9geirssta\u00f0ir s\u00fdnir, a\u00f0 mannsnafni\u00f0 V\u00e9geir hefur veri\u00f0 nota\u00f0 h\u00e9r.'), TRUE, STRINGDECODE('V\u00e9geir'));    
