INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4099, STRINGDECODE('R\u00f3mverskt nafn sem \u00fe\u00fd\u00f0ir \u201csigurvegari, sigurvegari\u201c \u00e1 lat\u00ednu. \u00dea\u00f0 var algengt me\u00f0al frumkristinna og var bori\u00f0 af nokkrum fyrstu d\u00fdrlingum og \u00feremur p\u00e1fum. \u00dea\u00f0 var sjaldg\u00e6ft sem enskt nafn \u00e1 mi\u00f0\u00f6ldum, en \u00fea\u00f0 var endurvaki\u00f0 \u00e1 19. \u00f6ld. Fr\u00e6gur handhafi var franski rith\u00f6fundurinn Victor Hugo (1802-1885), sem skrifa\u00f0i Hunchback of Notre Dame og Les Mis\u00e9rables.'), TRUE, 'Victor');   
