INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4125, STRINGDECODE('Fr\u00e1 r\u00f3mverska nafninu Vincentius, sem var dregi\u00f0 af lat\u00ednu vincere sem \u00fe\u00fd\u00f0ir \u201ea\u00f0 sigra\u201c. \u00deetta nafn var vins\u00e6lt me\u00f0al frumkristinna og var bori\u00f0 af m\u00f6rgum d\u00fdrlingum. Sem enskt nafn hefur Vincent veri\u00f0 \u00ed notkun fr\u00e1 mi\u00f0\u00f6ldum, \u00fe\u00f3 a\u00f0 \u00fea\u00f0 hafi ekki or\u00f0i\u00f0 algengt fyrr en \u00e1 19. \u00f6ld. Me\u00f0al fr\u00e6gra bur\u00f0ara\u00f0ila eru franski presturinn Saint Vincent de Paul (1581-1660) og post-impression\u00edskur m\u00e1lari Vincent van Gogh (1853-1890).'), TRUE, 'Vincent');      
