INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4128, STRINGDECODE('\u00dar r\u00f3mverska \u00e6ttarnafninu Vergilius, sem hefur \u00f3\u00feekkta merkingu. \u00deetta nafn bar r\u00f3mverska sk\u00e1ldi\u00f0 Publius Vergilius Maro \u00e1 1. \u00f6ld f.Kr., almennt kalla\u00f0 Virgil, sem var rith\u00f6fundur Aeneid. Vegna hans hefur Virgil veri\u00f0 \u00ed notkun sem eiginnafn \u00ed enskum\u00e6landi heimi s\u00ed\u00f0an \u00e1 19. \u00f6ld.'), TRUE, 'Virgil');               
