INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4146, STRINGDECODE('Fr\u00e1 germ\u00f6nsku nafni sem \u00fe\u00fd\u00f0ir \u201ch\u00f6f\u00f0ingi hersins\u201c, sem samanstendur af frumefnunum \u201cvald\u201c og hari \u201cher\u201c. Normannar komu me\u00f0 \u00fea\u00f0 til Englands, \u00fear sem \u00fea\u00f0 leysti af h\u00f3lmi gamla enska hli\u00f0st\u00e6\u00f0a Wealdhere. Fr\u00e6gur handhafi nafnsins var enski kurteisi, sk\u00e1ld og landk\u00f6nnu\u00f0ur Sir Walter Raleigh (1552-1618). \u00dea\u00f0 bar einnig Sir Walter Scott (1771-1832), skoskur sk\u00e1ldsagnah\u00f6fundur sem skrifa\u00f0i Ivanhoe og \u00f6nnur athyglisver\u00f0 verk.'), TRUE, 'Walter');               
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4147, STRINGDECODE('Fr\u00e1 germ\u00f6nsku nafni dregi\u00f0 af \u201cv\u00f6rn\u201c Warin \u00e1samt hari \u201cher\u201c.'), TRUE, 'Werner');     
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4148, STRINGDECODE('\u00de\u00fdska hli\u00f0st\u00e6\u00f0a WILLIAM. \u00deetta var nafn tveggja \u00fe\u00fdskra keisara. \u00dea\u00f0 var einnig millinafn nokkurra heimspekinga fr\u00e1 \u00de\u00fdskalandi: Georg Wilhelm Friedrich Hegel (1770-1831), Friedrich Wilhelm Nietzsche (1844-1900) og Gottfried Wilhelm von Leibniz (1646-1716), sem einnig var merkur st\u00e6r\u00f0fr\u00e6\u00f0ingur.'), TRUE, 'Wilhelm');   
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4149, STRINGDECODE('Fr\u00e1 ensku eftirnafni sem var dregi\u00f0 af germanska eiginnafninu WILLIHARD (e\u00f0a gamla enska fylgiskyldan Wilheard).'), TRUE, 'Willard');              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4150, STRINGDECODE('Fr\u00e1 germanska heitinu Willahelm sem \u00fe\u00fd\u00f0ir \u201cmun hj\u00e1lm\u201c, samsettur \u00far \u00feeim \u00fe\u00e1ttum sem vilja \u201cvilja, l\u00f6ngun\u201c og hj\u00e1lm \u201chj\u00e1lm, vernd\u201c. Heilagur Vilhj\u00e1lmur af Gellone var fr\u00e6ndi 8. aldar Karlamagn\u00fas sem var\u00f0 munkur. Nafni\u00f0 var algengt me\u00f0al Normanna og \u00fea\u00f0 var\u00f0 mj\u00f6g vins\u00e6lt \u00e1 Englandi eftir a\u00f0 Vilhj\u00e1lmur sigrari var vi\u00f0urkenndur sem fyrsti Norman-konungur Englands \u00e1 11. \u00f6ld. Fr\u00e1 \u00feeim t\u00edma og fram \u00e1 n\u00fat\u00edmann hefur \u00fea\u00f0 veri\u00f0 me\u00f0al algengustu ensku nafna (me\u00f0 John, Thomas og Robert). \u00deetta nafn var s\u00ed\u00f0ar bori\u00f0 af \u00feremur \u00f6\u00f0rum enskum konungum auk h\u00f6f\u00f0ingja \u00ed Skotlandi, Sikiley (af norm\u00f6nskum uppruna), Holland og Pr\u00fassland. A\u00f0rir fr\u00e6gir handhafar eru William Wallace, skosk hetja fr\u00e1 13. \u00f6ld, og William Tell, go\u00f0sagnakennd svissnesk hetja fr\u00e1 14. \u00f6ld (kalla\u00f0 Wilhelm \u00e1 \u00fe\u00fdsku, Guillaume \u00e1 fr\u00f6nsku og Guglielmo \u00e1 \u00edt\u00f6lsku). \u00cd b\u00f3kmenntaheiminum var \u00fea\u00f0 bori\u00f0 af leikaranum William Shakespeare (1564-1616), sk\u00e1ldinu William Blake (1757-1827), sk\u00e1ldinu William Wordsworth (1770-1850), leikaranum William Butler Yeats (1865-1939), rith\u00f6fundinum William Faulkner (1897 -1962), og rith\u00f6fundurinn William S. Burroughs (1914-1997). \u00cd bandar\u00edsku s\u00e6ti (s\u00ed\u00f0an 1880) hefur \u00feetta nafn aldrei veri\u00f0 \u00far topp 20, sem gerir \u00fea\u00f0 a\u00f0 einu vins\u00e6lasta nafninu (\u00fe\u00f3 a\u00f0 \u00fea\u00f0 hafi aldrei n\u00e1\u00f0 efsta s\u00e6ti). \u00cd n\u00fat\u00edmanum hefur stuttmynd \u00feess, Liam, reglulega veri\u00f0 vins\u00e6lli en William sj\u00e1lfur, \u00ed Bretlandi \u00e1 t\u00edunda \u00e1ratug s\u00ed\u00f0ustu aldar og Bandar\u00edkjunum \u00e1 fimmta \u00e1ratug s\u00ed\u00f0ustu aldar.'), TRUE, 'William');        
