INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4182, STRINGDECODE('\u00fej\u00f3\u00f0 og \u00dalfur. T\u00ed\u00f0ka\u00f0ist fr\u00e1 upphafi og fram \u00e1 16. \u00f6ld og kemur fyrir \u00ed manntalinu 1910. Kemur fyrir \u00ed \u00fdmsum \u00f6rnefnum: \u00dej\u00f3\u00f0\u00f3lfshaga, \u00dej\u00f3\u00f0\u00f3lfsh\u00f6fn, \u00dej\u00f3\u00f0\u00f3lfsholti, \u00dej\u00f3\u00f0\u00f3lfstungu.'), TRUE, STRINGDECODE('\u00dej\u00f3\u00f0\u00f3lfur'));              
INSERT INTO "PUBLIC"."NAME_CARD" VALUES(4183, STRINGDECODE('voldugur konungur. \u00dej\u00f3\u00f0rekur kemur fyrir nokkrum sinnum \u00ed hei\u00f0num si\u00f0, og fr\u00e1 landn\u00e1ms\u00f6ld stafar \u00f6rnefni\u00f0 \u00dej\u00f3\u00f0rekssk\u00e1li. S\u00ed\u00f0ar berst hinga\u00f0 \u00fe\u00fdzka t\u00f6kuheiti\u00f0 \u00dei\u00f0rekur og er s\u00f6mu merkingar og \u00dej\u00f3\u00f0rekur, og mun \u00fea\u00f0 heiti hafa aukizt a\u00f0 vins\u00e6ldum fyrir \u00e1hrif fr\u00e1 \u00dei\u00f0reks s\u00f6gu af Bern. Enn s\u00ed\u00f0ar berst hinga\u00f0 myndin \u00dei\u00f0rik, og loks fer Di\u00f0rik a\u00f0 t\u00ed\u00f0kast. Di\u00f0rik og \u00dei\u00f0rik koma fyrir \u00ed mannt\u00f6lunum 1855 og 1910, en eins\u00e6tt er, a\u00f0 nafn \u00feetta er \u00dej\u00f3\u00f0rekur \u00e1 \u00edslenzku, og m\u00e6tti jafnvel una vi\u00f0 nafni\u00f0 \u00dei\u00f0rekur.'), TRUE, STRINGDECODE('\u00dej\u00f3\u00f0rekur'));         
